			Rows.Add( new DocumentationRow("ID_HELP_GOOGLESETUP", "Whether you decide to provide Google2u with your authentication or not, this step is mandatory. You must have a Google account in order to use Google2u. If you already have a Google account, and wish to use this account with Google2u, you may skip to the next step.", "Que vous décidiez de fournir Google2u avec votre authentification ou non, cette étape est obligatoire. Vous devez avoir un compte Google pour utiliser Google2u. Si vous avez déjà un compte Google, et que vous souhaitez utiliser ce compte avec Google2u, vous pouvez passer à l'étape suivante.", "Se si decide di fornire Google2u con l'autenticazione o no, questo passaggio è obbligatorio. È necessario disporre di un account Google per utilizzare Google2u. Se hai già un account Google, e si desidera utilizzare questo account con Google2u, si può passare alla fase successiva.", "Ob Sie Google2u mit Authentifizierung oder nicht liefert, ist dieser Schritt zwingend. Sie müssen ein Google-Konto, um Google2u verwenden. Wenn Sie bereits über ein Google-Konto und möchten dieses Konto mit Google2u verwenden, können Sie zum nächsten Schritt übergehen.", "Ya sea que decida proporcionar Google2u con su autenticación o no, este paso es obligatorio. Debe tener una cuenta de Google para poder utilizar Google2u. Si ya tienes una cuenta de Google, y desea utilizar esta cuenta con Google2u, puede pasar a la siguiente etapa.", "ما إذا كنت قررت توفير Google2u مع مصادقة الخاص بك أو لا، هذه الخطوة هي إلزامية. يجب أن يكون لديك حساب Google من أجل استخدام Google2u. إذا كان لديك بالفعل حساب Google، وترغب في استخدام هذا الحساب مع Google2u، قد انتقل إلى الخطوة التالية.", "无论你决定提供Google2u与您的身份验证或没有，这一步是强制性的。你必须拥有一个谷歌帐户才能使用Google2u。如果你已经有一个谷歌帐户，并希望使用该帐户Google2u，您可以跳到下一个步骤。", "あなたの認証またはしないでGoogle2uを提供することにしたかどうかは、このステップは必須です。あなたはGoogle2uを使用するには、Googleアカウントを持っている必要があります。既にGoogleアカウントを持っている、とGoogle2uでこのアカウントを使用したい場合は、次のステップにスキップすることができる。", "당신이 당신의 인증 여부를 Google2u을 제공하기로 결정하든,이 단계는 필수입니다. 당신은 Google2u를 사용하려면 구글 계정이 있어야합니다. 이미 구글 계정을 가지고 있고, Google2u이 계정을 사용하고자하는 경우에는 다음 단계로 건너 뛸 수 있습니다.", "Cho dù bạn quyết định để cung cấp Google2u với sự thẩm định của bạn hay không, bước này là bắt buộc. Bạn phải có một tài khoản Google để sử dụng Google2u. Nếu bạn đã có một tài khoản Google, và muốn sử dụng tài khoản này với Google2u, bạn có thể bỏ qua bước tiếp theo.", "Если вы решили предоставить Google2u с аутентификацией или нет, этот шаг является обязательным. Вы должны иметь учетную запись Google для использования Google2u. Если у вас уже есть учетная запись Google, и вы хотите использовать эту учетную запись с Google2u, вы можете перейти к следующему шагу.", "Of je besluit om Google2u voorzien van uw authenticatie of niet, deze stap is verplicht. U moet een Google-account hebben om Google2u gebruiken. Als u al een Google-account, en u wilt deze rekening met Google2u gebruikt, kunt u doorgaan naar de volgende stap."));
