			Rows.Add( new DocumentationRow("ID_HELP_GOOGLEACCOUNTPROTECTION", "Google Accounts are normally protected from Third Party access. If you decide to use Two Step Authentication, then you will need to generate a password specifically for Google2u. If you do not use Two Step Authentication then you will need to grant Third Party Access to your account.", "Comptes Google sont normalement protégés de l'accès des tiers. Si vous décidez d'utiliser l'authentification en deux étapes, alors vous aurez besoin pour générer un mot de passe spécifiquement pour Google2u. Si vous ne utilisez pas l'authentification en deux étapes, alors vous aurez besoin d'accorder l'accès des tiers à votre compte.", "Google Accounts sono normalmente protetti dall'accesso dei terzi. Se si decide di utilizzare l'autenticazione Two Step, allora si avrà bisogno di generare una password specifica per Google2u. Se non si utilizza l'autenticazione a due passo sarà necessario concedere accesso di terzi al tuo account.", "Google-Konten werden in der Regel vor dem Zugriff Dritter geschützt. Wenn Sie sich entscheiden, Two Step-Authentifizierung zu verwenden, dann müssen Sie ein Kennwort ein, die speziell für Google2u erzeugen. Wenn Sie nicht mit Two Step Authentication dann müssen Sie für den Zugang Dritter zu Ihrem Konto gewähren.", "Cuentas de Google están normalmente protegidos contra el acceso de terceros. Si decide utilizar la autenticación de dos pasos, entonces usted tendrá que generar una contraseña específicamente para Google2u. Si usted no utiliza autenticación de dos Paso entonces usted tendrá que conceder acceso de terceros a su cuenta.", "محمية حسابات Google عادة من الوصول للطرف الثالث. إذا قررت استخدام مصادقة من خطوتين، ثم سوف تحتاج إلى إنشاء كلمة مرور خصيصا لGoogle2u. إذا كنت لا تستخدم اثنين من مصادقة الخطوة ثم سوف تحتاج إلى منح الوصول الطرف الثالث إلى حسابك.", "谷歌帐户通常不受第三方接入。如果您决定使用两步验证，那么你就需要专门生成一个密码Google2u。如果你不使用两步验证，那么你将需要授予第三方访问您的帐户。", "Googleアカウントは通常、第三者のアクセスから保護されています。あなたは二つのステップ認証を使