			Rows.Add( new DocumentationRow("ID_HELP_WORKSHEETNAME", "The name of the Worksheet will designate the output class name.\n\nInternally the Worksheet name will be converted to a class name, so C# variable name rules apply:\nID's must begin with a letter or underscore\nID's must not contain spaces or other non-letter characters (except underscores)", "Le nom de la feuille de calcul va désigner le nom de la classe de sortie.\n\nEn interne, le nom Feuille sera converti en un nom de classe, de sorte que C # règles de nom de variable se appliquent:\nIdentifiants doivent commencer par une lettre ou un trait de soulignement\nIdentifiants ne doivent pas contenir d'espaces ou d'autres caractères non-lettre (à l'exception de soulignement)", "Il nome del foglio di lavoro designerà il nome della classe di uscita.\n\nInternamente il nome del foglio di lavoro verrà convertito in un nome di classe, in modo da applicare C # norme nome variabile:\nID del devono iniziare con una lettera o di sottolineatura\nID non devono contenere spazi o altri caratteri non-lettere (ad eccezione di sottolineatura)", "Der Name des Arbeitsblatts wird das Ausgabeklassennamen zu benennen.\n\nIntern werden die Arbeitsblattname wird zu einem Klassennamen umgewandelt werden kann, so gelten C # Variablenname Regeln:\nID muss mit einem Buchstaben oder Unterstrich beginnen\nIDs dürfen keine Leerzeichen oder anderen nicht-Buchstaben-Zeichen (außer Unterstrich) enthalten", "El nombre de la hoja de trabajo designará el nombre de la clase de salida.\n\nInternamente, el nombre de la hoja de trabajo se convertirá en un nombre de clase, por lo que se aplican C # Reglas de nombres de variables:\nIdentificaciones deben comenzar con una letra o un guión bajo\nDe identificación no deben contener espacios u otros caracteres que no sean letras (excepto guiones bajos)", "واسم ورقة عمل يعين اسم فئة الانتاج.\n\nداخليا سيتم تحويل اسم ورقة العمل إلى اسم الفئة، لذلك تنطبق قواعد C # اسم متغير:\nيجب إسم البائع تبدأ بحرف أو تسطير\nيجب أن لا يحتوي إسم البائع مسافات أو حروفا أخرى (باستثناء سفلية)", "工作表的名称将指定输出类名。\n\n在内部，工作表名称将被转换为一个类名，所以C＃变量名的规则：\nID必须以字母或下划线\nID的不能包含空格或其他非字母字符（除下划线）", "ワークシートの名前は、出力クラス名を指定します。\n\nC＃変数名の規則が適用されますので、内部的にはワークシート名は、クラス名に変換されます。\nIDは文字またはアンダースコアで始まる必要があります\nIDは（アンダースコアを除く）、スペースまたはその他の非文字の文字を含めることはできません", "워크 시트의 이름은 출력 클래스 이름을 지정합니다.\n\n내부적으로 워크 시트 이름은 그래서 C # 변수 이름 규칙이 적용, 클래스 이름으로 변환됩니다 :\nID 년대는 문자 나 밑줄로 시작해야합니다\nID 년대는 (밑줄 제외) 공백이나가 아닌 문자를 포함 할 수 없습니다", "Tên của Worksheet sẽ chỉ định tên lớp đầu ra.\n\nBên trong tên Worksheet sẽ được chuyển đổi sang một tên lớp, do đó, C # tắc tên biến được áp dụng:\nID của phải bắt đầu bằng một chữ cái hoặc dấu gạch dưới\nID của không được có khoảng trắng hoặc ký tự không phải chữ khác (trừ gạch dưới)", "Имя листа, будет обозначать имя выходного класса.\n\nВнутренне имя листа будут преобразованы в имя класса, так C # переменная правила имя применяется:\nИдентификаторы должны начинаться с буквы или подчеркивания\nИдентификаторы не должны содержать пробелы или другие символы, не входящие письмо (кроме подчеркивания)", "De naam van het werkblad zal de naam uitgang klasse aanwijzen.\n\nIntern de naam werkblad zal worden omgezet naar een klasse naam, dus C # variabele regels naam van toepassing:\nID's moet beginnen met een letter of een underscore\nID's mogen geen spaties of andere niet-letter tekens (behalve underscores) bevatten"));
			Rows.Add( new DocumentationRow("ID_HEADER_ROWHEADER", "The First Column: Row Headers", "La première colonne: têtes de ligne", "La prima colonna: Testate", "In der ersten Spalte: Zeilenköpfe", "La primera columna: Cabezales", "العمود الأول: صف رؤوس", "第一列：行标题", "最初の列：行ヘッダー", "첫 번째 열 : 행 머리글", "Cột đầu tiên: Row Headers", "Первая колонка: заголовки строк", "De eerste kolom: Rijkoppen"));
			Rows.Add( new DocumentationRow("ID_HELP_ROWHEADER", "The first column will designate the names of the Rows in your spreadsheet.\n\nThese are the ID's that you will use to access your data. Internally these ID's are converted to variable names, so C# variable name rules apply:\nID's must begin with a letter or underscore\nID's must not contain spaces or other non-letter characters (except underscores)", "La première colonne désigner les noms des lignes dans votre feuille de calcul.\n\nCe sont les identifiants que vous allez utiliser pour accéder à vos données. En interne ces ID sont convertis en noms de variables, donc C # règles de nom de variable se appliquent:\nIdentifiants doivent commencer par une lettre ou un trait de soulignement\nIdentifiants ne doivent pas contenir d'espaces ou d'autres caractères non-lettre (à l'exception de soulignement)", "La prima colonna designerà i nomi delle righe nel foglio di calcolo.\n\nQuesti sono gli ID che si intende utilizzare per accedere ai dati. Internamente così C # applicano questi ID di sono convertiti in nomi di variabili, regole di nome variabile:\nID del devono iniziare con una lettera o di sottolineatura\nID non devono contenere spazi o altri caratteri non-lettere (ad eccezione di sottolineatura)", "In der ersten Spalte werden die Namen der Zeilen in Ihrer Tabelle zu bezeichnen.\n\nDies sind die IDs, die Sie verwenden, um Ihre Daten zugreifen. Intern so C # Variablenname Regeln diese IDs sind Variablennamen umgewandelt:\nID muss mit einem Buchstaben oder Unterstrich beginnen\nIDs dürfen keine Leerzeichen oder anderen nicht-Buchstaben-Zeichen (außer Unterstrich) enthalten", "La primera columna designará los nombres de las filas en la hoja de cálculo.\n\nEstas son las identificaciones que va a utilizar para acceder a sus datos. Internamente lo que C # se aplican las reglas de nombres de variables de identificación de estos se convierten en nombres de variable,:\nIdentificaciones deben comenzar con una letra o un guión bajo\nDe identificación no deben contener espacios u otros caracteres que no sean letras (excepto guiones bajos)", "سوف العمود الأول بتعيين أسماء الصفوف في جدول البيانات.\n\nهذه هي ال ID التي ستستخدمها للوصول إلى البيانات الخاصة بك. داخليا حتى C # تطبيق قواعد اسم متغير هذه ID يتم تحويل لأسماء المتغيرات،:\nيجب إسم البائع تبدأ بحرف أو تسطير\nيجب أن لا يحتوي إسم البائع مسافات أو حروفا أخرى (باستثناء سفلية)", "第一列将指定在电子表格中的行名。\n\n这些是您将使用访问您的数据的ID的。在内部，这些ID的转换为变量名，所以C＃变量名的规则：\nID必须以字母或下划线\nID的不能包含空格或其他非字母字符（除下划线）", "最初の列は、スプレッドシート内の行の名前を指定します。\n\nこれらはあなたがあなたのデータにアクセスするために使用するIDをである。内部的にはこれらのIDを変数名に変換されるので、C＃変数名の規則が適用されます。\nIDは文字またはアンダースコアで始まる必要があります\nIDは（アンダースコアを除く）、スペースまたはその他の非文字の文字を含めることはできません", "첫 번째 열은 스프레드 시트의 행의 이름을 지정합니다.\n\n이들은 당신이 데이터에 액세스하는 데 사용하는 ID의의입니다. 내부의 변수 이름으로 변환이 ID, 그래서 C # 변수 이름 규칙이 적용됩니다\nID 년대는 문자 나 밑줄로 시작해야합니다\nID 년대는 (밑줄 제외) 공백이나가 아닌 문자를 포함 할 수 없습니다", "Cột đầu tiên sẽ chỉ định tên của các dòng trong bảng tính của bạn.\n\nĐây là các ID mà bạn sẽ sử dụng để truy cập dữ liệu của bạn. Trong nội bộ các ID của được chuyển đổi thành các tên biến, do đó, C # tắc tên biến được áp dụng:\nID của phải bắt đầu bằng một chữ cái hoặc dấu gạch dưới\nID của không được có khoảng trắng hoặc ký tự không phải chữ khác (trừ gạch dưới)", "Первый столбец будет назначить имена строк в таблице.\n\nЭто идентификаторы, которые будут использоваться для доступа к данным. Внутри эти идентификаторы преобразуются в имена переменных, так C # переменная правила имя применяется:\nИдентификаторы должны начинаться с буквы или подчеркивания\nИдентификаторы не должны содержать пробелы или другие символы, не входящие письмо (кроме подчеркивания)", "De eerste kolom zal de namen van de rijen aan te wijzen in uw spreadsheet.\n\nDit zijn de ID's die u wilt gebruiken om toegang te krijgen tot uw gegevens. Intern deze ID's worden omgezet naar een variabele namen, dus C # regels variabele naam van toepassing:\nID's moet beginnen met een letter of een underscore\nID's mogen geen spaties of andere niet-letter tekens (behalve underscores) bevatten"));
