			Rows.Add( new DocumentationRow("ID_HELP_FIRSTROW", "The first Row will designate the names of the Columns/Variables in your spreadsheet.\n\nThese are the ID's that you will use to access your data. Internally these ID's are converted to variable names, so C# variable name rules apply:\nID's must begin with a letter or underscore\nID's must not contain spaces or other non-letter characters (except underscores)", "La première ligne sera désigner les noms des colonnes / variables dans votre feuille de calcul.\n\nCe sont les identifiants que vous allez utiliser pour accéder à vos données. En interne ces ID sont convertis en noms de variables, donc C # règles de nom de variable se appliquent:\nIdentifiants doivent commencer par une lettre ou un trait de soulignement\nIdentifiants ne doivent pas contenir d'espaces ou d'autres caractères non-lettre (à l'exception de soulignement)", "La prima riga designerà i nomi delle colonne / variabili nel foglio di calcolo.\n\nQuesti sono gli ID che si intende utilizzare per accedere ai dati. Internamente così C # applicano questi ID di sono convertiti in nomi di variabili, regole di nome variabile:\nID del devono iniziare con una lettera o di sottolineatura\nID non devono contenere spazi o altri caratteri non-lettere (ad eccezione di sottolineatura)", "Die erste Zeile wird die Namen der Spalten / Variablen in Ihrer Tabelle zu bezeichnen.\n\nDies sind die IDs, die Sie verwenden, um Ihre Daten zugreifen. Intern so C # Variablenname Regeln diese IDs sind Variablennamen umgewandelt:\nID muss mit einem Buchstaben oder Unterstrich beginnen\nIDs dürfen keine Leerzeichen oder anderen nicht-Buchstaben-Zeichen (außer Unterstrich) enthalten", "La primera fila designará a los nombres de las columnas / variables en la hoja de cálculo.\n\nEstas son las identificaciones que va a utilizar para acceder a sus datos. Internamente lo que C # se aplican las reglas de nombres de variables de identificación de estos se convierten en nombres de variable,:\nIdentificaciones deben comenzar con una letra o un guión bajo\nDe identificación no deben contener espacios u otros caracteres que no sean letras (excepto guiones bajos)", "سوف الصف الأول بتعيين أسماء الأعمدة / المتغيرات في جدول البيانات.\n\nهذه هي ال ID التي ستستخدمها للوصول إلى البيانات الخاصة بك. داخليا حتى C # تطبيق قواعد اسم متغير هذه ID يتم تحويل لأسماء المتغيرات،:\nيجب إسم البائع تبدأ بحرف أو تسطير\nيجب أن لا يحتوي إسم البائع مسافات أو حروفا أخرى (باستثناء سفلية)", "第一行会指定在电子表格中的列/变量的名称。\n\n这些是您将使用访问您的数据的ID的。在内部，这些ID的转换为变量名，所以C＃变量名的规则：\nID必须以字母或下划线\nID的不能包含空格或其他非字母字符（除下划线）", "最初の行は、スプレッドシートの列/変数の名前を指定します。\n\nこれらはあなたがあなたのデータにアクセスするために使用するIDをである。内部的にはこれらのIDを変数名に変換されるので、C＃変数名の規則が適用されます。\nIDは文字またはアンダースコアで始まる必要があります\nIDは（アンダースコアを除く）、スペースまたはその他の非文字の文字を含めることはできません", "첫 번째 행은 스프레드 시트의 열 / 변수의 이름을 지정합니다.\n\n이들은 당신이 데이터에 액세스하는 데 사용하는 ID의의입니다. 내부의 변수 이름으로 변환이 ID, 그래서 C # 변수 이름 규칙이 적용됩니다\nID 년대는 문자 나 밑줄로 시작해야합니다\nID 년대는 (밑줄 제외) 공백이나가 아닌 문자를 포함 할 수 없습니다", "The Row đầu tiên sẽ chỉ định tên của các cột / Các biến trong bảng tính của bạn.\n\nĐây là các ID mà bạn sẽ sử dụng để truy cập dữ liệu của bạn. Trong nội bộ các ID của được chuyển đổi thành các tên biến, do đó, C # tắc tên biến được áp dụng:\nID của phải bắt đầu bằng một chữ cái hoặc dấu gạch dưới\nID của không được có khoảng trắng hoặc ký tự không phải chữ khác (trừ gạch dưới)", "Первая строка назначает имена столбцов / переменных в таблице.\n\nЭто идентификаторы, которые будут использоваться для доступа к данным. Внутри эти идентификаторы преобразуются в имена переменных, так C # переменная правила имя применяется:\nИдентификаторы должны начинаться с буквы или подчеркивания\nИдентификаторы не должны содержать пробелы или другие символы, не входящие письмо (кроме подчеркивания)", "De eerste rij zullen de namen van de kolommen / Variabelen wijzen in uw spreadsheet.\n\nDit zijn de ID's die u wilt gebruiken om toegang te krijgen tot uw gegevens. Intern deze ID's worden omgezet naar een variabele namen, dus C # regels variabele naam van toepassing:\nID's moet beginnen met een letter of een underscore\nID's mogen geen spaties of andere niet-letter tekens (behalve underscores) bevatten"));
			Rows.Add( new DocumentationRow("ID_HEADER_TYPEROW", "The Second Row: Type Designation", "La deuxième rangée: Type Désignation", "La seconda fila: Tipo Designazione", "Der Zweite Reihe: Typ Bezeichnung", "La segunda fila: Tipo Designación", "الصف الثاني: نوع التعيين", "第二行：型号名称", "2行目：タイプ指定", "두 번째 행 : 유형 지정", "The Second Row: Loại Designation", "Во-вторых Row: Тип Обозначение", "De tweede rij: Type Aanwijzing"));
			Rows.Add( new DocumentationRow("ID_HELP_TYPEROW", "The second Row may be used to designate variable types. This is optional.\n\nIf you use the Type row, Google2u will automatically detect it, and cast the data in the cells to the appropriate type.\nIf you do not use the Type row, it will be assumed that all data in the cells are of the type \"String\"", "La deuxième rangée peut être utilisé pour désigner les types de variables. Cette étape est facultative.\n\nSi vous utilisez la ligne Type, Google2u le détectera automatiquement et jette les données dans les cellules du type approprié.\nSi vous ne utilisez pas la ligne Type, on supposera que toutes les données dans les cellules sont de type \"String\"", "La seconda fila può essere utilizzato per designare tipi di variabili. Questo è opzionale.\n\nSe si utilizza la riga Type, Google2u rileverà automaticamente, e gettato i dati nelle celle di tipo appropriato.\nSe non si utilizza la riga Type, si presume che tutti i dati nelle celle sono del tipo \"String\"", "Die zweite Reihe kann verwendet werden, um Variablentypen zu bezeichnen. Dieses ist optional.\n\nWenn Sie den Typ Reihe verwenden, werden Google2u automatisch erkennen und warf die Daten in den Zellen in den entsprechenden Typ.\nWenn Sie nicht mit dem Typ Reihe, wird davon ausgegangen, dass alle Daten in den Zellen sind vom Typ \"String\"", "La segunda fila puede utilizarse para designar los tipos de variables. Esto es opcional.\n\nSi utiliza la fila Tipo, Google2u lo detectará automáticamente y emitir los datos de las celdas al tipo apropiado.\nSi usted no utiliza la fila Tipo, se supone que todos los datos de las celdas son del tipo \"String\"", "الصف الثاني يمكن أن تستخدم لتعيين أنواع متغير. هذا هو اختياري.\n\nإذا كنت تستخدم الصف النوع، سوف Google2u تلقائيا كشف عليه، ويلقي البيانات في الخلايا إلى النوع المناسب.\nإذا كنت لا تستخدم الصف النوع، سيتم افتراض أن جميع البيانات في الخلايا من نوع \"سلسلة\"", "第二行可以用于指定变量类型。这是可选的。\n\n如果您使用的类型排，Google2u会自动检测到它，并投在单元格中的数据，以适当的类型。\n如果不使用Type行，将假设，在细胞中的所有数据都是类型的“字符串”", "第二行は、​​変数の型を指定するために使用することができる。これはオプションです。\n\nあなたがタイプの行を使用する場合は、Google2uは自動的にそれを検出し、適切な型にセル内のデータをキャストします。\n[タイプ]行を使用しない場合は、セル内のすべてのデータが「文字列」型であると仮定される", "둘째 행은 변수 타입을 지정하는데 사용될 수있다. 이것은 선택 사항입니다.\n\n당신이 유형 행을 사용하는 경우, Google2u가 자동으로 감지하고 적절한 형태로 셀에 데이터를 캐스팅합니다.\n그런 타입 행을 사용하지 않는 경우, 셀의 모든 데이터가 \"문자열\"타입 인 것으로 가정한다", "The Row thứ hai có thể được sử dụng để chỉ các loại biến. Đây là tùy chọn.\n\nNếu bạn sử dụng các loại hàng, Google2u sẽ tự động phát hiện nó, và đúc các dữ liệu trong các tế bào để loại thích hợp.\nNếu bạn không sử dụng các loại hàng, nó sẽ được giả định rằng tất cả các dữ liệu trong các tế bào của các loại \"String\"", "Второй ряд может быть использован для обозначения типов переменных. Это не является обязательным.\n\nЕсли вы используете тип строки, Google2u автоматически обнаружит его и брось данные в ячейках для соответствующего типа.\nЕсли вы не используете тип строки, то он будет считать, что все данные в ячейках, относятся к типу \"String\"", "De tweede rij kan worden gebruikt om variabele types wijzen. Dit is optioneel.\n\nAls u het type rij te gebruiken, zal Google2u automatisch detecteren, en wierp de gegevens in de cellen om het juiste type.\nAls je niet het type rij te gebruiken, zal worden aangenomen dat alle gegevens in de cellen zijn van het type \"String\""));
