心应手被列入数据库", "ゲームオブジェクト - 文字列と同じですが、オブジェクトデータベースでは、指定された名前のゲームオブジェクトを解決しようとします\n\nボイド - これはGoogle2uが列をエクスポートしないようになります。データベースに含める必要がないデータベース内のハンディあなたが式を用いて、または持っている場合の注意点", "게임 오브젝트 - 문자열과 동일,하지만 개체 데이터베이스에 지정된 이름으로 게임 오브젝트를 해결하기 위해 노력할 것입니다\n\n공허 -이 열을 내 보내지하는 Google2u의 원인이됩니다. 필요하지 않은 데이터베이스에서 핸디는 수식을 이용 중이거나 노트를 데이터베이스에 포함될", "GameObject - Tương tự như một chuỗi, nhưng trong cơ sở dữ liệu đối tượng nó sẽ cố gắng giải quyết các GameObject với tên được chỉ định\n\nVoid - Điều này sẽ gây ra Google2u để không xuất khẩu các cột. Handy nếu bạn đang sử dụng công thức hoặc có ghi chú trong cơ sở dữ liệu mà không cần phải được bao gồm trong cơ sở dữ liệu", "GameObject - То же, строку, но в объектных баз данных он будет пытаться решить геймобжекты с указанным именем\n\nПустота - Это может привести к Google2u не экспортировать столбца. Удобно, если вы используете формулы или имеют замечания в базе данных, которые не должны быть включены в базу данных", "GameObject - Zelfde als een string, maar in Object Databases het zal proberen om de GameObject op te lossen met de opgegeven naam\n\nVoid - Dit zal Google2u veroorzaken aan de kolom niet exporteren. Handig als u gebruik maakt van formules of notities in de database die niet hoeven te worden opgenomen in de databank"));
