			Rows.Add( new DocumentationRow("ID_HELP_CREDENTIALS", "The Credentials section is where you may enter the login information for your Google account. You may also choose to save your credentials, and automatically log in to the Google Account.\nThis section is mandatory only if you want to access the workbooks that the account has access to, and are not shared publicly. Keep in mind that if you choose to Save your credentials, a registry key will be created to store your Username and Password in PLAIN TEXT. If this is a security concern, please do NOT save your credentials. You may still enter them manually to access your account, and they will not be stored if \"Save Credentials\" is left unchecked.", "La section de vérification des pouvoirs est là que vous pouvez entrer les informations de connexion de votre compte Google. Vous pouvez également choisir d'enregistrer vos informations d'identification, et automatiquement se connecter au compte Google.\nCette section ne est obligatoire que si vous voulez accéder aux classeurs que le compte a accès à, et ne sont pas partagés publiquement. Gardez à l'esprit que si vous choisissez d'enregistrer vos informations d'identification, une clé de registre sera créé pour stocker votre nom d'utilisateur et mot de passe en texte clair. Si ce est un problème de sécurité, se il vous plaît Ne pas enregistrer vos informations d'identification. Vous pouvez toujours saisir manuellement pour accéder à votre compte, et ils ne seront pas sauvegardés si \"Save vérification des pouvoirs\" ne est pas cochée.", "La sezione Credenziali è dove è possibile inserire le informazioni di login per il tuo account Google. Si può anche scegliere di salvare le credenziali, e automaticamente accedere al account Google.\nQuesta sezione è obbligatoria solo se si desidera accedere alle cartelle di lavoro che l'account ha accesso a, e non sono condivisi pubblicamente. Tenete presente che se si sceglie di salvare le credenziali, verrà creata una chiave di registro per memorizzare il nome utente e la password in chiaro. Se questo è un problema di sicurezza, NON salvare le credenziali. Si può ancora li inserire manualmente per accedere al tuo conto, e non verranno memorizzati se \"Salva credenziali\" è lasciato incontrollato.", "Der Abschnitt Anmeldeinformationen ist, wo Sie die Anmeldeinformationen für Ihr Google-Konto ein. Sie können auch wählen, um Ihre Anmeldeinformationen zu speichern und automatisch melden Sie sich beim Google-Konto.\nDieser Abschnitt ist obligatorisch nur, wenn Sie wollen, um die Arbeitsmappen, die das Konto Zugriff auf zugreifen und werden nicht öffentlich geteilt. Denken Sie daran, dass, wenn Sie sich entscheiden, Ihre Anmeldeinformationen speichern, wird ein Registrierungsschlüssel erstellt, um Ihren Benutzernamen und das Passwort im Klartext zu speichern. Wenn dies ein Sicherheitsproblem, bitte nicht speichern Sie Ihre Anmeldeinformationen. Sie können immer noch manuell eingeben Zugriff auf Ihr Konto, und sie werden nicht gespeichert, wenn \"Save Credentials\" ist nicht gegengesteuert werden.", "La sección Credenciales es donde puede introducir la información de inicio de sesión para la cuenta de Google. También puede optar por guardar sus credenciales, y automáticamente iniciar sesión en la cuenta de Google.\nEsta sección es obligatoria sólo si desea acceder a los libros de trabajo que la cuenta tiene acceso a, y no se comparten públicamente. Tenga en cuenta que si usted decide guardar sus credenciales, una clave de registro se creará para almacenar su nombre de usuario y contraseña en texto plano. Si se trata de un problema de seguridad, por favor NO guardar las credenciales. Usted todavía puede introducirlos manualmente para acceder a su cuenta, y no se guardará si \"Guardar credenciales\" se deja sin marcar.", "قسم وثائق التفويض هو المكان الذي يمكنك إدخال معلومات تسجيل الدخول لحسابك في Google. يمكنك أيضا اختيار لحفظ بيانات الاعتماد الخاصة بك، وتلقائيا تسجيل الدخول إلى حساب Google.\nهذا القسم هو إلزامي إلا إذا كنت تريد الوصول إلى المصنفات التي الحساب لديه حق الوصول إلى، وليس يجري تقاسم علنا. نضع في اعتبارنا أنه إذا اخترت حفظ بيانات الاعتماد الخاصة بك، سيتم إنشاء مفتاح التسجيل لتخزين اسم المستخدم وكلمة المرور في نص عادي. إذا كان هذا هو الهاجس الأمني، يرجى عدم حفظ بيانات الاعتماد الخاصة بك. لا تزال تستطيع إدخالها يدويا للوصول إلى حسابك، وأنها لن تكون مخزنة إذا \"حفظ وثائق التفويض\" وتركت لحالها.", "全权部分是你可以输入登录信息，您谷歌帐户。您也可以选择保存凭据，并自动登录到谷歌帐户。\n只有当你想访问该帐户可以访问的工作簿，但未公开这部分是强制性的。请记住，如果您选择保存您的凭据，注册表项，将创建存储您的用户名和密码以纯文本格式。如果这是一个安全问题，请不要吝啬您的凭据。您仍然可以手动输入他们访问您的帐户，如果“保存凭证”是听之任之，他们将不会被保存。", "あなたは、Googleアカウントのログイン情報を入力することができる場所資格セクションがある。また、あなたの資格情報を保存することを選択し、自動的にGoogleアカウントにログインできます。\nこのセクションでは、アカウントがアクセス権を持っており、公に共有されていないブックにアクセスする場合にのみ必須です。あなたの資格情報を保存することを選択した場合、レジストリキーがプレーンテキストにユーザー名とパスワードを保存するために作成されることに留意してください。これはセキュリティ上の問題であれば、あなたの資格情報を保存しないでください。あなたはまだ自分のアカウントにアクセスするためにそれらを手動で入力することができ、「資格情報を保存 \"、放置されている場合、それらは保存されません。", "당신이 당신의 구글 계정에 대한 로그인 정보를 입력 할 수있는 곳 자격 증명 섹션입니다. 당신은 또한 당신의 자격 증명을 저장하도록 선택하고 자동으로 구글 계정에 로그인 할 수 있습니다.\n이 섹션에서는 계정에 액세스 할 수있는 통합 문서에 액세스하려면, 공개적으로 공유하지 않는 경우에만 필수입니다. 당신이 당신의 자격 증명을 저장하도록 선택하는 경우, 레지스트리 키가 일반 텍스트로 사용자 이름과 암호를 저장하기 위해 만들어집니다 있음을 알아 두셔야합니다. 이 보안 문제의 경우, 자격 증명을 저장하지 마십시오. 당신은 여전히​​ 당신의 계정에 액세스 할 수 수동으로 입력 할 수 있으며, \"자격 증명 저장\"을 선택하지 않은 상태로 방치하면 그들은 저장되지 않습니다.", "Phần Credentials là nơi bạn có thể nhập thông tin đăng nhập cho tài khoản Google của bạn. Bạn cũng có thể chọn để lưu thông tin của bạn, và tự động đăng nhập vào tài khoản Google.\nPhần này là bắt buộc nếu bạn muốn truy cập vào các bài tập mà tài khoản có quyền truy cập vào, và không được chia sẻ công khai. Hãy ghi nhớ rằng nếu bạn chọn để Lưu thông tin đăng nhập của bạn, một khóa registry sẽ được tạo ra để lưu trữ tên người dùng và mật khẩu trong văn bản đồng bằng. Nếu đây là một mối quan tâm an ninh, xin vui lòng KHÔNG lưu thông tin của bạn. Bạn vẫn có thể nhập bằng tay để truy cập vào tài khoản của bạn, và họ sẽ không được lưu trữ nếu \"Save Credentials\" được kiểm soát.", "Раздел учетных данных, где вы можете ввести регистрационную информацию для вашей учетной записи Google. Вы также можете выбрать, чтобы сохранить свои учетные данные, и автоматически войти в аккаунт Google.\nВ этом разделе является обязательным, только если вы хотите получить доступ к книгам, которые Пользователь имеет доступ к, и не в открытом доступе. Имейте в виду, что если вы выбираете, чтобы сохранить свои учетные данные, в реестре будет создан, чтобы хранить имя пользователя и пароль в виде обычного текста. Если это проблема безопасности, пожалуйста, не сохранить свои учетные данные. Вы все еще можете ввести их вручную, чтобы получить доступ к вашей учетной записи, и они не будут сохранены, если \"сохранить учетные данные\" не остановить.", "De sectie Geloofsbrieven is waar u de aanmeldingsgegevens voor uw Google-account kunnen voeren. U kunt er ook voor kiezen om uw referenties op te slaan en automatisch inloggen op de Google-account.\nDit gedeelte is alleen verplicht als u toegang wilt tot de werkboeken die de rekening heeft toegang tot, en niet openbaar worden gedeeld. Houd er rekening mee dat als u ervoor kiest om uw referenties opslaan, zal een registersleutel worden gemaakt om uw gebruikersnaam en wachtwoord op te slaan in platte tekst. Als dit een veiligheidsprobleem, gelieve niet te redden uw referenties. Je mag ze nog steeds handmatig invoeren om toegang te krijgen tot uw account, en zij zullen niet worden opgeslagen als \"Save Geloofsbrieven\" is aangevinkt gelaten."));
