			Rows.Add( new DocumentationRow("ID_HEADER_ACCOUNTWORKBOOKS", "Workbooks only accessible by the currently logged in account", "Classeurs accessibles uniquement par le compte actuellement connecté", "Le cartelle di lavoro accessibili solo dal attualmente connesso in conto", "Arbeitsmappen nur durch die derzeit in Konto angemeldet zugänglich", "Los libros sólo se puede acceder por la que ha iniciado sesión en la cuenta", "المصنفات يمكن الوصول إليها إلا عن طريق دخوله حاليا في حساب", "工作簿只能由当前登录的帐户访问", "現在のアカウントでログインしていることによってのみアクセス可能ワークブック", "현재 계정에 로그인 만 액세스 할 통합 문서", "Sách bài tập chỉ có thể truy cập bởi hiện đang đăng nhập vào tài khoản", "Учебные пособия доступны только в настоящее время вошли в счет", "Werkboeken alleen toegankelijk door de aangemelde in rekening"));
			Rows.Add( new DocumentationRow("ID_HELP_ACCOUNTWORKBOOKS", "This section will display a list of workbooks that Google2u is able to access only if you are logged into Google through Google2u.", "Cette section affiche une liste de classeurs qui Google2u est capable d'accéder que si vous êtes connecté à Google par le biais Google2u.", "Questa sezione verrà visualizzato un elenco delle cartelle di lavoro che Google2u è in grado di accedere solo se si è effettuato l'accesso a Google attraverso Google2u.", "In diesem Abschnitt wird eine Liste der Arbeitsmappen, die Google2u kann nur zugreifen, wenn Sie über Google2u in Google angemeldet sind, angezeigt werden.", "En esta sección se mostrará una lista de los libros que Google2u es capaz de acceder sólo si ha iniciado sesión en Google a través Google2u.", "وسيكون هذا القسم عرض قائمة المصنفات التي Google2u غير قادرة على الوصول إلا إذا قمت بتسجيل الدخول إلى جوجل من خلال Google2u.", "本节将显示工作簿的列表Google2u只能够访问，如果您是通过Google2u登录到谷歌。", "このセクションでは、Google2uを通してグーグルにログインしている場合、Google2uにのみアクセスすることができるワークブックのリストが表示されます。", "이 섹션에서는 Google2u을 통해 구글에 로그인 한 경우 Google2u 만 액세스 할 수 통합 문서의 목록이 표시됩니다.", "Phần này sẽ hiển thị một danh sách các sách bài tập mà Google2u là có thể truy cập chỉ khi bạn đăng nhập vào Google thông qua Google2u.", "В этом разделе будет отображаться список книг, которые Google2u имеет доступ к только если вы вошли в Google через Google2u.", "Deze sectie zal een lijst van werkboeken die Google2u in staat is om alleen toegang als u bent aangemeld bij Google via Google2u weer te geven."));
			Rows.Add( new DocumentationRow("ID_FADE_USINGMANUALWORKBOOKS", "Manual Workbooks", "Classeurs Manuel", "Cartelle di lavoro manuali", "Handarbeitsbücher", "Libros de Trabajo Manual", "المصنفات اليدوية", "手动工作簿", "マニュアルワークブック", "수동 통합 문서", "Workbooks Manual", "Руководство Учебные пособия", "Handmatige werkmappen"));
			Rows.Add( new DocumentationRow("ID_HEADER_MANUALWORKBOOKS", "Publicly Accessible Workbooks", "Accessible au public classeurs", "Pubblicamente Accessibile cartelle di lavoro", "Öffentlich zugängliche Arbeitsmappen", "Públicamente accesible Cuadernos", "يمكن الوصول إليه علنا ​​المصنفات", "可公​​开访问的工作簿", "公的にアクセス可能なワークブック", "공개적으로 액세스 할 수있는 통합 문서", "Công khai bể Workbooks", "ОБЩЕДОСТУПНАЯ Учебные пособия", "Openbaar toegankelijke werkmappen"));
			Rows.Add( new DocumentationRow("ID_HELP_MANUALWORKBOOKS", "This section will display a list of publicly accessible workbooks that you have added to the list. These workbooks need to be flagged in your Google Drive as public, and published.", "Cette section affiche une liste des classeurs accessibles au public que vous avez ajoutés à la liste. Ces classeurs doivent être signalées dans votre Google Drive comme public, et publié.", "Questa sezione verrà visualizzato un elenco delle cartelle di lavoro accessibili al pubblico che sono stati aggiunti alla lista. Queste cartelle di lavoro devono essere contrassegnati in Google Drive come pubblico, e pubblicato.", "In diesem Abschnitt wird eine Liste der öffentlich zugänglichen Arbeitsmappen, die Sie der Liste hinzugefügt haben. Diese Arbeitsmappen müssen Sie in Ihrem Google Drive als öffentlich gekennzeichnet werden, und veröffentlicht.", "En esta sección se mostrará una lista de los libros de trabajo de acceso público que se han añadido a la lista. Estos libros deben ser de bandera en Google Drive como público, y publicado.", "وسيكون هذا القسم عرض قائمة المصنفات المتاحة للجمهور التي قمت بإضافتها إلى القائمة. وتحتاج هذه المصنفات ليتم وضع علامة في Google Drive كما الجمهور، ونشرها.", "本节将显示您已经添加到列表中可公开访问的工作簿列表。这些工作簿需要被标记在你的谷歌驱动器作为公众，并出版。", "このセクションでは、リストに追加したパブリックにアクセスワークブックのリストが表示されます。これらのブックはパブリックとしてGoogleドライブにフラグが付けられ、かつ公開される必要がある。", "이 섹션 목록에 추가 한 공개적으로 액세스 할 수있는 통합 문서의 목록이 표시됩니다. 이 통합 문서 공개로 구글 드라이브에 플래그, 게시해야합니다.", "Phần này sẽ hiển thị một danh sách các sách bài tập nào đó mà bạn đã thêm vào danh sách. Các tài liệu này cần phải được gắn cờ trong Google Drive của bạn như nào, và công bố.", "В этом разделе будет отображен список общедоступных книг, которые вы добавили в список. Эти учебные пособия должны быть помечены в Google Drive, как общественности, и публикуются.", "Deze sectie zal een lijst van voor het publiek toegankelijke werkboeken die u hebt toegevoegd aan de lijst weer te geven. Deze werkboeken moeten worden gemarkeerd in uw Google Drive als publiek, en gepubliceerd."));
			Rows.Add( new DocumentationRow("ID_HEADER_SHARINGWORKBOOKS", "Sharing Workbooks", "Partage classeurs", "Condivisione cartelle di lavoro", "Sharing-Arbeitsmappen", "Intercambio de Libros de Trabajo", "تبادل المصنفات", "共享工作簿", "ワークブックの共有", "북 공유", "Chia sẻ Workbooks", "Обмен Учебные пособия", "Het delen van werkmappen"));
			Rows.Add( new DocumentationRow("ID_HELP_SHARINGWORKBOOKS", "If you are planning to use a published workbook, you will need to tell Google2u how to access this workbook. You will need to first have the URL of the published workbook, to let Google2u know where it is located. If you have authenticated with your Google credentials, Google2u will have access to your workbooks, and this step is purely optional.\n\nThe Workbook you are attempting to access must be public, and published to the web. If you are attempting to access a workbook that is private, you will need to authenticate with Google to view it.\n\nTo set the workbook to public, open it in Google, open the File menu and select \"Share...\".  In the Sharing Settings dialog you will need to change the access type by clicking the \"Change...\" link.", "Si vous prévoyez d'utiliser un classeur publié, vous aurez besoin de dire Google2u comment accéder à ce classeur. Vous aurez besoin d'avoir d'abord l'URL du classeur publié, de laisser Google2u sait où il se trouve. Si vous avez authentifié avec vos identifiants Google, Google2u aura accès à vos classeurs, et cette étape est purement facultative.\n\nLe classeur que vous tentez d'accéder doit être publique, et publié sur le Web. Si vous tentez d'accéder à un classeur qui est privé, vous aurez besoin de se authentifier avec Google pour la visualiser.\n\nPour définir le classeur pour le public, l'ouvrir dans Google, ouvrez le menu Fichier et sélectionnez \"Partager ...\". Dans les paramètres de partage dialogue, vous devrez changer le type d'accès en cliquant sur le \"changement ...\" lien.", "Se avete intenzione di utilizzare una cartella di lavoro pubblicato, è necessario dire Google2u come accedere a questa cartella di lavoro. Avrete bisogno di avere prima l'URL della cartella di lavoro pubblicato, per far Google2u sapere dove si trova. Se si è autenticato con le credenziali di Google, Google2u avrà accesso alle cartelle di lavoro, e questo passo è puramente facoltativo.\n\nLa cartella di lavoro che si sta tentando di accesso deve essere pubblico, e pubblicato sul web. Se si sta tentando di accedere a una cartella di lavoro che è privata, è necessario autenticarsi con Google per vederlo.\n\nPer impostare la cartella di lavoro pubblico, aprirlo in Google, aprire il menu File e selezionare \"Share ...\". Nelle impostazioni di condivisione dialogo è necessario cambiare il tipo di accesso cliccando sul pulsante \"Cambia ...\" Link.", "Wenn Sie planen, eine veröffentlichte Arbeitsmappe zu verwenden, müssen Sie Google2u sagen, wie man diese Arbeitsmappe zugreifen. Sie müssen zuerst die URL der veröffentlichten Arbeitsmappe zu lassen Google2u wissen, wo es sich befindet. Wenn Sie mit Ihrem Google-Anmeldeinformationen authentifiziert haben, wird Google2u Zugriff auf Ihre Arbeitsmappen, und dieser Schritt ist rein optional.\n\nDie Arbeitsmappe, die Sie zugreifen möchten, müssen öffentlich und im Internet veröffentlicht werden. Wenn Sie versuchen, eine Arbeitsmappe, die privat ist zuzugreifen, werden Sie brauchen, um mit Google zu authentifizieren, damit sie angezeigt.\n\nUm die Arbeitsmappe zu öffentlichen setzen, öffnen Sie sie in Google, öffnen Sie das Menü Datei und wählen Sie \"Teilen ...\". In den Freigabeeinstellungen-Dialog müssen Sie den Zugriffstyp, indem Sie auf die Schaltfläche \"... ändern\" Link ändern.", "Si usted está planeando utilizar un libro publicado, tendrá que decirle Google2u cómo acceder a este libro. Usted tendrá que tener primero la dirección URL del libro publicado, para dejar Google2u sabe dónde se encuentra. Si ha autenticado con tus credenciales de Google, Google2u tendrá acceso a los libros, y este paso es puramente opcional.\n\nEl libro que está intentando acceder debe ser pública, y publicado en la web. Si está intentando acceder a un libro que es privada, tendrá que autenticarse con Google para poder verla.\n\nPara configurar el libro en público, abrirlo en Google, abra el menú Archivo y seleccione \"Compartir ...\". En los ajustes de compartimiento de diálogo que tendrá que cambiar el tipo de acceso haciendo clic en el \"... el cambio\" enlace.", "إذا كنت تخطط لاستخدام مصنف المنشورة، وسوف تحتاج إلى معرفة Google2u كيفية الوصول إلى هذا المصنف. سوف تحتاج إلى أن يكون أول URL المصنف المنشورة، للسماح Google2u أعرف أين يقع فيها. إذا كنت قد مصادقة مع أوراق اعتماد جوجل الخاص بك، وسوف Google2u الحصول على المصنفات الخاصة بك، وهذه الخطوة اختيارية بحتة.\n\nالمصنف الذي تحاول الوصول يجب أن يكون العام، ونشرت على شبكة الإنترنت. إذا كنت تحاول الوصول إلى المصنف الذي هو خاص، وسوف تحتاج لمصادقة مع جوجل لمشاهدته.\n\nلضبط المصنف إلى الجمهور، فتحه في جوجل، فتح القائمة ملف وحدد \"حصة ...\". في إعدادات مشاركة الحوار سوف تحتاج إلى تغيير نوع الوصول عن طريق النقر على \"تغيير ...\" وصلة.", "如果您计划使用已发布的工作簿，你需要告诉Google2u如何访问此工作簿。你首先需要有发布的工作簿的URL，让Google2u知道它的位置。如果你已经验证你的谷歌凭据，Google2u将有机会获得您的工作簿，这一步完全是可选的。\n\n您尝试访问的工作簿必须是公开的，并发布到网上。如果您试图访问一个工作簿是私有的，则需要进行身份验证与谷歌进行查看。\n\n要设置工作簿公众，谷歌将其打开，打开文件菜单，然后选择“共享...”。在共享设置对话框中，您将需要通过单击“更改...”链接更改访问类型。", "あなたが公開したブックを使用することを計画している場合は、このワークブックにアクセスする方法をGoogle2uに指示する必要があります。あなたはそれがどこにあるGoogle2uが知っているように、最初に公開されたワークブックのURLを持っている必要があります。あなたのGoogleの認証情報で認証されている場合、Google2uはあなたのワークブックにアクセスする必要があります、そしてこのステップは純粋に任意である。\n\nあなたがアクセスしようとしているワークブックは、公開、およびWebに公開する必要があります。あなたがプライベートでワークブックにアクセスしようとしている場合は、それを表示するには、Googleので認証する必要があります。\n\n、公衆にワークブックを設定するグーグルでそれを開くには、[ファイル]メニューを開き、「共有...」を選択します。共有設定ではあなたは「変更...」リンクをクリックすることでアクセスタイプを変更する必要がありますダイアログ。", "게시 된 통합 문서를 사용하려면, 당신은 어떻게이 통합 문서에 액세스하는 Google2u 말할 필요합니다. 당신은 처음의 위치 Google2u 알려 게시 된 통합 문서의 URL가 필요합니다. 당신이 구글 자격 증명을 인증 한 경우, Google2u는 통합 문서에 액세스 할 수 있습니다,이 단계는 순전히 선택 사항입니다.\n\n액세스를 시도하는 통합 문서 공개 및 웹에 게시해야합니다. 당신이 개인 인 통합 문서에 액세스하려는 경우, 당신은 그것을 볼 구글 인증을해야합니다.\n\n공공에 통합 문서를 설정 구글에서 엽니 다 ... \"공유\"파일 메뉴를 열고 선택합니다. 공유 설정에서 당신은 \"변경 ...\"링크를 클릭하여 액세스 유형을 변경해야합니다 대화.", "Nếu bạn đang có kế hoạch để sử dụng một bảng tính được xuất bản, bạn sẽ cần phải nói Google2u cách truy cập bảng tính này. Bạn sẽ cần phải đầu tiên có các URL của các bảng tính được xuất bản, để cho Google2u biết nó nằm ở đâu. Nếu bạn đã xác nhận thông tin với Google của bạn, Google2u sẽ có quyền truy cập vào các bảng tính của bạn, và bước này là hoàn toàn tùy chọn.\n\nWorkbook bạn đang cố gắng truy cập phải được công khai, và xuất bản lên web. Nếu bạn đang cố gắng truy cập vào một bảng tính đó là riêng tư, bạn sẽ cần phải xác thực với Google để xem nó.\n\nĐể thiết lập các bảng tính cho công chúng, mở nó trong Google, mở menu File và chọn \"Chia sẻ ...\". Trong các thiết lập Sharing thoại bạn sẽ cần phải thay đổi kiểu truy cập bằng cách nhấn vào \"Change ...\" liên kết.", "Если вы планируете использовать опубликованные книги, вы должны сообщить Google2u, как открыть книгу. Вам нужно будет сначала иметь URL опубликованного книги, чтобы Google2u знать, где он находится. Если вы прошли проверку подлинности с учетными данными Google, Google2u будет иметь доступ к вашим книг, и этот шаг является чисто факультативный.\n\nРабочая тетрадь вы пытаетесь получить доступ должен быть открытым, и опубликованы в Интернете. Если вы пытаетесь получить доступ к книгу, которая является частной, необходимо пройти проверку подлинности с помощью Google, для его просмотра.\n\nЧтобы установить книгу публике, откройте его в Google, откройте меню Файл и выберите \"Share ...\". В настройках совместного диалоговое вам нужно будет изменить тип доступа, нажав кнопку \"Изменить ...\" ссылка.", "Als u van plan bent om een ​​gepubliceerde werkboek te gebruiken, moet u Google2u vertellen hoe u toegang tot deze werkmap. U moet eerst de URL van de gepubliceerde werkboek, te laten Google2u weten waar het zich bevindt. Als u hebt geverifieerd met uw Google-referenties, zal Google2u toegang tot uw werkmappen hebben, en deze stap is puur optioneel.\n\nDe werkmap die u probeert te openen, moet het publiek, en gepubliceerd op het web te zijn. Als u probeert om toegang te krijgen tot een werkmap die privé is, zal je nodig hebt om te verifiëren bij Google om het te bekijken.\n\nOm de werkmap ingesteld om openbare, open het in Google, opent u het menu Bestand en selecteer \"Delen ...\". In de instellingen voor delen dialoogvenster moet u het type toegang wijzigen door te klikken op de link \"Wijzigen ...\"."));
			Rows.Add( new DocumentationRow("ID_HELP_SHARINGWORKBOOKS2", "Another dialog will appear allowing you to select the sharing settings. Choose \"Public on the web\" option. If you wish to allow anyone to edit the workbook publically you may select the \"Can edit\" option, or leave it as \"Can view\" if you simply wish to allow Google2u to access the data.", "Une autre boîte de dialogue apparaît, vous permettant de sélectionner les paramètres de partage. Choisissez \"publique sur le web\" option. Si vous souhaitez permettre à quiconque de modifier le classeur publiquement, vous pouvez sélectionner l'option \"Peut modifier\", ou le laisser tel \"Peut afficher\" si vous souhaitez tout simplement pour permettre Google2u pour accéder aux données.", "Un'altra finestra di dialogo apparirà che consente di selezionare le impostazioni di condivisione. Scegliere \"Pubblica sul Web\" l'opzione. Se si desidera consentire a chiunque di modificare la cartella di lavoro pubblicamente è possibile selezionare l'opzione \"Può modificare\", o lasciarlo come \"è possibile visualizzare\" se si desidera semplicemente consentire Google2u per accedere ai dati.", "Ein weiteres Dialogfeld wird angezeigt und Sie können die Freigabe-Einstellungen auswählen. Wählen Sie \"Öffentlich im Web\" Option. Wenn Sie zulassen, dass jemand, um die Arbeitsmappe bearbeiten möchten öffentlich können Sie die Option \"Kann bearbeiten\" wählen, oder lassen Sie es als \"Kann sehen\", wenn Sie einfach nur erlauben Google2u auf die Daten zugreifen.", "Otra de diálogo aparecerá que le permite seleccionar la configuración para compartir. Seleccione la opción \"Público en la Web\" opción. Si desea permitir que cualquiera pueda editar el libro en público puede seleccionar la opción \"se puede editar\", o dejarlo como \"¿Puede ver\" si simplemente desea permitir Google2u para acceder a los datos.", "سيظهر مربع حوار آخر يسمح لك لتحديد إعدادات مشاركة. اختيار \"العامة على شبكة الإنترنت\" الخيار. إذا كنت ترغب في السماح لأي شخص لتحرير المصنف علنا ​​قد قمت بتحديد \"يمكن تحرير\" الخيار، أو ترك الأمر كما \"هل يمكن عرض\" إذا كنت ببساطة ترغب في السماح Google2u للوصول إلى البيانات.", "将出现另一个对话框，允许您选择共享设置。选择“公众在网络上”选项。如果你想允许任何人编辑工作簿公开您可以选择“可以编辑”选项，或者把它作为“可以查看”如果你只是希望允许Google2u访问数据。", "別のダイアログが表示され、共有設定を選択できるように表示されます。オプション「Web上の公開」を選択します。あなたは誰もが、ブックを編集できるようにしたい場合は公的には、 \"編集できます」オプションを選択するか、あるいは単にGoogle2uがデータにアクセスできるようにしたい場合は、「表示することはできます」のままにしておきます。", "또 다른 대화 상자가 공유 설정을 선택할 수 있도록 나타납니다. 옵션 \"웹에 공개\"를 선택합니다. 당신이 누군가가 통합 문서를 편집 할 수 있도록하려면 공개적으로 당신은 \"편집 할 수\"옵션을 선택할 수있다, 또는 당신은 단순히 Google2u 해당 데이터에 액세스 할 수 있도록하려면 \"볼 수\"로 둡니다.", "Một hộp thoại sẽ xuất hiện cho phép bạn chọn các thiết lập chia sẻ. Chọn \"Công khai trên web\" tùy chọn. Nếu bạn muốn cho phép bất cứ ai để chỉnh sửa bảng tính công khai, bạn có thể chọn \"Có thể chỉnh sửa\" tùy chọn, hoặc để lại nó như là \"Có thể xem\" nếu bạn chỉ đơn giản muốn cho phép Google2u để truy cập dữ liệu.", "Другой появится диалоговое окно, позволяющее выбрать параметры доступа. Выберите \"Общественное на интернете\". Если вы хотите, чтобы кто-нибудь, чтобы изменить книгу публично вы можете выбрать опцию \"Может редактировать\", или оставить его в качестве \"Может просматривать\", если вы просто хотите, чтобы Google2u для доступа к данным.", "Een ander dialoogvenster verschijnt waarin u de instellingen voor delen selecteren. Kies 'Openbaar op het web \"optie. Als u wilt toestaan ​​dat iemand aan de werkmap bewerken publiekelijk kunt u de optie \"Kan bewerken\" te selecteren, of het zo laten \"Kan bekijken\" als u gewoon wilt laten Google2u toegang tot de gegevens."));
			Rows.Add( new DocumentationRow("ID_HELP_SHARINGWORKBOOKS3", "Save, and exit the dialog. Next you will need to publish the workbook.", "Enregistrer et quitter la boîte de dialogue. Ensuite, vous aurez besoin de publier le classeur.", "Salvare e uscire dalla finestra. Successivamente sarà necessario pubblicare la cartella di lavoro.", "Speichern und beenden Sie den Dialog. Weiter benötigen Sie, um die Arbeitsmappe zu veröffentlichen.", "Guardar y salir del diálogo. A continuación, tendrá que publicar el libro.", "حفظ، والخروج من الحوار. القادم سوف تحتاج لنشر المصنف.", "保存并退出对话框。接下来，您将需要发布的工作簿。", "保存し、ダイアログを終了。次は、ワークブックを公開する必要があります。", "저장하고 대화 상자를 종료합니다. 다음으로 통합 문서를 게시해야합니다.", "Lưu và thoát khỏi hộp thoại. Tiếp theo, bạn sẽ cần phải công bố các bảng tính.", "Сохранить и закрыть диалоговое окно. Далее вам нужно будет опубликовать книгу.", "Opslaan en het dialoogvenster te sluiten. Vervolgens moet u de werkmap publiceren."));
			Rows.Add( new DocumentationRow("ID_HEADER_PUBLISHINGWORKBOOKS", "Publishing Workbooks", "Publication de classeurs", "Editoria cartelle di lavoro", "Publishing-Arbeitsmappen", "Publicación de Libros", "نشر المصنفات", "发布工作簿", "出版ワークブック", "출판 통합 문서", "Nhà xuất bản Workbooks", "Издательство Учебные пособия", "Publishing werkmappen"));
			Rows.Add( new DocumentationRow("ID_HELP_PUBLISHINGWORKBOOKS", "To find the published workbook URL, open the spreadsheet in Google and open the File menu, and select \"Publish\"", "Pour trouver le classeur URL publiée, ouvrez la feuille de calcul dans Google et ouvrez le menu Fichier et sélectionnez \"Publier\"", "Per trovare l'URL cartella di lavoro pubblicato, aprire il foglio di calcolo in Google e aprire il menu File, e selezionare \"Pubblica\"", "Um den veröffentlichten Arbeitsmappe URL zu finden, öffnen Sie die Tabelle in Google, und öffnen Sie das Menü Datei, und wählen Sie \"Veröffentlichen\"", "Para encontrar la dirección URL del libro publicado, abra la hoja de cálculo en Google y abra el menú Archivo y seleccione \"Publicar\"", "للعثور على URL المصنف المنشورة، فتح جدول البيانات في غوغل وفتح القائمة ملف، واختر \"نشر\"", "要查找发布的工作簿URL，打开谷歌电子表格，打开文件菜单，然后选择“发布”", "公開されたブックのURLを検索するには、Googleのスプレッドシートを開くと、[ファイル]メニューを開き、選択して \"公開」", "게시 된 통합 문서의 URL을 찾으려면, 구글 스프레드 시트를 열고 파일 메뉴를 열고 선택 \"게시\"", "Để tìm các URL bảng tính được xuất bản, mở các bảng tính trong Google và mở menu File, và chọn \"Xuất bản\"", "Чтобы найти опубликованный рабочей книги URL, откройте таблицу в Google и откройте меню Файл и выберите пункт \"Опубликовать\"", "Om de gepubliceerde werkboek URL te vinden, opent u de spreadsheet in Google en open het menu Bestand en selecteer \"Publiceren\""));
			Rows.Add( new DocumentationRow("ID_HELP_PUBLISHINGWORKBOOKS2", "You will then see a dialog that gives you options for publishing the worksheet. Leaving all of the options as defaults and choosing the \"Publish Now\" option, Google will generate a URL for the workbook.", "Vous verrez alors une boîte de dialogue qui vous donne des options pour la publication de la feuille de calcul. Laissant toutes les options par défaut et en choisissant l'option \"Publier maintenant\", Google va générer une URL pour le classeur.", "Si vedrà, quindi una finestra di dialogo che offre opzioni per la pubblicazione il foglio di lavoro. Lasciando tutte le opzioni come predefiniti e scegliendo l'opzione \"Pubblica ora\", Google genererà un URL per la cartella di lavoro.", "Sie sehen dann einen Dialog, der Ihnen Optionen für die Veröffentlichung des Arbeitsblatts. Verlassen alle Optionen als Standardeinstellungen und wählen Sie die Option \"Jetzt veröffentlichen\", wird Google die URL für die Arbeitsmappe zu generieren.", "A continuación, aparecerá un cuadro de diálogo que le da opciones para publicar la hoja de trabajo. Dejando todas las opciones como valores por defecto y elegir la opción \"Publicar ahora\", Google generará una URL para el libro.", "وعندها يمكنك رؤية الحوار الذي يتيح لك خيارات لنشر ورقة العمل. ترك كل الخيارات كما التخلف واختيار \"نشر الآن\" الخيار، وجوجل سوف تولد URL للمصنف.", "然后你会看到一个对话框，让你发布工作表的选项。保留所有的选项为默认值，然后选择“立即发布”选项，谷歌会为工作簿的URL。", "その後、あなたのワークシートを公開するためのオプションを提供しますダイアログが表示されます。デフォルトとしてすべてのオプションを残し、 \"今すぐ公開」オプションを選択すると、Googleは、ブックのURLを生成します。", "그런 다음 당신에게 워크 시트를 게시하기위한 옵션을 제공하는 대화 상자가 표시됩니다. 기본값으로 모든 옵션을 떠나 \"지금 게시\"옵션을 선택하면, 구글은 통합 문서에 대한 URL을 생성합니다.", "Sau đó bạn sẽ thấy một hộp thoại cung cấp cho bạn tùy chọn để xuất bản bảng tính. Rời bỏ tất cả các tùy chọn như mặc định và chọn \"Publish Now\", Google sẽ tạo ra một URL cho bảng tính.", "Вы увидите диалоговое окно, которое дает вам варианты для публикации лист. Оставив все варианты, как по умолчанию, и выбрав опцию \"Опубликовать сейчас\", Google будет генерировать URL для книги.", "U ziet dan een dialoogvenster dat geeft je opties voor het werkblad publiceren. Verlaten alle opties als standaard en kiezen voor de optie \"Nu publiceren\", zal Google een URL voor de werkmap te genereren."));
			Rows.Add( new DocumentationRow("ID_HELP_PUBLISHINGWORKBOOKS3", "The URL in the Document Link box is the URL that you will be giving Google2u. Copy it from the box.\n\nOnce you have published the workbook, return to the Google2u window and navigate to the Manual Workbooks page of the Workbooks tab. There you will paste the URL obtained from Google into the box, and click the + button. The workbook will appear under the \"Manual Workbooks\" heading.", "L'URL dans la boîte Document de lien est l'URL que vous donnerez Google2u. Copiez-le dans la boîte.\n\nUne fois que vous avez publié le classeur, revenir à la fenêtre Google2u et accédez à la page classeurs Manuel de l'onglet classeurs. Il vous collez l'URL obtenue à partir de Google dans la boîte, et cliquez sur le bouton +. Le classeur apparaîtra sous le \"Manuel classeurs\" rubrique.", "L'URL nella casella Document Link è l'URL che darete Google2u. Copiare dalla scatola.\n\nDopo aver pubblicato la cartella di lavoro, tornare alla finestra Google2u e passare alla pagina cartelle di lavoro manuale della scheda cartelle di lavoro. Vi si possono incollare l'URL ottenuto da Google nella casella, e fare clic sul pulsante +. La cartella di lavoro verrà visualizzato sotto il \"Manuale cartelle di lavoro\" voce.", "Die URL in der Document Link-Box ist die URL, die Sie geben werden Google2u. Kopieren Sie es aus der Verpackung.\n\nNachdem Sie die Arbeitsmappe veröffentlicht haben, kehren Sie zum Google2u Fenster und navigieren Sie zum Handarbeitsbücher Seite der Registerkarte Arbeitsmappen. Dort finden Sie den von Google in den Kasten erhalten URL einfügen, und klicken Sie auf die Schaltfläche +. Die Arbeitsmappe wird unter dem \"Handarbeitsbücher\" Überschrift angezeigt.", "La URL en el cuadro Vínculo de documento es la URL que le va a dar Google2u. Copia de la caja.\n\nUna vez que ha publicado el libro de trabajo, volver a la ventana Google2u y vaya a la página de manual de libros de trabajo de la ficha Libros de Trabajo. Allí podrá pegar la URL obtenida de Google en el cuadro y haga clic en el botón +. El libro aparecerá bajo el \"Manual de libros de trabajo\" la partida.", "وURL في مربع الارتباط الوثيقة هو URL ان تكونوا إعطاء Google2u. نسخ من مربع.\n\nوبمجرد الانتهاء من نشر المصنف، والعودة إلى إطار Google2u وانتقل إلى الصفحة المصنفات دليل من علامة التبويب المصنفات. هناك سوف لصق URL التي تم الحصول عليها من جوجل داخل منطقة الجزاء، وانقر على زر +. سوف تظهر المصنف تحت \"المصنفات دليل\" البند.", "在文档链接框中的URL是，你将被赋予Google2u的URL。它从箱子复制。\n\n一旦您发布工作簿，返回Google2u窗口并导航到工作簿选项卡的手册工作簿页面。在那里，你将粘贴从谷歌获得的成箱的URL，然后单击+按钮。工作簿将出现在“手册工作簿”的标题。", "ドキュメントリンクボックス内のURLはGoogle2uを与えることになりますURLです。箱からそれをコピーします。\n\nブックを公開した後、Google2uウィンドウに戻り、ワークブックタブのマニュアルワークブックページに移動します。そこには、ボックスにグーグルから取得したURLを貼り付け、[+]ボタンをクリックします。ワークブックは見出し「手動ワークブック」の下に表示されます。", "문서 링크 상자의 URL은 Google2u을 제공되는 URL입니다. 상자에서 복사합니다.\n\n통합 문서를 게시 한 후, Google2u 창으로 리턴 통합 문서 탭의 수동 통합 문서의 페이지로 이동합니다. 거기 당신은 상자에 구글에서 얻은 URL을 붙여 + 버튼을 클릭합니다. 통합 문서 제목 \"수동 통합 문서\"아래에 나타납니다.", "Các URL trong hộp Document Link là URL mà bạn sẽ được đưa Google2u. Sao chép nó từ hộp.\n\nMột khi bạn đã xuất bản các bảng tính, quay lại cửa sổ Google2u và điều hướng đến các trang Workbooks tay của tab Workbooks. Ở đó bạn sẽ dán URL thu được từ Google vào hộp, và nhấp vào nút +. Sách sẽ xuất hiện dưới \"Manual Workbooks\" nhóm.", "URL в поле Document Link является URL, который вы будете давать Google2u. Скопируйте его из коробки.\n\nПосле того, как вы опубликовали книгу, вернуться к окну Google2u и перейдите в ручной Workbooks странице вкладки книгах. Там вы вставить URL, полученный из Google в поле и нажмите кнопку +. Книги появится в разделе \"Руководство книгах\" заголовок.", "De URL in het vak Document Link is de URL die u zal geven Google2u. Kopieer het uit de doos.\n\nZodra u de werkmap hebt gepubliceerd, terug te keren naar het venster Google2u en navigeer naar de Manual Werkboeken pagina van het tabblad werkboeken. Daar vindt u de URL verkregen van Google in de doos plakken, en klik op de knop +. Het werkboek zal verschijnen onder de \"Manual werkboeken\" rubriek."));
			Rows.Add( new DocumentationRow("ID_FADE_USINGUPLOAD", "Uploading Workbooks", "Ajout de classeurs", "Caricamento cartelle di lavoro", "Hochladen von Arbeitsmappen", "Carga de libros de trabajo", "تحميل المصنفات", "上传工作簿", "アップロードワークブック", "업로드 통합 문서", "Tải lên Workbooks", "Загрузка Учебные пособия", "Uploaden werkmappen"));
			Rows.Add( new DocumentationRow("ID_HEADER_UPLOAD", "Google2u Assisted Upload", "Google2u chargement assistée", "Google2u Assisted Carica", "Google2u Assisted hochladen", "Google2u Subir Asistida", "Google2u بمساعدة تحميل", "Google2u辅助上传", "Google2u支援アップロード", "Google2u 보조 업로드", "Google2u Tải lên Assisted", "Google2u Assisted Загрузить", "Google2u Assisted uploaden"));
			Rows.Add( new DocumentationRow("ID_HELP_UPLOAD", "You can upload spreadsheets to your Google Drive using this section. Valid file formats include: .csv, .ods, .tsv, .txt, .xls, .xlsx\nGoogle2u does not check the validity of the spreadsheet data before uploading.", "Vous pouvez télécharger des feuilles de calcul à votre Google Drive utiliser cette section. Formats de fichiers valides sont: .csv, .ods, .tsv, .txt, .xls, .xlsx\nGoogle2u ne vérifie pas la validité des données de feuille de calcul avant de le télécharger.", "È possibile caricare fogli di calcolo per Google Drive utilizzando questa sezione. Formati di file validi includono: .csv, .ods, .tsv, .txt, .xls, .xlsx\nGoogle2u non controlla la validità dei dati del foglio prima di caricare.", "Sie können Tabellen in Ihrem Google Drive mit dieser Abschnitt hochladen. Gültige Dateiformate sind: .csv, ODS, .tsv, .txt, .xls, .xlsx\nGoogle2u hat die Gültigkeit der Spreadsheet-Daten vor dem Hochladen nicht zu überprüfen.", "Puede cargar hojas de cálculo para Google Drive utilizando esta sección. Formatos de archivo válidos son: .csv, ODS, .tsv, .txt, .xls, .xlsx\nGoogle2u no comprueba la validez de los datos de hoja de cálculo antes de cargar.", "يمكنك تحميل جداول البيانات إلى محرك جوجل الخاص بك باستخدام هذا القسم. وتشمل صيغ الملفات صالحة:. CSV أو .ods أو .tsv و txt، xls و. XLSX\nGoogle2u لا تحقق من صحة بيانات جدول البيانات قبل تحميلها.", "您可以使用本节上传的电子表格到你的谷歌驱动器。有效的文件格式包括：.CSV，的.ods，.tsv格式，txt文件，.xls的，的.xlsx\n上传之前Google2u不检查电子表格数据的有效性。", "あなたはこのセクションを使用してGoogleドライブにスプレッドシートをアップロードすることができます。有効なファイル形式は、次のとおりです。.CSV、.odsファイル、.TSV、.txtの、.XLS、.xlsx形式を\nGoogle2uはアップロードする前に、スプレッドシートのデータの妥当性をチェックしません。", "이 절을 사용하여 Google 드라이브에 스프레드 시트를 업로드 할 수 있습니다. 유효한 파일 형식은 다음과 같습니다 .CSV, .ods 파일, .tsv,이 .txt, .XLS, .XLSX를\nGoogle2u는 업로드하기 전에 스프레드 시트 데이터의 유효성을 확인하지 않습니다.", "Bạn có thể tải lên các bảng tính để Google Drive của bạn bằng cách sử dụng phần này. Các định dạng tập tin hợp lệ bao gồm: .csv, .ods, .tsv, .txt, .xls, .xlsx\nGoogle2u không kiểm tra tính hợp lệ của dữ liệu bảng tính trước khi tải lên.", "Вы можете загрузить электронные таблицы для вашего Google Drive, использующей данный раздел. Допустимые форматы файлов: CSV, .ods, TSV, TXT, XLS, .xlsx\nGoogle2u не проверяет достоверность данных электронных таблиц, прежде чем загружать.", "U kunt spreadsheets aan uw Google Drive te uploaden met behulp van deze sectie. Geldige bestandsformaten zijn: .csv, .ods, .tsv, .txt, .xls, .xlsx\nGoogle2u controleert niet de geldigheid van de spreadsheet gegevens voor het uploaden."));
			Rows.Add( new DocumentationRow("ID_FADE_LISTVIEW", "Worksheets List View", "Feuilles de travail Liste Voir", "Fogli di lavoro List View", "Arbeitsblätter Listenansicht", "Hojas de trabajo Lista Ver", "أوراق العمل عرض قائمة", "工作表列表视图", "ワークシートリストビュー", "워크 시트 목록보기", "Worksheets danh sách Xem", "Рабочие List View", "Werkbladen List View"));
			Rows.Add( new DocumentationRow("ID_HEADER_LISTVIEW", "List View of Worksheets in a Workbook", "Liste Vue de feuilles de calcul dans un classeur", "Elenco Vista di fogli di lavoro in una cartella di lavoro", "Liste der Arbeitsblätter in einer Arbeitsmappe", "Vista en lista de hojas de un libro", "عرض قائمة من أوراق العمل في مصنف", "列表查看工作表的工作簿", "ワークブック内のワークシートのリスト表示", "통합 문서의 워크 시트 목록보기", "Xem danh sách các Worksheets trong một Workbook", "Просмотр списка рабочих листов в книге", "Lijstweergave met werkbladen in een werkmap"));
			Rows.Add( new DocumentationRow("ID_HELP_EDITINGLISTVIEW", "The List View contains all of the workbooks associated with the account currently logged in, including workbooks that are shared with that account.", "La liste contient Voir tous les classeurs associés au compte actuellement connecté, y compris les classeurs qui sont partagés avec ce compte.", "L'elenco Visualizza contiene tutte le cartelle di lavoro connessi con l'account attualmente connesso, comprese cartelle di lavoro condivisi con tale account.", "Die Liste enthält alle Arbeitsmappen mit dem Konto verbundenen aktuell angemeldet sind, einschließlich Arbeitsmappen, die mit diesem Konto werden gemeinsam genutzt.", "La Vista de lista contiene todos los libros relacionados con la cuenta actualmente conectado, incluyendo libros de trabajo que se comparten con que cuenta.", "عرض قائمة تحتوي على كافة المصنفات المرتبطة حساب تسجيل دخوله حاليا في، بما في ذلك المصنفات التي يتم تقاسمها مع هذا الحساب.", "列表视图包含所有与帐户相关联的工作簿的当前登录的，其中包括了与该帐户的共享工作簿。", "リストビューは、アカウントに関連付けられているすべてのブックは現在、そのアカウントと共有されているワークブックを含め、ログインして含まれています。", "목록보기는 계정과 관련된 모든 통합 문서가 현재 해당 계정과 공유 통합 문서를 포함하여, 로그인이 포함되어 있습니다.", "Xem danh sách chứa tất cả các bài tập liên quan đến tài khoản hiện đang đăng nhập, bao gồm cả sách bài tập được chia sẻ với các tài khoản đó.", "Просмотр списка содержит все книгах, связанных с учетом настоящее время вошли в систему, в том числе книг, которые являются общими с этой учетной записи.", "De lijstweergave bevat alle werkboeken gekoppeld aan de account momenteel ingelogd, inclusief werkboeken die worden gedeeld met die account."));
			Rows.Add( new DocumentationRow("ID_HELP_EDITINGLISTVIEW2", "Each item in the list can be expanded to view the individual worksheets in the workbook, and their export type. Use the combo box to select the export type. You can use the toolbar below to Refresh, Validate, Edit and Export the workbook.", "Chaque élément de la liste peut être étendue pour afficher les feuilles de calcul dans le classeur, et leur type d'exportation. Utilisez la liste déroulante pour sélectionner le type d'exportation. Vous pouvez utiliser la barre d'outils ci-dessous pour Actualiser, Valider, éditer et exporter le classeur.", "Ogni elemento della lista può essere ampliata per visualizzare i singoli fogli di lavoro nella cartella di lavoro, e il loro tipo di esportazione. Utilizzare la casella combinata per selezionare il tipo di esportazione. È possibile utilizzare la barra degli strumenti sotto di Refresh, Convalida, modificare ed esportare la cartella di lavoro.", "Jeder Eintrag in der Liste kann erweitert werden, um die einzelnen Arbeitsblätter in der Arbeitsmappe und ihrer Exporttyp ansehen zu können. Verwenden Sie das Auswahlfeld, um den Exporttyp auswählen. Sie können die Symbolleiste unten auf Aktualisieren, Validieren, Edit und Exportieren Sie die Arbeitsmappe.", "Cada elemento de la lista se puede ampliar para ver las hojas de trabajo individuales en el libro, así como su tipo de exportación. Utilice la lista desplegable para seleccionar el tipo de exportación. Puede utilizar la barra de herramientas debajo de Actualizar, Validar, editar y exportar el libro.", "كل عنصر في القائمة يمكن توسيعها لعرض أوراق العمل الفردية في المصنف، ونوع صادراتها. استخدام مربع التحرير والسرد لتحديد نوع التصدير. يمكنك استخدام شريط الأدوات أدناه لتحديث، التحقق من صحة، وتحرير تصدير المصنف.", "列表中的每个项目可以扩展到查看工作簿中的单个工作表，以及它们的出口型。使用组合框，选择导出类型。您可以使用工具栏下方刷新，验证，编辑和导出的工作簿。", "リストの各項目は、個々のワークブックのワークシート、およびそれらのエクスポートタイプを表示するには、拡張することができます。エクスポート·タイプを選択するコンボボックスを使用してください。あなたは、最新の情報に更新、検証、編集するには、以下のツールバーを使用してワークブックをエクスポートすることができます。", "목록의 각 항목은 개별 통합 문서의 워크 시트, 및 수출 유형을 표시하도록 확장 될 수있다. 수출 유형을 선택하는 콤보 상자를 사용합니다. 당신은 새로 고침, 유효성 검사, 편집에 아래의 도구 모음을 사용하여 통합 문서를 내보낼 수 있습니다.", "Mỗi mục trong danh sách có thể được mở rộng để xem các bảng tính cá nhân trong bảng tính, và các loại xuất khẩu của họ. Sử dụng hộp combo để chọn kiểu xuất khẩu. Bạn có thể sử dụng thanh công cụ dưới đây để Refresh, Validate, Chỉnh sửa và xuất khẩu các bảng tính.", "Каждый элемент в списке может быть расширена до просмотра отдельных листов в книге, и их тип экспорта. Используйте выпадающий список, чтобы выбрать тип экспорта. Вы можете использовать панель инструментов ниже, чтобы обновить, проверять, редактировать и экспортировать книгу.", "Elk item in de lijst kan worden uitgebreid tot de individuele werkbladen in de werkmap, en hun export soort bekijken. Gebruik de keuzelijst om het type uitvoer selecteren. U kunt de werkbalk hieronder om Refresh, valideren, bewerken en de werkmap exporteren."));
			Rows.Add( new DocumentationRow("ID_HEADER_TOOLBAR_REFRESH", "Refresh Workbook", "Actualiser classeur", "Refresh Workbook", "Aktualisieren Workbook", "Actualizar Libro de Trabajo", "تحديث مصنف", "刷新工作簿", "リフレッシュワークブック", "새로 고침 통합 문서", "Refresh Workbook", "Обновить Рабочая тетрадь", "Vernieuwen Werkboek"));
			Rows.Add( new DocumentationRow("ID_HELP_TOOLBAR_REFRESH", "Reloads the Worksheets in the Workbook manually. If you have added or removed worksheets to the workbook from Google Docs, then you will need ot manually refresh.\n\nOccasionally Google2u will fail to retrieve a workbook. Refreshing can sometimes help.", "Recharge les feuilles de calcul dans le classeur manuellement. Si vous avez ajouté ou supprimé des feuilles de calcul dans le classeur à partir de Google Docs, alors vous aurez besoin ot actualiser manuellement.\n\nParfois Google2u ne parviendra pas à récupérer un classeur. Rafraîchissant peut parfois aider.", "Ricarica le fogli di lavoro nella cartella di lavoro manuale. Se è stato aggiunto o rimosso i fogli di lavoro per la cartella di lavoro da Google Docs, quindi avrete bisogno di ot aggiornare manualmente.\n\nOccasionalmente Google2u non riuscirà a recuperare una cartella di lavoro. Rinfrescante a volte può aiutare.", "Lädt die Arbeitsblätter in der Arbeitsmappe manuell. Wenn Sie Hinzufügen oder Entfernen von Arbeitsblättern zu der Arbeitsmappe von Google Text & Tabellen haben, dann müssen Sie ot manuell zu aktualisieren.\n\nGelegentlich Google2u schlägt fehl, eine Arbeitsmappe abzurufen. Erfrischende kann manchmal helfen.", "Vuelve a cargar las hojas del libro de forma manual. Si ha añadido o eliminado hojas de trabajo para el libro desde Google Docs, entonces usted tendrá que actualizar manualmente ot.\n\nOcasionalmente Google2u fallará para recuperar un libro. Refrescante veces puede ayudar.", "تعيد تحميل أوراق العمل في المصنف يدويا. إذا قمت بإضافة أو إزالة أوراق العمل إلى المصنف من محرر مستندات جوجل، فإنك سوف تحتاج بعد التمديد تحديث يدويا.\n\nأحيانا سوف تفشل Google2u لاسترداد مصنف. منعش يمكن أن تساعد في بعض الأحيان.", "重载手动工作簿的工作表。如果您添加或删除工作表，从谷歌文档的工作簿，那么你就需要OT手动刷新。\n\n偶尔Google2u将无法检索工作簿。清爽有时可以提供帮助。", "手動でワークブック内のワークシートを再ロードします。 Googleドキュメントからワークブックへのワークシートを追加または削除した場合は、手動で更新するOTが必要になります。\n\n時折Google2uはワークブックを取得するために失敗します。リフレッシュは時々助けることができる。", "수동으로 통합 문서의 워크 시트를 다시로드합니다. 추가 또는 Google 문서 도구에서 통합 문서에 워크 시트를 제거한 경우, 당신은 수동으로 새로 하다며해야합니다.\n\n때때로 Google2u 통합 문서를 검색 할 수 없게됩니다. 새로 고침은 때때로 도움이 될 수 있습니다.", "Tải lại Worksheets trong Workbook tay. Nếu bạn đã thêm hoặc loại bỏ các bảng vào bảng tính từ Google Docs, sau đó bạn sẽ cần ot tay làm mới.\n\nThỉnh thoảng Google2u sẽ không lấy một bảng tính. Refreshing đôi khi có thể giúp đỡ.", "Перезагружает листов в учебном пособии вручную. Если вы добавили или удалили листы в книгу из Google Docs, то вам потребуется выполнить вручную обновить.\n\nИногда Google2u не сможет получить книгу. Освежающий иногда может помочь.", "Laadt de werkbladen in de werkmap handmatig. Als u hebt toegevoegd of verwijderd werkbladen om de werkmap van Google Docs, dan moet u ot handmatig vernieuwen.\n\nAf en toe Google2u zal falen om een ​​werkboek te halen. Verfrissend kan soms helpen."));
			Rows.Add( new DocumentationRow("ID_HEADER_TOOLBAR_VALIDATE", "Validate Workbook", "Valider Workbook", "Convalida Workbook", "Validate Workbook", "Validar Workbook", "التحقق من صحة مصنف", "验证工作簿", "検証ワークブック", "유효성 검사 통합 문서", "Validate Workbook", "Проверка Рабочая тетрадь", "Validate Werkboek"));
			Rows.Add( new DocumentationRow("ID_HELP_TOOLBAR_VALIDATE", "Validating the workbook checks for errors in any of the worksheets marked for export. If there is an error on a worksheet, the icon will be red, and pressing the button will take you to the first error.\n\nWorksheets are unable to be exported when an error is detected.", "Validation des contrôles de classeur pour les erreurs dans l'une des feuilles marquées pour l'exportation. Se il ya une erreur sur une feuille de calcul, l'icône sera rouge, et en appuyant sur le bouton vous amène à la première erreur.\n\nFeuilles de travail sont incapables d'être exporté quand une erreur est détectée.", "Convalida i controlli della cartella di lavoro per gli errori in nessuno dei fogli di lavoro contrassegnate per l'esportazione. Se c'è un errore in un foglio di lavoro, l'icona sarà rosso, e premendo il tasto vi porterà al primo errore.\n\nFogli di lavoro sono in grado di essere esportato quando viene rilevato un errore.", "Validierung der Arbeitsmappe Kontrollen für Fehler in einer der für den Export markiert Blätter. Wenn ein Fehler in einem Arbeitsblatt, wird das Symbol rot, und durch Drücken der Taste gelangen Sie in den ersten Fehler zu nehmen.\n\nArbeitsblätter können nicht exportiert werden, wenn ein Fehler festgestellt wird.", "La validación de los controles de libro para los errores en cualquiera de las hojas de trabajo marcadas para la exportación. Si hay un error en una hoja de cálculo, el icono aparecerá en color rojo, y pulsando el botón para ir al primer error.\n\nHojas de trabajo no pueden ser exportados cuando se detecta un error.", "التحقق من صحة الشيكات المصنف عن أخطاء في أي من أوراق العمل ملحوظ للتصدير. إذا كان هناك خطأ في ورقة عمل، فإن رمز تكون حمراء، وسوف الضغط على زر يأخذك إلى الخطأ الأول.\n\nأوراق العمل غير قادرة على أن تصدر عندما تم الكشف عن وجود خطأ.", "验证检查工作簿中的任何标记为导出工作表的误差。如果工作表上的错误，图标会变成红色，并按下按钮，将带你到的第一个错误。\n\n工作表是无法检测到错误时，被导出。", "輸出用にマークされたワークシートのいずれかのエラーのワークブックチェックを検証。ワークシート上のエラーがある場合、アイコンが赤になり、ボタンを押すと、最初のエラーが表示されます。\n\nワークシートには、エラーが検出されたときにエクスポートすることができない。", "수출 표시된 워크 시트의 오류에 대한 통합 문서 검사를 검증. 워크에 오류가있을 경우, 아이콘이 적색 할 것이며, 버튼을 누르면 첫 번째 오류로 이동합니다.\n\n워크 시트 오류가 감지 될 때 내보낼 수 없습니다.", "Chứng thực kiểm tra bảng tính cho các lỗi trong bất kỳ của bảng ghi cho xuất khẩu. Nếu có một lỗi trên một bảng tính, biểu tượng sẽ có màu đỏ, và nhấn nút sẽ đưa bạn đến các lỗi đầu tiên.\n\nWorksheets không thể được xuất khẩu khi một lỗi được phát hiện.", "Пользователи Рабочая тетрадь проверки на наличие ошибок в любом из листов отмеченных для экспорта. Если есть ошибка на листе, значок станет красным, и нажав кнопку приведет вас к первой ошибки.\n\nРабочие не могут быть экспортированы, когда ошибка обнаружена.", "Valideren van de werkmap controles voor fouten in een van de werkbladen gemarkeerd voor de export. Als er een fout op een werkblad, wordt het pictogram rood is, en druk op de knop brengt u naar de eerste fout.\n\nWerkbladen zijn niet in staat om te worden uitgevoerd als er een fout wordt gedetecteerd."));
