			Rows.Add( new DocumentationRow("ID_HELP_TOOLBAR_EDIT", "Selecting the Edit Workbook icon opens the workbook Full View. From there you are able to make basic edits to the worksheets and select Export Options.", "En sélectionnant l'icône Modifier classeur se ouvre le classeur Full View. De là, vous êtes capable de faire des modifications de base aux feuilles de calcul et sélectionnez Options d'exportation.", "Selezionando l'icona Modifica cartella di lavoro si apre la cartella di lavoro Full View. Da lì si è in grado di apportare modifiche di base per i fogli di lavoro e selezionare Opzioni di esportazione.", "Die Auswahl des Bearbeiten-Arbeitsmappe Symbol öffnet die Arbeitsmappe Vollständige Ansicht. Von dort aus sind Sie in der Lage, grundlegende Änderungen an der Arbeitsblätter zu machen, und wählen Sie Exportoptionen.", "Al seleccionar el icono Editar libro se abre el libro View Full. De allí que son capaces de hacer ediciones básicas a las hojas de trabajo y seleccione Opciones de exportación.", "اختيار أيقونة تحرير مصنف يفتح المصنف كامل عرض. من هناك كنت قادرا على إجراء تعديلات أساسية لأوراق العمل وحدد خيارات التصدير.", "选择编辑工作簿图标，打开工作簿完整视图。从那里，你可以进行基本编辑的工作表，然后选择导出选项。", "編集ワークブックアイコンを選択すると、ブック全体表示を開きます。そこからは、ワークシートに基本的な編集を行うと書き出しオプションを選択することができます。", "편집 워크 북 아이콘을 선택하면 통합 문서 전체보기를 엽니 다. 거기에서 내보내기 옵션을 워크 시트에 기본 편집을 선택 할 수 있습니다.", "Chọn biểu tượng Sửa Workbook mở workbook Full View. Từ đó bạn có thể chỉnh sửa cơ bản để các bảng tính và chọn Tùy chọn Export.", "Выбор значка Редактировать Рабочего открытии книги на ладони. Оттуда вы сможете сделать основные правки для рабочих листов и выберите Функции экспорта.", "Het selecteren van het pictogram Bewerken werkmap opent de werkmap Full View. Vanaf daar bent u in staat om elementaire bewerkingen uit te voeren naar de werkbladen en selecteer Exporteren Opties."));
			Rows.Add( new DocumentationRow("ID_HEADER_TOOLBAR_EXPORT", "Export Workbook", "Export Workbook", "Export Workbook", "Export-Arbeitsmappe", "Exportación Workbook", "مصنف التصدير", "出口工作簿", "エクスポートワークブック", "수출 통합 문서", "Xuất Workbook", "Экспорт Рабочая тетрадь", "Export Werkboek"));
			Rows.Add( new DocumentationRow("ID_HELP_TOOLBAR_EXPORT", "Selecting the Export Workbook icon will export all sheets in the workbook marked for export.", "En sélectionnant l'icône Export classeur va exporter toutes les feuilles dans le classeur marqué pour l'exportation.", "Selezionando l'icona Esporta Workbook esporterà tutti i fogli della cartella di lavoro marcata per l'esportazione.", "Die Auswahl des Export-Workbook-Symbol werden alle Blätter in der Arbeitsmappe für den Export markiert exportieren.", "Al seleccionar el icono Exportar Cuaderno exportará todas las hojas del libro de trabajo marcada para la exportación.", "واختيار رمز المصنف تصدير تصدير كافة الأوراق في المصنف ملحوظ للتصدير.", "选择导出工作簿图标将所有表导出标记为导出工作簿中。", "エクスポートブックのアイコンを選択すると、エクスポート用にマークされて、ブック内のすべてのシートをエクスポートします。", "수출 워크 북 아이콘을 선택하면 수출 표시된 통합 문서의 모든 시트를 보냅니다.", "Chọn biểu tượng Export Workbook sẽ xuất khẩu tất cả các sheet trong workbook ghi cho xuất khẩu.", "Выбор значка Экспорт Рабочего будет экспортировать все листы в книге отмечены на экспорт.", "Het selecteren van het pictogram Export Werkboek zullen alle bladen te exporteren in de werkmap gemarkeerd voor de export."));
			Rows.Add( new DocumentationRow("ID_FADE_FULLVIEW", "Worksheets Full View", "Feuilles de travail Full View", "Fogli di lavoro Visualizzazione completa", "Arbeitsblätter Full View", "Hojas de trabajo completo Ver", "أوراق العمل كاملة مشاهدة", "工作表完整视图", "ワークシートフルビュー", "워크 시트 전체보기", "Worksheets Full Xem", "Рабочие Полный Посмотреть", "Werkbladen Full View"));
			Rows.Add( new DocumentationRow("ID_HEADER_FULLVIEW", "Full View of Worksheets in a Workbook", "Vue complète des feuilles de calcul dans un classeur", "Visualizzazione completa di fogli di lavoro in una cartella di lavoro", "Vollständige Ansicht der Arbeitsblätter in einer Arbeitsmappe", "Vista completa de hojas de un libro", "مرأى ومسمع من أوراق العمل في مصنف", "工作表的工作簿完整视图", "ワークブック内のワークシートのフルビュー", "통합 문서의 워크 시트의 전체보기", "Xem Đầy đủ các Worksheets trong một Workbook", "Полный вид листов в тетради", "Volledige weergave van de werkbladen in een werkmap"));
			Rows.Add( new DocumentationRow("ID_HELP_FULLVIEW", "Clicking the Edit icon in the List View will open a window that contains the Worksheets and all of the data, as well as General and Export Type specific options.", "Cliquez sur l'icône Modifier de la Liste Voir ouvrira une fenêtre qui contient les feuilles de travail et toutes les données, ainsi que des options spécifiques et générales Type d'exportation.", "Facendo clic sull'icona Modifica nella Visualizzazione Elenco si aprirà una finestra che contiene i fogli di lavoro e tutti i dati, così come Generali e di esportazione del tipo opzioni specifiche.", "Durch Klicken auf das Symbol Bearbeiten in der Listenansicht öffnet sich ein Fenster, das die Arbeitsblätter und alle Daten, sowie Allgemeine und Exporttyp spezifische Optionen enthält öffnen.", "Al hacer clic en el icono Editar en la vista de lista, se abrirá una ventana que contiene las hojas de trabajo y todos los datos, así como las opciones específicas Generales y Exportación Tipo.", "بالنقر على أيقونة تحرير في عرض قائمة ستفتح لك نافذة الذي يحتوي على أوراق العمل وكافة البيانات، فضلا عن خيارات محددة عامة وتصدير نوع.", "单击列表视图中的编辑图标将打开包含工作表和所有的数据，以及一般及导出类型特定的选项窗口。", "リストビューの[編集]アイコンをクリックすると、ワークシートとデータのすべてが含まれているウィンドウを開くだけでなく、一般的なおよびエクスポートタイプ固有のオプションになります。", "워크 시트와 데이터뿐만 아니라 모든 일반 및 내보내기 유형 특정 옵션이 포함 된 창이 열립니다 목록보기에서 편집 아이콘을 클릭.", "Nhấp vào biểu tượng Edit trong List View sẽ mở ra một cửa sổ chứa các Worksheets và tất cả các dữ liệu, cũng như chung và khẩu Loại hình tùy chọn cụ thể.", "При нажатии на иконку Редактировать в виде списка откроется окно, которое содержит листы и все данные, а также общие и экспорт Тип конкретные параметры.", "Klikken op het pictogram Bewerken in de lijstweergave opent een venster dat de Werkbladen en alle gegevens, alsmede algemene en Export Type specifieke opties bevat."));
			Rows.Add( new DocumentationRow("ID_HEADER_BTNREFRESH", "Refresh Workbook Button", "Actualiser classeur Bouton", "Aggiorna Button Workbook", "Aktualisieren Workbook-Taste", "Botón Actualizar Libro de Trabajo", "تحديث مصنف زر", "刷新工作簿按钮", "ワークブックボタンをリフレッシュ", "통합 문서 새로​​ 고침 단추", "Làm mới Workbook Nút", "Обновить Рабочего кнопку", "Vernieuwen Werkboek Button"));
			Rows.Add( new DocumentationRow("ID_HELP_BTNREFRESH", "This will trigger a refresh on the entire workbook, not just the worksheet in the Full View. If you have changes that you have made on the Google Docs spreadsheet, and they have not yet updated in GoogleFu, this will manually refresh the current data.", "Cela déclenchera une actualisation sur le classeur entier, et pas seulement la feuille de calcul dans la vue complet. Si vous avez des changements que vous avez faits sur la feuille de calcul Google Docs, et ils ne avez pas encore mis à jour en GoogleFu, cela va actualiser manuellement les données actuelles.", "Ciò attiverà un aggiornamento sulla intera cartella di lavoro, non solo il foglio di lavoro nella vista completa. Se si dispone di modifiche apportate al foglio di calcolo di Google Docs, e non hanno ancora aggiornato in GoogleFu, questo aggiornare manualmente i dati attuali.", "Dadurch wird eine Aktualisierung auf die gesamte Arbeitsmappe, nicht nur das Arbeitsblatt in der Vollansicht auslösen. Wenn Sie Änderungen, die Sie auf der Google Text & Tabellen Tabellenkalkulation vorgenommen haben, und sie sind noch nicht in GoogleFu aktualisiert, wird diese manuell den aktuellen Daten zu aktualisieren.", "Esto dará lugar a una actualización en todo el libro, no sólo la hoja de trabajo en la vista completa. Si tiene cambios que ha realizado en la hoja de cálculo de Google Docs, y que todavía no ha actualizado en googleFU, esto actualizar manualmente los datos actuales.", "وهذا يؤدي إلى تحديث على المصنف بأكمله، وليس فقط ورقة العمل في مشاهدة كاملة. إذا كان لديك التغييرات التي قمت بها على جدول البيانات محرر مستندات جوجل، وأنها لم تقم بتحديث بعد في GoogleFu، وهذا سوف تحديث البيانات الحالي يدويا.", "这将触发刷新整个工作簿上，不只是在完整视图的工作表。如果你有你已经在谷歌文档电子表格的变化，他们还没有更新的GoogleFu，这将手动刷新当前数据。", "これはブック全体でリフレッシュ、フルビューでだけではなく、ワークシートをトリガーします。あなたはGoogleドキュメントのスプレッドシートで行った変更を持っている、と彼らはまだGoogleFuで更新していない場合は、これは手動で現在のデータを更新します。", "이는 전체 통합 문서에 새로 고침, 전체보기에있는 기능뿐만 아니라 워크 시트를 트리거합니다. 당신이 구글 문서 도구 스프레드 시트에서 변경 한 변경 사항이, 그리고 그들이 아직 GoogleFu에서 업데이트되지 않은 경우,이 수동으로 현재 데이터를 새로 고쳐집니다.", "Điều này sẽ kích hoạt một refresh trên toàn bộ bảng tính, không chỉ các bảng tính trong View Full. Nếu bạn có những thay đổi mà bạn đã thực hiện trên bảng tính Google Docs, và họ chưa được cập nhật trong GoogleFu, điều này sẽ tự làm mới dữ liệu hiện hành.", "Это вызовет обновление на всей книге, а не только лист в полном виде. Если у вас есть изменения, которые вы сделали на таблицу Google Docs, и они еще не обновили в GoogleFu, это будет вручную обновить текущие данные.", "Dit zal een refresh op de hele werkmap, niet alleen het werkblad in de Full View triggeren. Als u de wijzigingen die u op de Google Docs spreadsheet gemaakt hebben, en ze zijn nog niet bijgewerkt in GoogleFu, zal dit handmatig de huidige gegevens te vernieuwen."));
			Rows.Add( new DocumentationRow("ID_HEADER_BTNVALIDATE", "Validate Worksheet Button", "Valider Feuille Bouton", "Pulsante Convalida Foglio", "Validate Arbeitsblatt Taste", "Botón Validar Hoja de trabajo", "التحقق من صحة ورقة عمل زر", "验证工作表扣", "検証ワークシートボタン", "검증 워크 시트 버튼", "Validate Worksheet Nút", "Проверка листа Кнопка", "Validate werkblad Button"));
			Rows.Add( new DocumentationRow("ID_HELP_BTNVALIDATE", "When the button is green, it means the worksheet has been successfully validated. When it is red, you can press it to instantly highlight the problem.", "Lorsque le bouton est vert, cela signifie que la feuille de calcul a été validée avec succès. Quand il est rouge, vous pouvez appuyer sur elle pour mettre en évidence le problème instantanément.", "Quando il pulsante è verde, significa che il foglio di lavoro è stato convalidato correttamente. Quando è rosso, è possibile premere per evidenziare immediatamente il problema.", "Wenn die Taste grün leuchtet, bedeutet dies, das Arbeitsblatt wurde erfolgreich validiert. Wenn es rot ist, können Sie drücken, um sofort zu markieren Sie das Problem.", "Cuando el botón es de color verde, significa que la hoja de cálculo se ha validado con éxito. Cuando está en rojo, puede pulsarlo para resaltar el problema al instante.", "عندما الزر هو أخضر، فهذا يعني تم التحقق من صحة ورقة العمل بنجاح. عندما يكون أحمر، يمكن أن تضغط عليه لتسليط الضوء على الفور المشكلة.", "当按钮是绿色的，这意味着在工作表已经被成功验证。当它是红色的，你可以按下瞬间突出问题。", "ボタンが緑色である場合には、ワークシートが正常に検証されていることを意味します。それが赤のときは、すぐに問題を強調するために、それを押すことができます。", "녹색 버튼되면 시트가 성공적 검증 한 내용을 의미한다. 이 빨간색 인 경우, 당신은 즉시 문제를 강조하기 위해 누를 수 있습니다.", "Khi nút là màu xanh lá cây, nó có nghĩa là các bảng tính đã được xác nhận thành công. Khi đó là màu đỏ, bạn có thể bấm vào nó để làm nổi bật vấn đề ngay lập tức.", "Когда кнопка зелёная, это означает, таблица была успешно проверена. Когда оно краснеет, при нажатии на кнопку, чтобы мгновенно привлечь внимание к проблеме.", "Wanneer de knop groen is, betekent dit dat het werkblad is met succes gevalideerd. Als het rood is, kunt u op deze direct markeren het probleem."));
