			Rows.Add( new DocumentationRow("ID_HELP_BTNOPEN", "This will open the Google Doc in a browser window", "Cela ouvrira la Doc Google dans une fenêtre de navigateur", "Si aprirà la Doc Google in una finestra del browser", "Dies wird die Google Doc in einem Browser-Fenster", "Esto abrirá el Doc Google en una ventana del navegador", "سيؤدي هذا إلى فتح الوثيقة جوجل في نافذة المتصفح", "这将在浏览器窗口中打开谷歌文档", "これは、ブラウザ·ウィンドウにGoogleドキュメントが開きます", "이 브라우저 창에 구글 닥 열립니다", "Điều này sẽ mở Doc Google trong một cửa sổ trình duyệt", "Это откроет Doc Google в окне браузера", "Dit zal de Google Doc openen in een browservenster"));
			Rows.Add( new DocumentationRow("ID_HEADER_BTNEXPORT", "Export Worksheet Button", "Export Feuille Bouton", "Pulsante Esporta Foglio di lavoro", "Export-Arbeitsblatt-Taste", "Botón Exportar hoja de cálculo", "ورقة عمل تصدير زر", "出口工作表扣", "エクスポートワークシートボタン", "수출 워크 시트 버튼", "Xuất Worksheet Nút", "Экспорт листа Кнопка", "Export werkblad Button"));
