			Rows.Add( new DocumentationRow("ID_HELP_BTNACTIVE", "This will activate the selected worksheet, populating the data grid with the data from the worksheet and allow you to export it individually", "Cela permettra d'activer la feuille de calcul choisi, remplissage de la grille de données avec les données de la feuille et vous permettre d'exporter individuellement", "Questo attiverà il foglio di lavoro selezionato, popolando la griglia di dati con i dati del foglio di lavoro e consente di esportare individualmente", "Damit wird das ausgewählte Arbeitsblatt aktivieren, bevölkern das Datenraster mit den Daten aus dem Arbeitsblatt und ermöglicht es Ihnen, diese zu exportieren", "Esto activará la hoja de trabajo seleccionada, poblando la cuadrícula de datos con los datos de la hoja de trabajo y permitirá exportar individualmente", "هذا وسوف تفعيل ورقة العمل المختارة، ملء شبكة البيانات مع البيانات من ورقة العمل وتسمح لك لتصديره بشكل فردي", "这将激活选定工作表，填充数据网格从表中的数据，并允许您单独导出", "これは、ワークシートからのデータでデータグリッドを移入、選択したワークシートをアクティブにして、個別にそれをエクスポートすることができます", "이 워크 시트의 데이터와 데이터 그리드를 채우는, 선택된 워크 시트를 활성화하고 개별적으로 내보낼 수 있습니다", "Điều này sẽ kích hoạt các bảng chọn, dân cư ở lưới dữ liệu với các dữ liệu từ các bảng tính và cho phép bạn xuất khẩu nó riêng", "Это активирует выбранный лист, заполнение таблицы данных с данными из листа и позволяет экспортировать его отдельно", "Dit zal het geselecteerde werkblad te activeren, het vullen van de data grid met de gegevens uit het werkblad en je toestaan ​​om het individueel exporteren"));
			Rows.Add( new DocumentationRow("ID_HEADER_BTNEXPORTAS", "Export Data Type Selection", "Exporter la sélection Type de données", "Export Data Type Selection", "Exportieren von Daten Typenwahl", "Exportar selección Tipo de datos", "تصدير نوع البيانات اختيار", "导出数据类型选择", "データのエクスポートタイプの選択", "데이터 내보내기 유형 선택", "Export Data Type Selection", "Выбор Экспорт Тип данных", "Export typeselectie"));
			Rows.Add( new DocumentationRow("ID_HELP_BTNEXPORTAS", "Here you can choose which data format to export your worksheet as. This will also enable the Export Options for the selected export data type", "Ici vous pouvez choisir le format des données pour exporter votre feuille de calcul. Cela permettra également les options d'exportation pour le type de données d'exportation sélectionné", "Qui puoi scegliere quale formato di dati per esportare il foglio di lavoro come. Ciò permetterà anche le opzioni di esportazione per il tipo di dati di esportazione selezionato", "Hier können Sie wählen, welche Datenformat auf Ihrer Arbeitsmappe exportieren. Damit wird auch die Exportoptionen für den ausgewählten Exportdatentyp", "Aquí puede elegir qué formato de datos para exportar la hoja de trabajo como. Esto también permitirá a las opciones de exportación para el tipo de datos de exportación seleccionado", "هنا يمكنك اختيار أي تنسيق البيانات لتصدير ورقة العمل كما. وهذا أيضا تمكين خيارات التصدير لنوع البيانات تصدير مختارة", "在这里，您可以选择数据格式到工作表导出为。这也将启用所选的导出数据类型的导出选项", "ここでは、としてあなたのワークシートをエクスポートするデータ形式を選択できます。これはまた、選択したエクスポートデータ型のエクスポートオプションが有効になります", "여기로 워크 시트를 내보낼 수있는 데이터 형식을 선택할 수 있습니다. 이것은 또한 선택된 수출 데이터 형식 보내기 옵션있게", "Ở đây bạn có thể chọn định dạng dữ liệu để xuất khẩu bảng tính của bạn như. Điều này cũng sẽ cho phép các tùy chọn Export để xuất khẩu loại dữ liệu đã chọn", "Здесь вы можете выбрать формат данных для экспорта рабочего листа. Это также позволит параметры экспорта для выбранного типа данных экспорта", "Hier kunt u kiezen welke data formaat om uw werkblad exporteren als. Dit zal ook de export opties voor het geselecteerde uitvoer soort gegevens mogelijk te maken"));
