			Rows.Add( new DocumentationRow("ID_HEADER_EXPORTOPTIONS", "Accessing Export Options", "Accès aux options d'exportation", "Accesso alle opzioni di esportazione", "Zugriff auf Exportoptionen", "Acceso a las opciones de exportación", "الوصول إلى خيارات التصدير", "访问导出选项", "エクスポートオプションへのアクセス", "내보내기 옵션에 액세스", "Truy cập tùy chọn Export", "Доступ к опции экспорта", "Toegang tot Export Options"));
			Rows.Add( new DocumentationRow("ID_HELP_EXPORTOPTIONS", "You can access options for exporting worksheets from the Full View and opening the Export Options area. From there you will see options specific to the Export Type you have selected.", "Vous pouvez accéder aux options pour l'exportation de feuilles de calcul de la Vue complète et l'ouverture de la zone Options d'exportation. De là, vous verrez des options spécifiques au type d'exportation que vous avez sélectionné.", "È possibile accedere alle opzioni per l'esportazione fogli di lavoro dal Full View e aprendo l'area Opzioni di esportazione. Da lì si vedrà soluzioni specifiche per tipo di esportazione selezionato.", "Sie können Optionen für den Export von Arbeitsblättern aus der Vollansicht und Öffnen der Exportoptionen Bereich zu betreten. Von dort werden Sie speziell für den Export Typ ausgewählten Optionen zu sehen.", "Puede acceder a las opciones para la exportación de hojas de trabajo de la vista completa y abriendo el área Opciones de exportación. Desde allí podrás ver las opciones específicas para el tipo de exportación que ha seleccionado.", "يمكنك الوصول إلى خيارات لتصدير أوراق العمل من عرض كامل وفتح المجال خيارات التصدير. من هناك سترى خيارات محددة لنوع التصدير التي قمت بتحديدها.", "您可以访问选项的完整视图导出工作表，打开导出选项区域。从那里，你会看到具体到您所选择的导出类型的选项。", "あなたは、フルビューからワークシートをエクスポートし、エクスポートオプション領域を開くためのオプションにアクセスすることができます。そこからは、選択したエクスポート·タイプに固有のオプションが表示されます。", "당신은 전체보기에서 워크 시트를 수출하고 내보내기 옵션 영역을 여는 옵션에 액세스 할 수 있습니다. 거기에서 당신은 당신이 선택한 내보내기 유형에 대한 옵션이 표시됩니다.", "Bạn có thể truy cập vào các tùy chọn để xuất khẩu các bảng tính từ Full Xem và mở các khu vực tùy chọn Export. Từ đó bạn sẽ thấy các tùy chọn cụ thể cho các loại xuất khẩu mà bạn đã chọn.", "Вы можете получить доступ к параметрам для экспорта листы из полного просмотра и открытия области параметров экспорта. Оттуда вы увидите варианты, специфичные для экспорта тип, который вы выбрали.", "U kunt opties openen voor het exporteren van werkbladen uit de Full View en het openen van het gebied Export Options. Vanaf daar zult u speciaal op het Exporttype jou geselecteerde."));
			Rows.Add( new DocumentationRow("ID_HEADER_WHITESPACE", "Whitespace Options", "Options d'espacement", "Opzioni spazi vuoti", "Leerzeichenoptionen", "Opciones de espacio en blanco", "خيارات بيضاء", "空白选项", "空白のオプション", "공백 옵션", "Tùy chọn khoảng trắng", "Непечатаемых знаков", "Witruimte Opties"));
			Rows.Add( new DocumentationRow("ID_HELP_WHITESPACE", "There are two options for trimming whitespace from imported data.\n\n- Trim Strings: Checking this box will trim whitespace from any individual string in a cell.\nExample: A cell that contains the string \"   SAMPLE   \" will be trimmed to \"SAMPLE\".\n\n- Trim String Arrays: Checking this box will trim whitespace from entries in a string array.\nExample: A cell of type String Array contains \"SAMPLE   |  STRING ARRAY\" will be trimmed to \"SAMPLE|STRING ARRAY\"", "Il ya deux options pour couper les espaces à partir des données importées.\n\n- Garniture Cordes: Cochez cette case pour couper les espaces à partir ne importe quelle chaîne dans une cellule individuelle.\nExemple: Une cellule qui contient la chaîne \"SAMPLE\" sera coupé à \"SAMPLE\".\n\n- Garniture cordes tableaux: Cochez cette case pour couper les espaces à partir des entrées dans un tableau de chaînes.\nExemple: Une cellule de type String tableau contient \"SAMPLE | tableau de chaînes\" sera coupé à \"SAMPLE | tableau de chaînes\"", "Ci sono due opzioni per il taglio spazi dai dati importati.\n\n- Trim Strings: Selezionando questa casella si assetto spazi da ogni singola stringa in una cella.\nEsempio: Una cella che contiene il \"campione\" stringa sarà tagliato a \"campione\".\n\n- Trim String Array: Selezionando questa casella si assetto spazi dalle voci in una matrice di stringhe.\nEsempio: Una cellula di tipo String Array contiene \"CAMPIONE | STRING ARRAY\" verrà tagliato a \"CAMPIONE | STRING ARRAY\"", "Es gibt zwei Optionen zum Trimmen Leerzeichen aus importierten Daten.\n\n- Trim Streicher: Aktivierung dieser Box wird Whitespace von jeder einzelnen Saite in eine Zelle zu trimmen.\nBeispiel: Eine Zelle, die die Zeichenfolge \"SAMPLE\" enthält, wird getrimmt, um \"SAMPLE\" werden.\n\n- Trim String Arrays: Durch Markieren dieses Kästchens wird Whitespace von Einträgen in einem String-Array zu trimmen.\nBeispiel: Eine Zelle vom Typ String Array enthält \"SAMPLE | STRING ARRAY\" wird getrimmt werden, um \"SAMPLE | STRING ARRAY\"", "Hay dos opciones para el recorte de los espacios en blanco de los datos importados.\n\n- Recortar Cuerdas: Al marcar esta casilla recortará los espacios en blanco de cualquier cadena individual en una celda.\nEjemplo: Una célula que contiene el \"MUESTRA\" cadena será recortado a \"MUESTRA\".\n\n- Recorte de Cuerda Arrays: Al marcar esta casilla será recortar los espacios en blanco de las entradas en una matriz de cadenas.\nEjemplo: Una célula de matriz de tipo String contiene \"MUESTRA | matriz de cadena\" se recortará a \"MUESTRA | matriz de cadena\"", "هناك خياران لتقليم بيضاء من البيانات المستوردة.\n\n- تريم الجمل: التحقق من هذا المربع الصغير وسيتم تقليم بيضاء من أي سلسلة الفردية في خلية.\nمثال: الخلية التي تحتوي على السلسلة \"عينة\" سيتم قلص ل\"SAMPLE\".\n\n- تريم سلسلة صفائف: التحقق من هذا المربع الصغير وسيتم تقليم بيضاء من الإدخالات في صفيف سلسلة.\nمثال: خلية من نوع سلسلة صفيف يحتوي على \"SAMPLE | STRING ARRAY\" سيتم قلصت إلى \"SAMPLE | STRING ARRAY\"", "有两个选项从进口数据修剪空白。\n\n - 修剪字符串：选中该复选框，将削减从空白单元格中任何个人的字符串。\n例如：包含字符串“SAMPLE”的单元将被修整，以“SAMPLE”。\n\n - 修剪字符串数组：选中该复选框，将削减从项空白的字符串数组。\n例如：String类型数组的一个单元格中包含“SAMPLE |字符串数组”将被修剪到“SAMPLE |字符串数组”", "インポートしたデータから空白をトリミングするための2つのオプションがあります。\n\n - トリムストリングス：このチェックボックスをオンにすると、セル内の任意の個々の文字列から空白をトリムします。\n例：文字列 \"SAMPLE\"が含まれているセルは「SAMPLE」にトリミングされます。\n\n - トリムストリングアレイ：このボックスをチェックすると、文字列配列内のエントリから空白をトリムします。\n例：String型のセル配列が含まれている「SAMPLEを|文字列配列」は、トリミングされる「SAMPLE |文字列配列」", "가져온 데이터에서 공백을 트리밍을위한 두 가지 옵션이 있습니다.\n\n- 트림 문자열 : 셀의 개별 문자열에서 공백을 트리밍합니다이 확인란을 선택.\n예 : 문자열 \"SAMPLE\"를 포함하는 셀은 \"SAMPLE\"로 손질합니다.\n\n- 트림 문자열 배열 : 문자열 배열의 항목에서 공백을 트리밍합니다이 확인란을 선택.\n예 : 유형 문자열 배열의 셀은 \"샘플 | 문자열 배열\"을 포함 손질됩니다에 \"SAMPLE | 문자열 배열\"", "Có hai tùy chọn để cắt tỉa khoảng trắng từ dữ liệu nhập khẩu.\n\n- Trim Strings: Kiểm tra hộp này sẽ cắt khoảng trắng từ bất kỳ chuỗi cá nhân trong một tế bào.\nVí dụ: Một tế bào có chứa chuỗi \"SAMPLE\" sẽ được cắt tỉa \"SAMPLE\".\n\n- Trim Chuỗi Mảng: Kiểm tra hộp này sẽ cắt khoảng trắng từ các mục trong một mảng chuỗi.\nVí dụ: Một tế bào của kiểu String Mảng chứa \"MẪU | STRING ARRAY\" sẽ được cắt tỉa \"MẪU | STRING ARRAY\"", "Есть два варианта для обрезки пробелы из импортируемых данных.\n\n- Команда TRIM строки: При установке этого флажка обрезать пробелы из любой отдельной цепочки в клетке.\nПример: ячейка, которая содержит строку \"образец\", будет удален «отведать».\n\n- Обрезать массивами строк: При установке этого флажка обрезать пробелы из записей в массив строк.\nПример: ячейка типа массив строк содержит «образец | массив строк\", будет удален «отведать | массив строк\"", "Er zijn twee opties voor het trimmen van witruimte uit ingevoerde gegevens.\n\n- Trim Strings: Dit aanvinken zal witruimte trimmen van elke individuele snaar in een cel.\nVoorbeeld: Een cel die de string \"SAMPLE\" bevat zal worden bijgesneden om \"MONSTER\".\n\n- Trim String Arrays: Dit aanvinken zal witruimte uit inzendingen trimmen in een string array.\nVoorbeeld: Een cel van het type String Array bevat \"MONSTER | tekenreeksarray\" zal worden bijgesneden om \"MONSTER | tekenreeksarray\""));
			Rows.Add( new DocumentationRow("ID_HEADER_ARRAYDELIMITERS", "Array Delimiter Options", "Tableau d'options Délimiteur", "Opzioni Array delimitatori", "Array Trennzeichen Optionen", "Opciones delimitadores matriz", "خيارات مجموعة محدد", "数组分隔符选项", "配列の区切りのオプション", "배열 구분 옵션", "Tùy chọn mảng Delimiter", "Массив разделяющие параметры", "Array Scheidingsteken Opties"));
			Rows.Add( new DocumentationRow("ID_HELP_ARRAYDELIMITERS", "Data types such as String Array and Int Array, Complex types such as Vector, and Complex Arrays such as Vector Array are string delimited in individual cells. You can set the specific Array Delimiter characters from here. Examples of what the array should look like with the selected delimiters is shown in this box when the delimiter is set. ", "Les types de données telles que String et Int tableau Array, types complexes tels que Vector, et des tableaux complexes tels que Vector tableau sont chaîne délimitée dans des cellules individuelles. Vous pouvez définir les caractères spécifiques Array Délimiteur d'ici. Des exemples de ce que le tableau devrait ressembler avec les séparateurs sélectionnés sont présentés dans cette case lorsque le séparateur est fixé.", "I tipi di dati, come String Array e Int Array, tipi complessi come il vettore, e matrici complesse come vettore Array sono stringa delimitata in singole cellule. È possibile impostare le specifiche personaggi Array delimitatori da qui. Esempi di ciò che l'array dovrebbe essere simile con i delimitatori selezionati è mostrato in questa casella se il delimitatore è impostato.", "Datentypen wie String Array und Int Array, Komplexe Typen wie Vector und Complex Arrays wie Vector Array sind Zeichenfolge in einzelne Zellen getrennt. Sie können die spezifischen Array Trennzeichen Zeichen eingestellt. Beispiele für das, was das Array sollte wie mit den gewählten Trennzeichen aussehen wird in diesem Feld angezeigt, wenn das Trennzeichen gesetzt.", "Los tipos de datos, tales como cadena de matriz y Int Array, tipos complejos como vector, y matrices complejas como vector de matriz son cadena delimitada en celdas individuales. Puede establecer los caracteres específicos de los delimitadores de matriz desde aquí. Ejemplos de lo que la matriz debe ser similar con los delimitadores seleccionados se muestran en el cuadro cuando se define el delimitador.", "أنواع البيانات مثل سلسلة صفيف وكثافة العمليات صفيف، وأنواع المعقدة مثل ناقلات، والمصفوفات المعقدة مثل ناقل صفيف هي سلسلة محددة في الخلايا الفردية. يمكنك تعيين أحرف محددة صفيف محدد من هنا. ويرد الأمثلة على ما صفيف يجب أن تبدو مع المحددات المختارة في هذا الإطار عندما يتم تعيين محدد.", "数据类型，如String数组和int数组，复杂类型，如向量，和复杂的阵列，如矢量阵的字符串分隔的单个细胞。你可以从这里设置具体阵列分隔符。数组应该是什么样子的选择符的例子显示在此框中时，分隔符设置。", "そのような文字列配列とint配列、このようなベクターなどの複合型、及びそのようなベクトル配列などの複雑なアレイのようなデータ型は、個々の細胞内で区切られた文字列である。ここから特定のアレイ区切り文字を設定することができます。区切り文字が設定されている場合、配列は、選択し、区切り文字でどのように見えるかの例には、このボックスに表示されます。", "이러한 문자열 배열 및 int 배열 같은 벡터와 같은 복합 유형 및 벡터 배열과 같은 복잡한 배열로 데이터 유형은 개별 셀에 구분 된 문자열입니다. 여기에서 특정 배열 구분 문자를 설정할 수 있습니다. 구분 기호가 설정 될 때 배열이 선택한 구분 기호 어떠해야하는지의 예는이 상자에 표시됩니다.", "Loại dữ liệu như dây Array và Int Array, loại phức tạp như Vector, và mảng phức tạp như Vector mảng là chuỗi phân định trong từng tế bào. Bạn có thể thiết lập các ký tự Mảng Delimiter cụ thể từ đây. Ví dụ về những mảng đó như thế nào với các dấu chọn được hiển thị trong hộp này khi các dấu phân cách được thiết lập.", "Типы данных, такие как массив строк и целочисленный массив, сложные типы, такие как векторные и комплексные массивы, такие как векторного массива являются строки с разделителями в отдельных клетках. Вы можете установить определенные символы Массив разделитель отсюда. Примеры того, что массив должен выглядеть с выбранными разделителей показано в этом окне при разделитель установлен.", "Soorten gegevens zoals String Array en Int Array, Complex soorten, zoals Vector, en Complex Arrays zoals Vector Array zijn reeks gescheiden in afzonderlijke cellen. U kunt de specifieke Array scheidingstekens instellen van hier. Voorbeelden van wat de array eruit moet zien met de geselecteerde scheidingstekens wordt in dit vak wanneer het scheidingsteken is ingesteld."));
			Rows.Add( new DocumentationRow("ID_HEADER_OPTIONS_OBJDB", "Game Object Database Options", "Base de données de l'objet Options du jeu", "Gioco Opzioni database Object", "Spiel-Objektdatenbank-Optionen", "Juego Opciones de base de datos de objetos", "لعبة خيارات قاعدة البيانات كائن", "游戏对象数据库选项", "ゲームオブジェクトデータベースオプション", "게임 객체 데이터베이스 옵션", "Trò chơi đối tượng cơ sở dữ liệu tùy chọn", "Опции игры объектных баз данных", "Game Object Database Opties"));
			Rows.Add( new DocumentationRow("ID_HELP_OPTIONS_OBJDB", "These options are only shown if the Export Type is set to Object Database.\n\n- Game Object Database: The object in the scene that will be used to store the database once exported. If blank, a new object will be created.\n- Generate Playmaker Actions: If checked, Google2u will generate Playmaker actions specific to your exported data\n- Persist Scene Loading: If checked, the DoNotDestroy option will be used, and the Game Object database will survive scene loads\n- Stop On Blank Column: If checked, the first blank column in the spreadsheet will be the final column in the exported data. Otherwise blank columns are simply skipped\n- Stop On Blank Row: If checked, the first blank row in the spreadsheet will be the final row in the exported data. Otherwise blank rows are simply skipped.", "Ces options ne sont affichés que si le type de l'exportation est fixé à l'objet Base de données.\n\n- Base de données de l'objet du jeu: L'objet de la scène qui sera utilisée pour stocker la base de données une fois exporté. Si vide, un nouvel objet sera créé.\n- Générer Playmaker Actions: Si coché, Google2u va générer des actions Playmaker spécifiques à vos données exportées\n- Persistance Scène Chargement: Si elle est cochée, l'option DoNotDestroy sera utilisée, et la base de données d'objets de jeu survivra charges de scène\n- Arrêt sur colonne vide: Si elle est cochée, la première colonne vide dans la feuille de calcul sera la dernière colonne dans les données exportées. Sinon colonnes vides sont simplement ignorés\n- Arrêt sur ligne vide: Si elle est cochée, la première ligne vide dans le tableur sera la dernière rangée dans les données exportées. Sinon lignes vides sont tout simplement ignorée.", "Queste opzioni vengono visualizzati solo se il tipo di esportazione è impostato a Object Database.\n\n- Database Object gioco: L'oggetto nella scena che verrà utilizzato per archiviare il database una volta esportato. Se vuoto, verrà creato un nuovo oggetto.\n- Generazione di Playmaker Azioni: Se selezionato, Google2u genererà azioni Playmaker specifiche per i vostri dati esportati\n- Persistono Scene Caricamento: Se selezionato, verrà utilizzata l'opzione DoNotDestroy, e il database Object gioco sopravviverà carichi di scena\n- Stop On colonna vuota: Se selezionato, la prima colonna vuota nel foglio di calcolo sarà l'ultima colonna nei dati esportati. In caso contrario, le colonne vuote vengono semplicemente ignorati\n- Stop On riga vuota: Se selezionato, la prima riga vuota nel foglio di calcolo sarà l'ultima fila nei dati esportati. In caso contrario, le righe vuote sono semplicemente ignorati.", "Diese Optionen werden nur angezeigt, wenn der Export Type auf Datenbankobjekt.\n\n- Spiel-Objektdatenbank: Das Objekt in der Szene, die verwendet werden, um die Datenbank zu speichern, sobald exportiert wird. Wenn leer, wird ein neues Objekt erstellt werden.\n- Generieren Spielmacher Aktionen: Wenn aktiviert, wird Google2u Spielmacher Aktionen speziell für Ihre exportierten Daten erzeugen\n- Persist Szene Laden: Wenn diese Option aktiviert, wird die Option DoNotDestroy verwendet werden, und das Spiel-Objekt-Datenbank Szene Lasten überleben\n- Stop auf leere Spalte: Wenn aktiviert, wird die erste leere Spalte in der Tabelle der letzten Spalte in den exportierten Daten sein. Ansonsten leere Spalten werden einfach übersprungen\n- Stop auf leere Reihe: Wenn aktiviert, wird die erste leere Zeile in der Tabelle die letzte Zeile in der exportierten Daten ist. Ansonsten leere Zeilen sind einfach übersprungen.", "Estas opciones sólo aparecen si el tipo de exportación se establece en objeto de base.\n\n- Base de datos de juego de objetos: El objeto en la escena que se utilizará para almacenar la base de datos una vez exportado. Si está en blanco, se creará un nuevo objeto.\n- Generar Playmaker acciones: Si se marca, Google2u generará acciones Playmaker específicas para los datos exportados\n- Persistir Escena de carga: Si se selecciona, se utilizará la opción DoNotDestroy, y la base de datos de juego de objetos sobrevivirá cargas escena\n- Detener en la columna en blanco: Si se marca, la primera columna en blanco en la hoja de cálculo será la última columna de los datos exportados. De lo contrario columnas en blanco son simplemente omiten\n- Detener en fila en blanco: Si se marca, la primera fila en blanco en la hoja de cálculo será la última fila en los datos exportados. De lo contrario filas en blanco son simplemente omite.", "وتظهر هذه الخيارات فقط إذا تم تعيين نوع التصدير إلى كائن قاعدة البيانات.\n\n- قاعدة بيانات كائن لعبة: الكائن في الساحة التي سيتم استخدامها لتخزين قاعدة البيانات مرة واحدة تصديرها. إذا فارغة، سيتم إنشاء كائن جديد.\n- توليد تطبيقات صانع الالعاب: إذا تم، سيكون Google2u توليد الإجراءات صانع ألعاب محددة إلى البيانات الخاصة بك تصدير\n- تستمر المشهد تحميل: إذا تم، سيتم استخدام الخيار DoNotDestroy، وسوف قاعدة بيانات كائن لعبة البقاء على قيد الحياة الأحمال المشهد\n- وقف على عمود فارغ: إذا تم، سيكون أول عمود فارغ في جدول البيانات أن يكون العمود الأخير في البيانات التي تم تصديرها. وإلا يتم تخطي أعمدة فارغة ببساطة\n- الوقف في صف فارغ: إذا تم، سيكون أول صف فارغ في جدول البيانات أن يكون الصف الأخير في البيانات التي تم تصديرها. وإلا الصفوف الفارغة هي ببساطة تخطي.", "如果出口类型设置为对象数据库，这些选项才会显示。\n\n - 游戏对象数据库：在将被用于存储一次导出数据库中的场景的对象。如果为空，一个新的对象将被创建。\n - 生成中场组织者操作：如果选中，Google2u会产生特定的导出的数据组织核心行动\n - 坚持场景加载：如果选中，将使用DoNotDestroy选项，游戏对象数据库将生存景象的负载\n - 停止在空白栏：如果选中，在电子表格中的第一个空白列将在导出数据的最后一列。否则空白列只是跳过\n - 停止对空行：如果选中，在电子表格中的第一个空行会在导出数据的最后一行。否则，空行只是跳过。", "エクスポートタイプは、データベースのオブジェクトに設定されている場合、これらのオプションにのみ表示されます。\n\n - ゲームオブジェクトデータベース：一旦エクスポートされたデータベースを保存するために使用されるシーン内のオブジェクト。空白の場合は、新しいオブジェクトが作成される。\n - プレーメーカーアクションを生成します。チェックした場合、Google2uはあなたのエクスポートされたデータに固有の司令塔アクションを生成します\n - シーンの読み込みを永続化：チェックすると、DoNotDestroyオプションが使用され、ゲームオブジェクトデータベースは、シーンの負荷を存続します\n - 空欄のSTOP：チェックすると、スプレッドシートの最初の空白列は、エクスポートされたデータの最後の列になります。そうでない場合は空白の列は、単にスキップされます\n - 空白行に停止：チェックした場合、スプレッドシートの最初の空白行はエクスポートされたデータの最後の行になります。そうでない場合は空白の行は単にスキップされます。", "수출 유형이 데이터베이스 객체로 설정하면이 옵션은 표시됩니다.\n\n- 게임 오브젝트 데이터베이스 : 한 번 내 보낸 데이터베이스를 저장하는 데 사용되는 장면에서 객체입니다. 비어 있다면, 새로운 객체가 생성됩니다.\n- 플레이 메이커 작업 생성 : 선택하면, Google2u가 보낸 데이터에 특정 플레이 메이커 액션을 생성합니다\n선택하면, DoNotDestroy 옵션이 사용되며, 게임 오브젝트 데이터베이스는 장면 부하를 살아남을 것입니다 : - 장면로드를 지속\n- 빈 열을 중지 선택한 경우, 스프레드 시트의 첫 번째 빈 열이 보낸 데이터의 마지막 열 수 있습니다. 그렇지 않으면 빈 열은 단순히 건너 뜁니다\n- 빈 행에 중지 :이 옵션을 선택하는 경우, 스프레드 시트의 첫 번째 빈 행이 보낸 데이터의 마지막 행이 될 것입니다. 그렇지 않으면 빈 행은 단순히 건너 뜁니다.", "Các tùy chọn này chỉ được hiển thị nếu Type xuất khẩu được thiết lập để đối tượng cơ sở dữ liệu.\n\n- Game Object Database: Các đối tượng trong cảnh đó sẽ được sử dụng để lưu trữ các cơ sở dữ liệu một khi xuất khẩu. Nếu để trống, một đối tượng mới sẽ được tạo ra.\n- Tạo Playmaker Actions: Nếu được chọn, Google2u sẽ tạo Playmaker hành động cụ thể để xuất khẩu dữ liệu của bạn\n- Cố Cảnh tải: Nếu được chọn, tùy chọn DoNotDestroy sẽ được sử dụng, và các cơ sở dữ liệu đối tượng game sẽ sống sót tải cảnh\n- Dừng Ngày Blank Column: Nếu được chọn, các cột trống đầu tiên trong bảng tính sẽ là cột cuối cùng trong dữ liệu xuất khẩu. Nếu không cột trống chỉ đơn giản là bỏ qua\n- Dừng Ngày Blank Row: Nếu được chọn, các dòng trống đầu tiên trong bảng tính sẽ là dòng cuối cùng trong các dữ liệu xuất khẩu. Nếu hàng trống chỉ đơn giản là bỏ qua.", "Эти параметры отображаются только если тип экспорта установлен на объект базы данных.\n\n- База данных игровых объектов: объект в сцене, которая будет использоваться для хранения базы данных После экспорта. Если оставить поле пустым, новый объект будет создан.\n- Создание плеймейкер действия: Если отмечено, Google2u будет генерировать плеймейкер действия, характерные для экспортируемых данных\n- Упорство сцены Загрузка: Если установлен флажок, опция DoNotDestroy будет использоваться, и база данных игровых объектов выживет грузы сцены\n- Остановка на пустой столбец: Если установлен флажок, сначала пустой столбец в таблице будет последней колонке в экспортированных данных. В противном случае пустые столбцы просто перескакивает\n- Остановка на пустую строку: Если установлен флажок, сначала пустая строка в таблице будет последней строке экспортируемых данных. В противном случае пустые строки просто пропускается.", "Deze opties worden alleen weergegeven als de Export Type is ingesteld op Database object.\n\n- Spel Object Database: Het object in de scène die wordt gebruikt om de database eenmaal uitgevoerd slaan. Wanneer leeg, zal een nieuw object aangemaakt worden.\n- Genereer Playmaker Acties: Indien aangevinkt, zal Google2u spelmaker acties specifiek voor uw geëxporteerde gegevens te genereren\n- Aanhouden Scene Laden: Indien aangevinkt, zal de optie DoNotDestroy worden gebruikt, en de Game Object database scene ladingen overleven\n- Stop op blanco Column: Indien aangevinkt, zal de eerste lege kolom in de spreadsheet de laatste kolom in de geëxporteerde gegevens. Anders lege kolommen worden gewoon overgeslagen\n- Stop op blanco Rij: Indien aangevinkt, zal de eerste lege rij in de spreadsheet de laatste rij in de geëxporteerde gegevens. Anders lege rijen zijn gewoon overgeslagen."));
			Rows.Add( new DocumentationRow("ID_HEADER_OPTIONS_STATICDB", "Static Object Database Options", "Objet statique Options de base", "Opzioni database oggetto statico", "Statische Objektdatenbankoptionen", "Objeto estático Opciones de base", "خيارات قاعدة البيانات كائن ثابت", "静态对象数据库选项", "静的オブジェクトデータベースオプション", "정적 객체 데이터베이스 옵션", "Object tĩnh Cơ sở dữ liệu tùy chọn", "Статический объект Параметры базы данных", "Statische Object Database Opties"));
