			Rows.Add( new DocumentationRow("ID_HELP_OPTIONS_CSV", "These options are only shown if the Export Type is set to CSV.\n\n- Convert Quotes: If checked, double quotes will be escaped with a backslash character\n- Stop On Blank Column: If checked, the first blank column in the spreadsheet will be the final column in the exported data. Otherwise blank columns are simply skipped\n- Stop On Blank Row: If checked, the first blank row in the spreadsheet will be the final row in the exported data. Otherwise blank rows are simply skipped.", "Ces options ne sont affichés que si le type d'exportation est réglé au format CSV.\n\n- Convertir Citations: Si coché, guillemets seront échappés avec une barre oblique inverse\n- Arrêt sur colonne vide: Si elle est cochée, la première colonne vide dans la feuille de calcul sera la dernière colonne dans les données exportées. Sinon colonnes vides sont simplement ignorés\n- Arrêt sur ligne vide: Si elle est cochée, la première ligne vide dans le tableur sera la dernière rangée dans les données exportées. Sinon lignes vides sont tout simplement ignorée.", "Queste opzioni vengono visualizzati solo se il tipo di esportazione è impostato CSV.\n\n- Convertire Citazioni: Se selezionato, le doppie virgolette saranno scappati con un carattere backslash\n- Stop On colonna vuota: Se selezionato, la prima colonna vuota nel foglio di calcolo sarà l'ultima colonna nei dati esportati. In caso contrario, le colonne vuote vengono semplicemente ignorati\n- Stop On riga vuota: Se selezionato, la prima riga vuota nel foglio di calcolo sarà l'ultima fila nei dati esportati. In caso contrario, le righe vuote sono semplicemente ignorati.", "Diese Optionen werden nur angezeigt, wenn der Export in das CSV-Typ eingestellt ist.\n\n- Konvertieren Zitate: Wenn aktiviert, doppelte Anführungszeichen mit einem Backslash maskiert werden\n- Stop auf leere Spalte: Wenn aktiviert, wird die erste leere Spalte in der Tabelle der letzten Spalte in den exportierten Daten sein. Ansonsten leere Spalten werden einfach übersprungen\n- Stop auf leere Reihe: Wenn aktiviert, wird die erste leere Zeile in der Tabelle die letzte Zeile in der exportierten Daten ist. Ansonsten leere Zeilen sind einfach übersprungen.", "Estas opciones sólo aparecen si el tipo de exportación se establece en CSV.\n\n- Convertir Cotizaciones: Si se selecciona, las comillas dobles se escaparon con una barra invertida\n- Detener en la columna en blanco: Si se marca, la primera columna en blanco en la hoja de cálculo será la última columna de los datos exportados. De lo contrario columnas en blanco son simplemente omiten\n- Detener en fila en blanco: Si se marca, la primera fila en blanco en la hoja de cálculo será la última fila en los datos exportados. De lo contrario filas en blanco son simplemente omite.", "وتظهر هذه الخيارات فقط إذا تم تعيين نوع تصدير إلى CSV.\n\n- تحويل الاقتباسات: إذا تم، سيكون أن هرب علامات الاقتباس المزدوجة مع حرف مائل\n- وقف على عمود فارغ: إذا تم، سيكون أول عمود فارغ في جدول البيانات أن يكون العمود الأخير في البيانات التي تم تصديرها. وإلا يتم تخطي أعمدة فارغة ببساطة\n- الوقف في صف فارغ: إذا تم، سيكون أول صف فارغ في جدول البيانات أن يكون الصف الأخير في البيانات التي تم تصديرها. وإلا الصفوف الفارغة هي ببساطة تخطي.", "如果出口类型设置为CSV这些选项才会显示。\n\n - 转换行情：如果选中，双引号将用反斜杠字符转义\n - 停止在空白栏：如果选中，在电子表格中的第一个空白列将在导出数据的最后一列。否则空白列只是跳过\n - 停止对空行：如果选中，在电子表格中的第一个空行会在导出数据的最后一行。否则，空行只是跳过。", "輸出型がCSV形式に設定されている場合、これらのオプションにのみ表示されます。\n\n - 引用を変換する：チェックした場合、二重引用符はバックスラッシュ文字でエスケープされます\n - 空欄のSTOP：チェックすると、スプレッドシートの最初の空白列は、エクスポートされたデータの最後の列になります。そうでない場合は空白の列は、単にスキップされます\n - 空白行に停止：チェックした場合、スプレッドシートの最初の空白行はエクスポートされたデータの最後の行になります。そうでない場合は空白の行は単にスキップされます。", "내보내기 유형이 CSV로 설정되어있는 경우 이러한 옵션은 표시됩니다.\n\n- 지수 변환 : 선택하면, 큰 따옴표는 백 슬래시 문자로 이스케이프됩니다\n- 빈 열을 중지 선택한 경우, 스프레드 시트의 첫 번째 빈 열이 보낸 데이터의 마지막 열 수 있습니다. 그렇지 않으면 빈 열은 단순히 건너 뜁니다\n- 빈 행에 중지 :이 옵션을 선택하는 경우, 스프레드 시트의 첫 번째 빈 행이 보낸 데이터의 마지막 행이 될 것입니다. 그렇지 않으면 빈 행은 단순히 건너 뜁니다.", "Các tùy chọn này chỉ được hiển thị nếu Type xuất khẩu được thiết lập để CSV.\n\n- Chuyển đổi Quotes: Nếu được chọn, dấu ngoặc kép sẽ được thoát ra bằng một nhân vật dấu chéo ngược\n- Dừng Ngày Blank Column: Nếu được chọn, các cột trống đầu tiên trong bảng tính sẽ là cột cuối cùng trong dữ liệu xuất khẩu. Nếu không cột trống chỉ đơn giản là bỏ qua\n- Dừng Ngày Blank Row: Nếu được chọn, các dòng trống đầu tiên trong bảng tính sẽ là dòng cuối cùng trong các dữ liệu xuất khẩu. Nếu hàng trống chỉ đơn giản là bỏ qua.", "Эти параметры отображаются только если экспорт Тип установлен на CSV.\n\n- Преобразование Цитаты: Если отмечено, двойные кавычки будут экранированы с обратной косой черты\n- Остановка на пустой столбец: Если установлен флажок, сначала пустой столбец в таблице будет последней колонке в экспортированных данных. В противном случае пустые столбцы просто перескакивает\n- Остановка на пустую строку: Если установлен флажок, сначала пустая строка в таблице будет последней строке экспортируемых данных. В противном случае пустые строки просто пропускается.", "Deze opties worden alleen weergegeven als de Export Type is ingesteld op CSV.\n\n- Zet Quotes: Indien aangevinkt, dubbele aanhalingstekens worden met een backslash karakter\n- Stop op blanco Column: Indien aangevinkt, zal de eerste lege kolom in de spreadsheet de laatste kolom in de geëxporteerde gegevens. Anders lege kolommen worden gewoon overgeslagen\n- Stop op blanco Rij: Indien aangevinkt, zal de eerste lege rij in de spreadsheet de laatste rij in de geëxporteerde gegevens. Anders lege rijen zijn gewoon overgeslagen."));
