			Rows.Add( new DocumentationRow("ID_HELP_OPTIONS_XML", "These options are only shown if the Export Type is set to XML.\n\n- Convert Cell Array to String: If checked, Cells marked as arrays will be treated as one string. Otherwise the data will become children of the cell node.\n- Stop On Blank Column: If checked, the first blank column in the spreadsheet will be the final column in the exported data. Otherwise blank columns are simply skipped\n- Stop On Blank Row: If checked, the first blank row in the spreadsheet will be the final row in the exported data. Otherwise blank rows are simply skipped.", "Ces options ne sont affichés que si le type d'exportation est réglé sur XML.\n\n- Convertir réseau de cellules à cordes: Si elle est cochée, les cellules marquées tableaux seront traitées comme une seule chaîne. Sinon, les données seront enfants du noeud de cellules.\n- Arrêt sur colonne vide: Si elle est cochée, la première colonne vide dans la feuille de calcul sera la dernière colonne dans les données exportées. Sinon colonnes vides sont simplement ignorés\n- Arrêt sur ligne vide: Si elle est cochée, la première ligne vide dans le tableur sera la dernière rangée dans les données exportées. Sinon lignes vides sont tout simplement ignorée.", "Queste opzioni vengono visualizzati solo se il tipo di esportazione è impostato su XML.\n\n- Convertire Array cella a stringa: Se selezionato, Celle contrassegnate come array saranno trattati come una stringa. In caso contrario, i dati diventeranno figli del nodo di cellule.\n- Stop On colonna vuota: Se selezionato, la prima colonna vuota nel foglio di calcolo sarà l'ultima colonna nei dati esportati. In caso contrario, le colonne vuote vengono semplicemente ignorati\n- Stop On riga vuota: Se selezionato, la prima riga vuota nel foglio di calcolo sarà l'ultima fila nei dati esportati. In caso contrario, le righe vuote sono semplicemente ignorati.", "Diese Optionen werden nur angezeigt, wenn die Exporttyp auf XML gesetzt.\n\n- Konvertieren Zell Array in String: Wenn aktiviert, markiert Cells als Arrays werden als ein String behandelt werden. Ansonsten werden die Daten zu Kindern des Zellknoten.\n- Stop auf leere Spalte: Wenn aktiviert, wird die erste leere Spalte in der Tabelle der letzten Spalte in den exportierten Daten sein. Ansonsten leere Spalten werden einfach übersprungen\n- Stop auf leere Reihe: Wenn aktiviert, wird die erste leere Zeile in der Tabelle die letzte Zeile in der exportierten Daten ist. Ansonsten leere Zeilen sind einfach übersprungen.", "Estas opciones sólo aparecen si el tipo de exportación se establece en XML.\n\n- Convertir matriz celular para cuerdas: Si se selecciona, las células marcadas como matrices serán tratados como una cadena. De lo contrario, los datos serán hijos del nodo móvil.\n- Detener en la columna en blanco: Si se marca, la primera columna en blanco en la hoja de cálculo será la última columna de los datos exportados. De lo contrario columnas en blanco son simplemente omiten\n- Detener en fila en blanco: Si se marca, la primera fila en blanco en la hoja de cálculo será la última fila en los datos exportados. De lo contrario filas en blanco son simplemente omite.", "وتظهر هذه الخيارات فقط إذا تم تعيين نوع التصدير إلى XML.\n\n- تحويل صفيف خلية لسلسلة: إذا تم، تميزت الخلايا كما سيتم التعامل مع المصفوفات كسلسلة واحدة. وإلا سوف تصبح البيانات الأطفال من عقدة الخلية.\n- وقف على عمود فارغ: إذا تم، سيكون أول عمود فارغ في جدول البيانات أن يكون العمود الأخير في البيانات التي تم تصديرها. وإلا يتم تخطي أعمدة فارغة ببساطة\n- الوقف في صف فارغ: إذا تم، سيكون أول صف فارغ في جدول البيانات أن يكون الصف الأخير في البيانات التي تم تصديرها. وإلا الصفوف الفارغة هي ببساطة تخطي.", "如果出口类型设置为XML这些选项才会显示。\n\n - 转换电池阵列字符串：如果选中，细胞标记为阵列将被视为一个字符串。否则数据将成为小区节点的孩子。\n - 停止在空白栏：如果选中，在电子表格中的第一个空白列将在导出数据的最后一列。否则空白列只是跳过\n - 停止对空行：如果选中，在电子表格中的第一个空行会在导出数据的最后一行。否则，空行只是跳过。", "エクスポートのタイプがXMLに設定されている場合、これらのオプションにのみ表示されます。\n\n - 文字列にセル配列に変換します。チェックした場合、配列としてマークされた細胞は、1文字列として扱われます。そうでなければデータは、セル