			Rows.Add( new DocumentationRow("ID_HELP_OPTIONS_JSON", "These options are only shown if the Export Type is set to JSON.\n\n- Escape Unicode Strings: If checked, unicode characters will be converted to their escaped ascii counterparts. This may dramatically increase the size of the JSON output, but maximizes compatibility.\n- Convert Cell Array to String: If checked, cell arrays will be treated simply as a string. It will be up to you to parse the data after reading it back in.\n- Export Generated Class: Google2u is able to generate a class that matches the exported JSON data perfectly. Use this option to enable the export as a *.cs file\n- JSON Export Type:\n      Array: Data is represented as an Array\n      Object: Data is wrapped into a single JSON object\n- Stop On Blank Column: If checked, the first blank column in the spreadsheet will be the final column in the exported data. Otherwise blank columns are simply skipped\n- Stop On Blank Row: If checked, the first blank row in the spreadsheet will be the final row in the exported data. Otherwise blank rows are simply skipped.", "Ces options ne sont affichés que si le type d'exportation est réglé sur JSON.\n\n- Escape Unicode Strings: Si elle est cochée, les caractères Unicode seront convertis à leurs homologues échappé ascii. Cela peut augmenter considérablement la taille de la sortie JSON, mais maximise la compatibilité.\n- Convertir réseau de cellules à cordes: Si coché, réseaux de cellules seront traitées simplement comme une chaîne. Ce sera à vous d'analyser les données après l'avoir lu avant.\n- Export Généré Classe: Google2u est capable de générer une classe qui correspond parfaitement les données JSON exportés. Utilisez cette option pour activer l'exportation que le dossier d'un *\n- JSON type d'exportation:\n      Tableau: données est représentée par un tableau\n      Objet: Données est enveloppé en un seul objet JSON\n- Arrêt sur colonne vide: Si elle est cochée, la première colonne vide dans la feuille de calcul sera la dernière colonne dans les données exportées. Sinon colonnes vides sont simplement ignorés\n- Arrêt sur ligne vide: Si elle est cochée, la première ligne vide dans le tableur sera la dernière rangée dans les données exportées. Sinon lignes vides sont tout simplement ignorée.", "Queste opzioni vengono visualizzati solo se il tipo di esportazione è impostato JSON.\n\n- Escape Stringhe Unicode: Se selezionato, i caratteri Unicode vengono convertiti alle loro controparti ASCII con escape. Questo può aumentare notevolmente le dimensioni dell'uscita JSON, ma massimizza la compatibilità.\n- Convertire Array cella a stringa: Se selezionato, array di celle saranno trattati semplicemente come una stringa. Sarà a voi per analizzare i dati dopo la lettura di nuovo.\n- Esportazione generata Classe: Google2u è in grado di generare una classe che corrisponde ai dati JSON esportati perfettamente. Utilizzare questa opzione per consentire l'esportazione come un file * cs\n- JSON Export Type:\n      Array: i dati è rappresentato come un array\n      Oggetto: I dati è avvolto in un unico oggetto JSON\n- Stop On colonna vuota: Se selezionato, la prima colonna vuota nel foglio di calcolo sarà l'ultima colonna nei dati esportati. In caso contrario, le colonne vuote vengono semplicemente ignorati\n- Stop On riga vuota: Se selezionato, la prima riga vuota nel foglio di calcolo sarà l'ultima fila nei dati esportati. In caso contrario, le righe vuote sono semplicemente ignorati.", "Diese Optionen werden nur angezeigt, wenn die Exporttyp JSON eingestellt.\n\n- Escape Unicode Strings: Wenn aktiviert, werden Unicode-Zeichen, um ihre ASCII-Escape-Gegenstücke umgewandelt werden. Dies kann drastisch erhöhen die Größe des JSON-Ausgabe, aber maximiert Kompatibilität.\n- Konvertieren Zell Array in String: Wenn aktiviert, werden Zellen-Arrays einfach als String behandelt werden. Es wird bis zu Ihnen, um die Daten nach dem Lesen wieder in parsen.\n- Export generierte Klasse: Google2u der Lage ist, eine Klasse, die die exportierten JSON-Daten passt perfekt zu generieren. Verwenden Sie diese Option, um den Export als * CS-Datei ermöglichen\n- JSON Export-Typ:\n      Array: Die Daten werden als Array vertreten\n      Objekt: Die Daten werden in einem einzigen JSON-Objekt gewickelt\n- Stop auf leere Spalte: Wenn aktiviert, wird die erste leere Spalte in der Tabelle der letzten Spalte in den exportierten Daten sein. Ansonsten leere Spalten werden einfach übersprungen\n- Stop auf leere Reihe: Wenn aktiviert, wird die erste leere Zeile in der Tabelle die letzte Zeile in der exportierten Daten ist. Ansonsten leere Zeilen sind einfach übersprungen.", "Estas opciones sólo aparecen si el tipo de exportación se establece en JSON.\n\n- Escape Unicode Cuerdas: Si se marca, los caracteres Unicode se convertirán a sus homólogos de escape ASCII. Esto puede aumentar drásticamente el tamaño de la salida de JSON, pero maximiza la compatibilidad.\n- Convertir matriz celular para cuerdas: Si se selecciona, las matrices celulares serán tratados simplemente como una cadena. Será a usted para analizar los datos después de leer de nuevo.\n- Exportación generado Clase: Google2u es capaz de generar una clase que coincide con los datos JSON exportados perfectamente. Utilice esta opción para habilitar la exportación como archivo a * .cs\n- JSON Tipo de exportación:\n      Matriz: Los datos se representa como una matriz\n      Objeto: Los datos se envuelve en un único objeto JSON\n- Detener en la columna en blanco: Si se marca, la primera columna en blanco en la hoja de cálculo será la última columna de los datos exportados. De lo contrario columnas en blanco son simplemente omiten\n- Detener en fila en blanco: Si se marca, la primera fila en blanco en la hoja de cálculo será la última fila en los datos exportados. De lo contrario filas en blanco son simplemente omite.", "وتظهر هذه الخيارات فقط إذا تم تعيين نوع التصدير إلى JSON.\n\n- الهروب يونيكود سلاسل: إذا تم، سيتم تحويل أحرف Unicode إلى نظرائهم أسكي هرب بهم. هذا قد يزيد بشكل كبير من حجم الناتج JSON، ولكن يزيد التوافق.\n- تحويل صفيف خلية لسلسلة: إذا تم، سيتم التعامل مع المصفوفات خلية ببساطة كسلسلة. وسيكون متروك لكم لتحليل البيانات بعد القراءة مرة أخرى.\n- تصدير ولدت الدرجة: Google2u قادر على إنشاء فئة يطابق البيانات JSON تصديرها تماما. استخدم هذا الخيار لتمكين التصدير باعتباره * .cs ملف\n- JSON نوع التصدير:\n      ويمثل البيانات كما صفيف: مجموعة\n      يتم تغليف البيانات إلى كائن JSON واحد: وجوه\n- وقف على عمود فارغ: إذا تم، سيكون أول عمود فارغ في جدول البيانات أن يكون العمود الأخير في البيانات التي تم تصديرها. وإلا يتم تخطي أعمدة فارغة ببساطة\n- الوقف في صف فارغ: إذا تم، سيكون أول صف فارغ في جدول البيانات أن يكون الصف الأخير في البيانات التي تم تصديرها. وإلا الصفوف الفارغة هي ببساطة تخطي.", "如果出口类型设置为JSON这些选项才会显示。\n\n - 逃生的Unicode字符串：如果选中，Unicode字符将被转换为自己逃脱的ASCII同行。这可显着增加的JSON输出的大小，但最大化的兼容性。\n - 转换电池阵列字符串：如果选中，电池阵列将被简单地视为一个字符串。这将是由你看完回来后分析数据。\n - 导出生成的类：Google2u能够生成一个类，完全符合出口JSON数据。使用此选项可启用导出为* cs文件\n -  JSON导出类型：\n      数组：数据被表示为数组\n      对象：数据被包裹成一个JSON对象\n - 停止在空白栏：如果选中，在电子表格中的第一个空白列将在导出数据的最后一列。否则空白列只是跳过\n - 停止对空行：如果选中，在电子表格中的第一个空行会在导出数据的最后一行。否则，空行只是跳过。", "エクスポートのタイプがJSONに設定されている場合、これらのオプションにのみ表示されます。\n\n -  Unicodeの文字列をエスケープ：チェックすると、Unicode文字がそのASCIIエスケープの対応に変換されます。これは劇的にJSON出力のサイズを大きくするが、互換性を最大化することがあります。\n - 文字列にセル配列に変換します。チェックすると、セル·アレイは、単純に文字列として扱われます。それは、それをバック読んだ後のデータを解析するのはあなた次第となります。\n - エクスポートクラス生成：Google2uは完全にエクスポートされたJSONデータと一致するクラスを生成することができる。 * .csファイルファイルとしてエクスポートを有効にするには、このオプションを使用します\n -  JSON輸出の種類：\n      配列：データが配列として表現さ​​れ\n      オブジェクト：データは1つのJSONオブジェクトにラップされている\n - 空欄のSTOP：チェックすると、スプレッドシートの最初の空白列は、エクスポートされたデータの最後の列になります。そうでない場合は空白の列は、単にスキップされます\n - 空白行に停止：チェックした場合、スプレッドシートの最初の空白行はエクスポートされたデータの最後の行になります。そうでない場合は空白の行は単にスキップされます。", "내보내기 유형이 JSON로 설정되어있는 경우이 옵션 만 표시됩니다.\n\n- 유니 코드 문자열을 탈출 : 선택하면, 유니 코드 문자가 탈출 아스키 대응으로 변환됩니다. 이것은 극적 JSON 출력의 크기를 증가 시키지만 호환성을 극대화 할 수있다.\n- 문자열에 셀 배열로 변환 : 선택하면, 셀 어레이는 문자열로 간단하게 처리됩니다. 그것은 그것을 다시 읽은 후 데이터를 구문 분석하는 당신에게 달려있을 것입니다.\n- 수출 클래스 생성 : Google2u 완벽 보낸 JSON 데이터와 일치하는 클래스를 생성 할 수 있습니다. * .cs 파일로 내보내기 기능을 사용하려면이 옵션을 사용하여\n- JSON 내보내기 유형 :\n      배열 : 데이터 배열로 표현된다\n      대상 : 데이터는 하나의 JSON 객체로 래핑\n- 빈 열을 중지 선택한 경우, 스프레드 시트의 첫 번째 빈 열이 보낸 데이터의 마지막 열 수 있습니다. 그렇지 않으면 빈 열은 단순히 건너 뜁니다\n- 빈 행에 중지 :이 옵션을 선택하는 경우, 스프레드 시트의 첫 번째 빈 행이 보낸 데이터의 마지막 행이 될 것입니다. 그렇지 않으면 빈 행은 단순히 건너 뜁니다.", "Các tùy chọn này chỉ được hiển thị nếu Type xuất khẩu được thiết lập để JSON.\n\n- Thoát Unicode Strings: Nếu được chọn, ký tự unicode sẽ được chuyển đổi sang các đối tác ascii trốn thoát của họ. Điều này có thể làm tăng đáng kể kích thước của đầu ra JSON, nhưng tối đa hóa khả năng tương thích.\n- Chuyển đổi di Array để String: Nếu được chọn, mảng di động sẽ được điều trị chỉ đơn giản như là một chuỗi. Nó sẽ được vào bạn để phân tích các dữ liệu sau khi đọc nó trở lại.\n- Xuất Tạo Class: Google2u có thể tạo ra một lớp học phù hợp với dữ liệu JSON xuất khẩu hoàn toàn. Sử dụng tùy chọn này để cho phép xuất khẩu như là một tập tin * .cs\n- JSON Loại khẩu:\n      Array: Dữ liệu được biểu diễn như là một mảng\n      Object: Dữ liệu được gói vào một đối tượng JSON đơn\n- Dừng Ngày Blank Column: Nếu được chọn, các cột trống đầu tiên trong bảng tính sẽ là cột cuối cùng trong dữ liệu xuất khẩu. Nếu không cột trống chỉ đơn giản là bỏ qua\n- Dừng Ngày Blank Row: Nếu được chọn, các dòng trống đầu tiên trong bảng tính sẽ là dòng cuối cùng trong các dữ liệu xuất khẩu. Nếu hàng trống chỉ đơn giản là bỏ qua.", "Эти параметры отображаются только если экспорт Тип установлен на JSON.\n\n- Побег строк Unicode: Если установлен флажок, Unicode символы будут преобразованы в их сбежавших ASCII коллегами. Это может значительно увеличить размер выходного JSON, но увеличивает совместимость.\n- Преобразование ячеек массива в строку: Если установлен флажок, сотовые массивы будет рассматриваться просто как строку. Это будет до вас, чтобы разобрать данные после прочтения его обратно.\n- Экспорт созданного класса: Google2u способен генерировать класс, который соответствует экспортированные данные в формате JSON отлично. Используйте эту опцию для экспорта, как * .cs файле\n- JSON Экспорт Тип:\n      Массив: Данные представлены в виде массива\n      Объект: Данные, завернутый в единый объект JSON\n- Остановка на пустой столбец: Если установлен флажок, сначала пустой столбец в таблице будет последней колонке в экспортированных данных. В противном случае пустые столбцы просто перескакивает\n- Остановка на пустую строку: Если установлен флажок, сначала пустая строка в таблице будет последней строке экспортируемых данных. В противном случае пустые строки просто пропускается.", "Deze opties worden alleen weergegeven als de Export Type is ingesteld op JSON.\n\n- Escape Unicode Strings: Indien aangevinkt, zal unicode tekens worden omgezet in hun ontsnapte ascii tegenhangers. Dit kan aanzienlijk de grootte van de JSON output, maar maximaliseert compatibiliteit.\n- Zet Cell Array naar String: Indien aangevinkt, zal de cel arrays eenvoudig worden behandeld als een string. Het is aan u om de gegevens te analyseren na het lezen van het terug in.\n- Export Vernieuwd Klasse: Google2u is in staat om een ​​klasse die overeenkomt met de geëxporteerde JSON data perfect te genereren. Gebruik deze optie om de export als een * .cs bestand staat\n- JSON Export Type:\n      Array: Gegevens worden weergegeven als een array\n      Object: Data wordt verpakt in een enkel JSON object\n- Stop op blanco Column: Indien aangevinkt, zal de eerste lege kolom in de spreadsheet de laatste kolom in de geëxporteerde gegevens. Anders lege kolommen worden gewoon overgeslagen\n- Stop op blanco Rij: Indien aangevinkt, zal de eerste lege rij in de spreadsheet de laatste rij in de geëxporteerde gegevens. Anders lege rijen zijn gewoon overgeslagen."));
