			Rows.Add( new DocumentationRow("ID_HELP_PREVIEW_JSONOBJECT", "This will generate a preview of the exported JSON file.\n\nNote: Large databases may not fit entirely in the preview.", "Cela va générer un aperçu du fichier JSON exporté.\n\nNote: Les grosses bases de données peuvent ne pas tenir entièrement dans l'aperçu.", "Questo genererà una preview del file JSON esportato.\n\nNota: i database di grandi dimensioni non possono andare bene tutto in anteprima.", "Dies wird eine Vorschau der exportierten JSON-Datei zu generieren.\n\nHinweis: Große Datenbanken können nicht ganz fit in der Vorschau.", "Esto generará una vista previa del archivo JSON exportado.\n\nNota: Las grandes bases de datos pueden no encajar del todo en la vista previa.", "هذا وسوف تولد معاينة للملف JSON تصديرها.\n\nملاحظة: قواعد البيانات الكبيرة قد لا تناسب تماما في المعاينة.", "这将生成导出的JSON文件的预览。\n\n注：大型数据库可能无法在预览完全契合。", "これは、エクスポートされたJSONファイルのプレビューを生成します。\n\n注：大規模なデータベースがプレビューに完全に適合しない場合があります。", "이 보낸 JSON 파일의 미리보기를 생성합니다.\n\n참고 : 큰 데이터베이스가 미리보기에 완전히 적합하지 않을 수 있습니다.", "Điều này sẽ tạo ra một bản xem trước của tập tin JSON xuất khẩu.\n\nLưu ý: cơ sở dữ liệu lớn có thể không phù hợp hoàn toàn trong bản xem trước.", "Это создаст предварительный просмотр экспортированного файла JSON.\n\nПримечание: Большие базы данных может не уместиться полностью в окне предварительного просмотра.", "Dit zal een preview van de geëxporteerde JSON-bestand te genereren.\n\nOpmerking: Grote databases kan niet helemaal passen in de preview."));
