			Rows.Add( new DocumentationRow("ID_HELP_PREVIEW_JSONCLASS", "This will generate a preview of the exported JSON Class.\n\nNote: Large databases may not fit entirely in the preview.", "Cela va générer un aperçu de la classe JSON exporté.\n\nNote: Les grosses bases de données peuvent ne pas tenir entièrement dans l'aperçu.", "Questo genererà una preview della esportato classe JSON.\n\nNota: i database di grandi dimensioni non possono andare bene tutto in anteprima.", "Dies wird eine Vorschau der exportierten JSON-Klasse zu generieren.\n\nHinweis: Große Datenbanken können nicht ganz fit in der Vorschau.", "Esto generará una vista previa del exportados Clase JSON.\n\nNota: Las grandes bases de datos pueden no encajar del todo en la vista previa.", "هذا وسوف تولد معاينة للJSON الدرجة تصديرها.\n\nملاحظة: قواعد البيانات الكبيرة قد لا تناسب تماما في المعاينة.", "这将生成导出的JSON类的预览。\n\n注：大型数据库可能无法在预览完全契合。", "これは、エクスポートされたJSONクラスのプレビューを生成します。\n\n注：大規模なデータベースがプレビューに完全に適合しない場合があります。", "이 보낸 JSON 클래스의 미리보기를 생성합니다.\n\n참고 : 큰 데이터베이스가 미리보기에 완전히 적합하지 않을 수 있습니다.", "Điều này sẽ tạo ra một bản xem trước của xuất khẩu JSON Class.\n\nLưu ý: cơ sở dữ liệu lớn có thể không phù hợp hoàn toàn trong bản xem trước.", "Это создаст предварительный просмотр экспортируемого JSON-класса.\n\nПримечание: Большие базы данных может не уместиться полностью в окне предварительного просмотра.", "Dit zal een preview van de geëxporteerde JSON klasse te genereren.\n\nOpmerking: Grote databases kan niet helemaal passen in de preview."));
			Rows.Add( new DocumentationRow("ID_FADE_EDITINGWORKSHEETS", "Editing Worksheets", "Édition Feuilles", "Editing Fogli di lavoro", "Bearbeiten von Arbeitsblättern", "Edición de hojas de cálculo", "تحرير أوراق العمل", "编辑工作表", "編集ワークシート", "편집 워크 시트", "Editing Worksheets", "Редактирование Рабочие", "Editing Werkbladen"));
			Rows.Add( new DocumentationRow("ID_HEADER_EDITINGWORKSHEETS", "Editing Worksheet Cells", "Cellules édition Feuille", "Cellule Modifica foglio di lavoro", "Bearbeiten von Arbeitsblattzellen", "Las células Edición Hoja", "خلايا ورقة العمل التحرير", "编辑工作表单元格", "ワークシートセルの編集", "편집 워크 시트 셀", "Cells chỉnh sửa Worksheet", "Редактирование ячеек рабочего листа", "Editing werkbladcellen"));
			Rows.Add( new DocumentationRow("ID_HELP_EDITINGWORKSHEETS", "Google2u allows basic editing of cells which will update the spreadsheet in Google Docs. To edit a cell, simply click on the cell you wish to modify and the contents will be shown in the edit bar above the sheet. If the cell is editable, you will be able to change the value and click the Update button to save the change.\n\nNote: If a cell contains a formula, it will be shown in the R1C1 format. This will be different from the cell in the Google Doc, which only accepts A1 format. Because of this, editing cells which contain formulas is not recommended in Google2u.", "Google2u permet l'édition de base des cellules qui mettra à jour la feuille de calcul dans Google Docs. Pour modifier une cellule, il suffit de cliquer sur la cellule que vous souhaitez modifier et le contenu seront affichés dans la barre d'édition en haut de la feuille. Si la cellule est modifiable, vous serez en mesure de changer la valeur et cliquez sur le bouton Mettre à jour pour enregistrer les modifications.\n\nRemarque: Si une cellule contient une formule, il sera affiché dans le format R1C1. Ce sera différente de la cellule dans le Google Doc, qui ne accepte que le format A1. Pour cette raison, les cellules qui contiennent des formules d'édition ne est pas recommandé dans Google2u.", "Google2u permette l'editing di base delle cellule che aggiornare il foglio di calcolo in Google Docs. Per modificare una cella, è sufficiente fare clic sulla cella che si desidera modificare e i contenuti verranno visualizzati nella barra di modifica sopra il foglio. Se la cella è modificabile, si sarà in grado di modificare il valore e fare clic sul pulsante Aggiorna per salvare la modifica.\n\nNota: Se una cella contiene una formula, sarà mostrato nel formato R1C1. Questo sarà diverso dalla cella in Google Doc, che accetta solo il formato A1. A causa di questo, modifica le celle che contengono formule non è raccomandato in Google2u.", "Google2u ermöglicht grundlegende Bearbeitungsfunktionen von Zellen, die die Tabelle in Google Text & Tabellen aktualisieren. Um eine Zelle zu bearbeiten, klicken Sie einfach auf die Zelle, die Sie ändern wollen, und der Inhalt wird in der Bearbeitungsleiste über der ausgewiesenen werden. Wenn die Zelle editierbar ist, werden Sie in der Lage, den Wert zu ändern, und klicken Sie auf die Schaltfläche Aktualisieren, um die Änderung zu speichern.\n\nHinweis: Wenn eine Zelle eine Formel enthält, wird es in der R1C1-Format angezeigt. Diese unterscheidet sich von der Zelle in dem Google Doc, die nur akzeptiert A1-Format sein. Aus diesem Grund, ist die Bearbeitung Zellen, die Formeln enthalten in Google2u empfohlen.", "Google2u permite una edición básica de las células que actualizar la hoja de cálculo en Google Docs. Para editar una celda, simplemente haga clic en la celda que desea modificar y los contenidos se muestran en la barra de edición situada encima de la hoja. Si la celda es editable, usted será capaz de cambiar el valor y haga clic en el botón Actualizar para guardar los cambios.\n\nNota: Si una celda contiene una fórmula, que se mostrará en el formato R1C1. Esto será diferente de la célula en el Google Doc, que sólo acepta el formato A1. Debido a esto, las células de edición que contienen fórmulas no se recomienda en Google2u.", "Google2u يسمح التحرير الأساسية للخلايا التي سيتم تحديث جدول البيانات في محرر مستندات Google. لتعديل خلية، ببساطة انقر على الخلية التي ترغب في تعديلها وسوف يتم عرض المحتويات في شريط تحرير فوق ورقة. إذا كانت الخلية هي قابلة للتحرير، سوف تكون قادرا على تغيير قيمة وانقر على زر Update لحفظ التغيير.\n\nملاحظة: إذا خلية تحتوي على الصيغة، وسوف يعرض في تنسيق R1C1. هذا وسوف تكون مختلفة من الخلية في جوجل الوثيقة، التي لا يقبل إلا شكل A1. وبسبب هذا، فمن غير المستحسن تحرير الخلايا التي تحتوي على الصيغ في Google2u.", "Google2u使得细胞更新将在谷歌文档电子表格的基本编辑。编辑一个单元格，只需点击要修改的单元格，其内容将在表上方编辑栏显示。如果单元格是可编辑的，你就可以改变数值，点击更新按钮保存更改。\n\n注意：如果单元格中包含公式，它会在R1C1格式显示。这将是从细胞中谷歌文档，只接受A1格式不同。因为这一点，它含有式编辑的细胞，不建议在Google2u。", "Google2uはGoogleドキュメントでスプレッドシートを更新し、細胞の基本的な編集を可能にする。セルを編集するには、単にあなたが変更したいセルをクリックして内容物をシートの上の編集バーに表示されます。セルが編集可能な場合は、値を変更し、変更を保存するには、[更新]ボタンをクリックすることができます。\n\n注：セルが数式を含む場合には、R1C1形式で表示される。これは、A1形式を受け入れGoogleドキュメント内のセルとは異なるであろう。このため、数式を含むセルを編集することはGoogle2uで推奨されていません。", "Google2u 구글 문서 도구 스프레드 시트를 업데이트합니다 세포의 기본적인 편집을 할 수 있습니다. 셀을 편집하려면 수정하고자하는 셀을 클릭하고 내용이 시트 위의 편집 막대에 표시됩니다. 셀이 편집 가능한 경우, 당신은 값을 변경하고 변경 사항을 저장하려면 업데이트 버튼을 클릭 할 수있을 것입니다.\n\n참고 : 셀에 수식이 포함 된 경우, R1C1 형식으로 표시됩니다. 이것은 단지 A1 형식을 받아들이는 구글 닥에 셀과 다를 수 있습니다. 이것 때문에, 수식을 포함하는 편집 세포 Google2u에 사용하지 않는 것이 좋습니다.", "Google2u cho phép chỉnh sửa cơ bản của tế bào mà sẽ cập nhật các bảng tính trong Google Docs. Để chỉnh sửa một tế bào, chỉ cần nhấp chuột vào ô mà bạn muốn chỉnh sửa và nội dung sẽ được hiển thị trong thanh chỉnh sửa trên bảng. Nếu các tế bào có thể chỉnh sửa, bạn sẽ có thể thay đổi giá trị và nhấp vào nút Update để lưu các thay đổi.\n\nLưu ý: Nếu một ô chứa công thức, nó sẽ được hiển thị trong định dạng R1C1. Đây sẽ là khác nhau từ các tế bào trong Google Doc, mà chỉ chấp nhận định dạng A1. Bởi vì điều này, các tế bào có chứa công thức chỉnh sửa không được khuyến cáo trong Google2u.", "Google2u позволяет осуществлять базовое редактирование клеток, которые обновят таблицу в Google Docs. Чтобы изменить ячейку, просто нажмите на ячейку вы хотите изменить, и содержимое будет отображаться в строке редактирования над листом. Если ячейка редактируется, вы сможете изменить значение и нажмите кнопку Обновить, чтобы сохранить изменения.\n\nПримечание: Если ячейка содержит формулу, то он будет показан в формате R1C1. Это будет отличаться от ячейки в Google Doc, который принимает только формат А1. Из-за этого, редактирование клетки, которые содержат формулы не рекомендуется Google2u.", "Google2u maakt basisbewerkingen van cellen die de spreadsheet in Google Docs wordt bijgewerkt. Om een ​​cel te bewerken, klikt u op de cel die u wilt wijzigen en de inhoud zal in het bewerken balk boven het blad worden getoond. Als de cel bewerkbaar is, zult u in staat om de waarde te veranderen en klik op de knop Bijwerken om de wijziging op te slaan.\n\nOpmerking: Als een cel een formule, zal in de R1C1 formaat getoond. Dit verschilt van de cel in de Google-document, die alleen accepteert A1 formaat. Vanwege dit, is het bewerken van cellen die formules bevatten niet aanbevolen bij Google2u."));
			Rows.Add( new DocumentationRow("ID_HEADER_EDITINGTYPES", "Using the Type Row", "Utilisation du type Row", "Utilizzando il tipo di Riga", "Mit dem Text-Reihe", "Utilizando el Tipo de fila", "باستخدام صف نوع", "使用Type行", "タイプ行を使用して、", "유형 행을 사용하여", "Sử dụng các Loại Row", "Использование типа строки", "De rijtype"));
			Rows.Add( new DocumentationRow("ID_HELP_EDITINGTYPES1", "The Type Row designates the data type of the cells in the spreadsheet. Each column in the Type Row represents all of the cells in that column. The spreadsheet will automatically recognize valid Type Rows. If a Type Row is valid, the word \"Type\" will replace the \"2\" in the row designator. You may manually switch the second row to be a Type Row or a regular string data row by clicking the \"2\" or the word \"Type\" and choosing the which option suits your data.", "La ligne Type désigne le type de cellules dans la feuille de données. Chaque colonne du type ligne représente toutes les cellules de cette colonne. La feuille de calcul va reconnaître automatiquement le type de lignes valides. Si un type Row est valide, le mot \"Type\" remplacera le \"2\" dans la désignation de ligne. Vous pouvez modifier manuellement le deuxième ligne d'être un type Row ou un habitué ligne de données de chaîne en cliquant sur le \"2\" ou le mot \"Type\" et en choisissant l'option qui convient à vos données.", "Il tipo di riga indica il tipo di dati delle celle del foglio di calcolo. Ogni colonna nel tipo di riga rappresenta tutte le celle della colonna. Il foglio elettronico riconosce automaticamente il tipo di file validi. Se un tipo di riga è valida, la parola \"Tipo\" sostituirà il \"2\" del designatore fila. Si può passare manualmente la seconda fila di essere un tipo di riga o una riga di dati stringa regolare cliccando sul \"2\" o la parola \"Type\" e scegliendo l'opzione che si adatta alle vostre dati.", "Der Typ Row bezeichnet den Datentyp der Zellen im Arbeitsblatt. Jede Spalte in der Art Zeile stellt alle Zellen in dieser Spalte. Die Tabelle erkennt automatisch gültig Geben Reihen. Wenn ein Typ Row gültig ist, wird das Wort \"Typ\" die \"2\" in der Reihe Bezeichner ersetzen. Sie können manuell die zweite Reihe zu schalten, um eine Art Zeile oder einen regulären String-Datenzeile durch Klicken auf die \"2\" oder das Wort \"Typ\" und wählen Sie die Option, die besten Ihren Daten sein.", "El Tipo de fila designa el tipo de datos de las celdas en la hoja de cálculo. Cada columna de la Tipo de fila representa todas las células en esa columna. La hoja de cálculo reconocerá automáticamente Filas tipo válido. Si un tipo de fila es válido, la palabra \"Tipo\" sustituirá al \"2\" en el designador fila. Usted puede cambiar manualmente la segunda fila para ser un tipo de fila o una fila de datos de cadena normal haciendo clic en el \"2\" o la palabra \"Tipo\" y elegir la opción que se adapte a sus datos.", "الصف نوع يعين نوع البيانات من الخلايا في جدول البيانات. كل عمود في صف نوع يمثل كافة الخلايا في هذا العمود. سوف جدول تعترف تلقائيا الصفوف نوع صالحة. إذا كان صف نوع صحيح، فإن كلمة \"نوع\" تحل محل \"2\" في التسمية التوالي. يجوز لك إيقاف يدويا الصف الثاني ليكون صف نوع أو صف بيانات سلسلة منتظمة من خلال النقر على \"2\" أو كلمة \"النوع\" واختيار الخيار الذي يناسب البيانات الخاصة بك.", "类型列指定单元在电子表格中的数据类型。在类型列每列表示所有单元在该列的。该电子表格会自动识别有效的类型行。如果一个类型的行是有效的，单词“类型”，将在该行指示符替换为“2”。你可以手动切换第二行是一个类型行或通过单击“2”或单词“类型”，并选择哪个选项适合您的数据的规则字符串数据行。", "タイプの行は、スプレッドシートのセルのデータタイプを指定する。タイプ行の各列は、その列のすべてのセルを表します。スプレッドシートは自動的に有効なタイプの行を認識します。タイプ行が有効であれば、単語「タイプ」行指名に「2」を置き換えます。あなたは、手動で「2」または単語「タイプ」をクリックし、そのオプション、データをスーツを選択することで、タイプ行または通常の文字列のデータ行であることが2番目の行を切り替えることができる。", "입력 행이 스프레드 시트의 셀의 데이터 타입을 지정한다. 유형 행의 각 열은 해당 열의 모든 셀을 나타냅니다. 스프레드 시트가 자동으로 유효한 유형 행을 인식합니다. 유형 행이 유효한 경우, 단어 \"유형\"행 지정자에서 \"2\"를 대체합니다. 수동으로 입력 한 행 또는 \"2\"또는 단어 \"종류\"를 클릭하고있는 옵션은 데이터에 맞는 선택하여 일반 문자열 데이터 행을 할 두 번째 행을 전환 할 수 있습니다.", "Các Loại Row chỉ định kiểu dữ liệu của các tế bào trong bảng tính. Mỗi cột trong Loại Row đại diện cho tất cả các tế bào trong cột đó. Các bảng tính sẽ tự động nhận ra Loại Rows hợp lệ. Nếu một Loại Row là hợp lệ, từ \"Loại\" sẽ thay thế \"2\" trong vấn thiết kế hàng. Bạn có thể tự chuyển đổi hàng thứ hai là một Loại Row hoặc thường xuyên hàng chuỗi dữ liệu bằng cách click vào \"2\" hay chữ \"Type\" và chọn các tùy chọn mà phù hợp với dữ liệu của bạn.", "Тип Row определяет тип данных клеток в таблице. Каждый столбец в типовом строка представляет все клетки в этой колонке. Таблица будет автоматически распознавать действительные типа рядов. Если Тип Row действительно, слово \"типа\" заменит \"2\" в строке обозначение. Вы можете вручную переключить вторую строку, чтобы быть строчного типа или обычный ряд строковых данных, нажав кнопку \"2\" или слово \"типа\" и выбрав, какой вариант подходит ваши данные.", "De Type Row duidt het gegevenstype van de cellen in het werkblad. Elke kolom in de rijtype vertegenwoordigt alle cellen in die kolom. De spreadsheet wordt automatisch geldig Type Rijen herkennen. Als een Type Row geldig is, zal het woord \"Type\" de \"2\" in de rij aanwijzer vervangen. U kunt handmatig de tweede rij om een ​​Type Row of een regelmatige reeks data rij door te klikken op de \"2\" of het woord \"type\" en het kiezen van de optie die past bij uw gegevens."));
			Rows.Add( new DocumentationRow("ID_HELP_EDITINGTYPES2", "If the row is set to a Type Row, each of the cells in the row are able to be set to a specific Type. If you set a Type to something that is invalid, it may cause the data in the column to be flagged as Invalid.\n\nVoid is a special type, and is used to mark the column to be ignored when exporting.", "Si la ligne est réglé sur un type Row, chacune des cellules de la ligne sont en mesure d'être réglé sur un type spécifique. Si vous définissez un type à quelque chose qui ne est pas valide, il peut causer les données dans la colonne d'être marqués comme non valide.\n\nVoid est un type spécial, et est utilisé pour marquer la colonne pour être ignoré lors de l'exportation.", "Se la riga è impostata su un tipo di riga, ciascuna delle celle della riga sono in grado di essere impostato ad uno specifico tipo. Se si imposta un tipo a qualcosa che non è valido, esso può causare i dati nella colonna di essere contrassegnati come non valido.\n\nVoid è un tipo speciale, ed è usato per indicare la colonna da ignorati durante l'esportazione.", "Wenn die Zeile auf eine Art Reihe eingestellt ist, ist jede der Zellen in der Zeile in der Lage, zu einem bestimmten Typ festgelegt werden. Wenn Sie eine Art, etwas, das ungültig ist eingestellt, kann es dazu führen, die Daten in der Spalte als ungültig gekennzeichnet werden.\n\nVoid ist eine besondere Art, und wird verwendet, um die Spalte zu markieren beim Export ignoriert.", "Si la fila se establece en un tipo de fila, cada una de las celdas de la fila son capaces de ser fijado a un tipo específico. Si establece un tipo de algo que no es válido, puede causar que los datos de la columna que se marca como no válido.\n\nVacío es un tipo especial, y se utiliza para marcar la columna para ser ignorado cuando se exporta.", "إذا تم تعيين صف إلى صف نوع، كل من الخلايا في الصف قادرون على أن تعيين إلى نوع معين. إذا قمت بتعيين نوع إلى ما هو باطل، فإنه قد يتسبب في البيانات في العمود ليتم وضع علامة كما غير صالح.\n\nالفراغ هو نوع خاص، ويستخدم للاحتفال العمود لا يمكن تجاهله عند التصدير.", "如果该行被设置为一个类型行，每个电池行中的能够被设置为特定的类型。如果设置一个类型的东西是无效的，它可能会导致被标记为无效的列中的数据。\n\n空隙是一种特殊类型的，并且被用来标志列导出时被忽略。", "行タイプの行に設定されている場合は、行のセルの各々は、特定のタイプに設定されることが可能である。あなたは無効である何かに種類を設定した場合は、列のデータが無効なとしてフラグされる可能性があります。\n\nボイドが特殊なタイプで、エクスポート時に無視されるように列をマークするために使用されます。", "행이 유형의 행으로 설정되면, 행 내의 셀들의 각각은 특정 타입으로 설정 될 수있다. 당신이 유효 뭔가 유형을 설정하면 열의 데이터가 잘못된 것으로 표시 될 수 있습니다.\n\n보이드는 특별한 유형 및 내보낼 때 무시 열을 표시하는 데 사용된다.", "Nếu dòng được thiết lập để một Loại Row, mỗi tế bào trong hàng không có thể được thiết lập để một loại cụ thể. Nếu bạn thiết lập một loại cái gì đó là không hợp lệ, nó có thể gây ra các dữ liệu trong các cột được đánh dấu là không hợp lệ.\n\nVoid là một loại đặc biệt, và được sử dụng để đánh dấu các cột để được bỏ qua khi xuất khẩu.", "Если строка устанавливается в типовом Row, каждый из ячеек в строке могут быть установлены на определенный тип. Если вы установите в качестве типа что-то, что является недействительным, оно может сделать данные в колонке помечены как инвалиду.\n\nПустота особый тип, и используется, чтобы пометить столбец игнорируется при экспорте.", "Als de rij op een Type rij, elk van de cellen in de rij kunnen worden ingesteld op een bepaald type. Als een type iets die ongeldig ingesteld, kan dit leiden tot de gegevens in de kolom worden gemarkeerd als ongeldig.\n\nVoid is een speciaal type, en wordt gebruikt om de kolom moet worden genegeerd bij het exporteren."));
			Rows.Add( new DocumentationRow("ID_FADE_EXPORTINGWORKSHEETS", "Exporting Worksheets", "Exportateurs de feuilles de calcul", "Esportazione Fogli di lavoro", "Exportieren von Arbeitsblättern", "Exportadores de hojas de trabajo", "أوراق العمل المصدرة لل", "导出工作表", "エクスポートワークシート", "내보내기 워크 시트", "Xuất khẩu Worksheets", "Экспорт Рабочие", "Exporterende Werkbladen"));
			Rows.Add( new DocumentationRow("ID_HEADER_EXPORTINGWORKSHEETS", "Exporting your Worksheets from Google Docs", "Exportation de vos feuilles de calcul Google Docs", "Esportare i tuoi fogli di lavoro da Google Docs", "Exportieren Sie Ihre Arbeitsblätter von Google Text & Tabellen", "Exportar sus hojas de trabajo de Google Docs", "تصدير أوراق العمل الخاصة بك من محرر مستندات جوجل", "从谷歌文档导出您的工作表", "Googleドキュメントからあなたのワークシートのエクスポート", "Google 문서 도구에서 워크 시트를 내보내기", "Xuất khẩu Worksheets của bạn từ Google Docs", "Экспорт ваши рабочие листы с Google Docs", "Exporteren Werkbladen uit Google Docs"));
			Rows.Add( new DocumentationRow("ID_HELP_EXPORTINGWORKSHEETS", "Once you have set the Export Options, chosen a Export Type, and corrected any errors in your data you may export the data from Google, and it will save as either a generated Game Object, Static Class, or Data File.\n\n- Object Database: This type of database will generate a Game Object in your scene, attach a generated class, and save all the data in it. If the Game Object is deleted from the scene, or the script is removed it will destroy the data.\n\n- Static Database: This type of database is a generated class that you can access as a Singleton instance. The first time you access the class, all of the data will be initialized. All of the data is stored statically within the generated file, so it can be moved around at your convenience.\n\n- CSV: This is a generated CSV file that contains your data. It is up to you to parse the CSV file with a method of your choice.\n\n- XML: Like CSV, all of your data is saved in a generated XML file. It is up to you to parse it.\n\n- JSON: There are a few options for generating a JSON file that contains your data. For your convenience Google2u also generates a class that is specific to your JSON data, and can be used by JSON .NET to load it.\n\n- NGUI: This is basically the same as a CSV file, but is recognized by NGUI for localization.\n\n- Playmaker: You can as an option export generated Playmaker actions along with the Object Database. These actions are custom generated to access the data in the Object Database by Playmaker.", "Une fois que vous avez défini les options d'exportation, choisi un type d'exportation, et corrigé des erreurs dans vos données, vous pouvez exporter les données de Google, et il sera l'enregistrement comme un objet généré de jeu, statique classe, ou fichier de données.\n\n- Base de données de l'objet: Ce type de base de données génère un objet de jeu dans votre scène, joindre une classe générée, et enregistrer toutes les données qu'il contient. Si le but du jeu est supprimé de la scène, ou le script est retiré il va détruire les données.\n\n- Base de données statique: Ce type de base de données est une classe générée que vous pouvez accéder comme une instance Singleton. La première fois que vous accédez à la classe, l'ensemble des données sera initialisé. Toutes les données sont stockées de manière statique dans le fichier généré, de sorte qu'il peut être déplacé à votre convenance.\n\n- CSV: Ce est un fichier CSV généré qui contient vos données. Ce est à vous d'analyser le fichier CSV avec une méthode de votre choix.\n\n- XML: Comme CSV, toutes vos données sont sauvegardées dans un fichier XML généré. Ce est à vous de l'analyser.\n\n- JSON: Il ya quelques options pour générer un fichier JSON qui contient vos données. Pour votre commodité Google2u génère également une classe qui est spécifique à vos données JSON, et peut être utilisé par JSON .NET pour le charger.\n\n- Ngui: Ce est fondamentalement la même forme d'un fichier CSV, mais est reconnu par Ngui pour la localisation.\n\n- Le meneur de jeu: Vous pouvez comme une exportation d'option généré actions Playmaker avec la base de données d'objets. Ces actions sont générés personnalisé pour accéder aux données dans la base de données d'objets en meneur de jeu.", "Dopo aver impostato le opzioni di esportazione, scelto un tipo di esportazione, e corretti eventuali errori nel vostro dati è possibile esportare i dati da Google, e sarà scegliere fra un oggetto generato gioco, classe statica, o file di dati.\n\n- Database Oggetto: Questo tipo di database genererà un oggetto di gioco nella scena, allegare una classe generata, e salvare tutti i dati in esso. Se l'oggetto di gioco viene eliminato dalla scena, o lo script viene rimosso distruggerà i dati.\n\n- Database statico: Questo tipo di database è un classe generata che è possibile accedere come istanza Singleton. La prima volta che si accede alla classe, tutti i dati verranno inizializzati. Tutti i dati vengono memorizzati in modo statico all'interno del file generato, in modo che possa essere spostato a vostro piacimento.\n\n- CSV: Questo è un file CSV generato che contiene i dati. Spetta a voi per analizzare il file CSV con un metodo di vostra scelta.\n\n- XML: Come CSV, tutti i dati vengono salvati in un file XML generato. Spetta a voi per analizzarlo.\n\n- JSON: Ci sono alcune opzioni per la generazione di un file JSON che contiene i dati. Per vostra comodità Google2u genera anche una classe che è specifico per i dati JSON, e può essere utilizzato da JSON .NET per caricarlo.\n\n- Ngui: Questo è fondamentalmente lo stesso di un file CSV, ma è riconosciuto da Ngui per la localizzazione.\n\n- Playmaker: Potete come esportazione un'opzione generato azioni di Playmaker con il database degli oggetti. Queste azioni sono generati personalizzato per accedere ai dati nel database oggetto da Playmaker.", "Nachdem Sie die Exportoptionen festgelegt haben, gewählt ein Exporttyp und korrigiert Fehler in den Daten können Sie die Daten aus Google zu exportieren, und es wird entweder als ein Spiel erzeugt Gegenstand, Statische Klasse oder Datendatei zu speichern.\n\n- Objektdatenbank: Diese Art von Datenbank wird ein Spiel-Objekt in der Szene zu erzeugen, legen Sie eine generierte Klasse, und speichern Sie alle Daten darin. Wenn das Spiel-Objekt wird von der Szene gelöscht oder das Skript entfernt wird, werden die Daten zu zerstören.\n\n- Statische Datenbank: Diese Art von Datenbank ist eine generierte Klasse, die Sie als Singleton-Instanz zugreifen können. Das erste Mal, wenn Sie die Klasse zugreifen, werden alle Daten initialisiert werden. Alle Daten statisch in der generierten Datei gespeichert, so dass sie sich um nach Ihrem Belieben verschoben werden.\n\n- CSV: Das ist eine CSV-Datei generiert, die Ihre Daten enthält. Es liegt an Ihnen, die CSV-Datei mit einer Methode Ihrer Wahl analysieren.\n\n- XML: Wie CSV, ist alle Ihre Daten in einer dynamisch erzeugten XML-Datei gespeichert. Es liegt an Ihnen, es zu analysieren.\n\n- JSON: Es gibt ein paar Möglichkeiten zur Erzeugung eines JSON-Datei, die Ihre Daten enthält. Für Ihren Komfort erzeugt Google2u auch eine Klasse, die speziell auf Ihre JSON-Daten ist, und kann durch JSON .NET verwendet werden, um es zu laden.\n\n- Ngui: Dies ist grundsätzlich die gleiche wie eine CSV-Datei, sondern wird durch Ngui zur Lokalisierung erfasst.\n\n- Spielmacher: Sie können als Option Export generiert Spielmacher Aktionen zusammen mit der Objektdatenbank. Diese Aktionen werden benutzerdefinierte erzeugt werden, um die Daten in der Objektdatenbank von Spielmacher zuzugreifen.", "Una vez que haya configurado las opciones de exportación, elegido un tipo de exportación, y corregido los errores en sus datos es posible exportar los datos de Google, y se va a guardar el archivo como un objeto generado Juego, Clase estática, o archivo de datos.\n\n- Base de datos del objeto: Este tipo de base de datos generará un juego de objetos en su escena, adjunte una clase generada, y guardar todos los datos en él. Si el objeto del juego es eliminado de la escena, o se elimina la secuencia de comandos que va a destruir los datos.\n\n- Base de datos estático: Este tipo de base de datos es una clase generada que se puede acceder como una instancia de Singleton. La primera vez que acceda a la clase, todos los datos se inicializará. Todos los datos se almacenan de forma estática en el archivo generado, por lo que se puede mover en torno a su conveniencia.\n\n- CSV: Este es un archivo CSV generado que contiene sus datos. Es hasta usted para analizar el archivo CSV con un método de su elección.\n\n- XML: como CSV, todos sus datos se guardan en un archivo XML generado. Es hasta usted para analizarlo.\n\n- JSON: Hay algunas opciones para generar un archivo JSON que contiene sus datos. Para su comodidad Google2u también genera una clase que es específica a sus datos JSON, y puede ser utilizado por JSON .NET para cargarlo.\n\n- Ngui: Esto es básicamente lo mismo que un archivo CSV, pero es reconocido por ngui para la localización.\n\n- Playmaker: Usted puede como una exportación opción genera acciones Playmaker junto con la base de datos de objetos. Estas acciones se generan personalizado para acceder a los datos en la base de datos de objetos por Playmaker.", "وبمجرد الانتهاء من تعيين خيارات التصدير، اختار نوع التصدير، وتصحيح أي أخطاء في البيانات الخاصة بك قد تصدير البيانات من جوجل، وأنه سيوفر إما كائن ولدت لعبة، ساكنة من الدرجة الاولى، أو ملف بيانات.\n\n- قاعدة بيانات كائن: وهذا النوع من قاعدة البيانات إنشاء كائن لعبة في المشهد الخاص بك، ونعلق على الفئة التي تم إنشاؤها، وحفظ كافة البيانات في ذلك. إذا تم حذف كائن لعبة من المشهد، أو تتم إزالة النصي فإنه سيتم تدمير البيانات.\n\n- قاعدة بيانات ثابتة: وهذا النوع من قاعدة البيانات هو الفئة التي تم إنشاؤها التي يمكنك الوصول إليها كما مثيل سينغلتون. في المرة الأولى التي الوصول إلى فئة، وسيتم تهيئة كافة البيانات. يتم تخزين كافة البيانات بشكل ثابت داخل الملف ولدت، لذلك يمكن نقلها من مكان على راحتك.\n\n- CSV: هذا هو ملف CSV ولدت يحتوي على البيانات الخاصة بك. الأمر متروك لك لتحليل ملف CSV مع طريقة اختيارك.\n\n- XML: مثل CSV، جميع البيانات الخاصة بك يتم حفظها في ملف XML الذي تم إنشاؤه. والأمر متروك لكم لتحليل ذلك.\n\n- JSON: هناك عدد قليل من الخيارات لتوليد ملف JSON يحتوي على البيانات الخاصة بك. لراحتك Google2u أيضا يولد فئة غير محددة لبيانات JSON الخاص بك، ويمكن استخدامها من قبل JSON .NET لتحميله.\n\n- NGUI: هذا هو أساسا نفس ملف CSV، ولكن معترف بها من قبل NGUI للتوطين.\n\n- صانع ألعاب: يمكنك كما إنشاء تصدير الخيار الإجراءات صانع الالعاب جنبا إلى جنب مع قاعدة بيانات كائن. هي العادة إنشاء هذه الإجراءات للوصول إلى البيانات في قاعدة بيانات كائن بواسطة صانع الالعاب.", "一旦你设置导出选项，选择了一个导出类型，并纠正您的数据的任何错误，你可以从谷歌导出数据，它会存放为生成的游戏对象，静态类或数据文件。\n\n - 对象数据库：这种类型的数据库将在场景中生成一个游戏对象，附上生成的类，并保存所有的数据在里面。如果游戏的对象是从场景删除或脚本除去它会破坏的数据。\n\n - 静态数据库：这类型的数据库是可以作为一个Singleton实例访问生成的类。当您第一次访问类，所有的数据将被初始化。所有的数据被静态地存储所生成的文件中，因此它可以绕在方便时被移动。\n\n -  CSV：这是包含您的数据的生成CSV文件。它是由你来解析CSV文件与您所选择的方法。\n\n -  XML：像CSV，所有的数据保存在生成​​的XML文件。它是由你来解析它。\n\n -  JSON：有几个选项，用于生成包含您的数据的JSON文件。为了您的方便Google2u也产生一类是针对您的JSON数据，并且可以使用JSON .NET加载它。\n\n -  NGUI：这是基​​本相同的CSV文件，但由NGUI本地化确认。\n\n - 中场组织者：您可以作为一个选项导出生成中场组织者的行动随着对象数据库。是定制生成这些动作由中场组织者访问数据中的对象数据库。", "あなたは、エクスポートオプションを設定してエクスポートタイプ選択され、データ内のすべてのエラーを修正したら、あなたは、Googleからデータをエクスポートがあり、それはどちらか生成されたゲームオブジェクト、静的クラス、またはデータファイルとして保存されます。\n\n - オブジェクトデータベース：データベースのこのタイプは、シーン内のゲームオブジェクトを生成し、生成されたクラスを添付し、そしてその中のすべてのデータが保存されます。ゲームオブジェクトがシーンから削除され、またはスクリプトが削除された場合、データを破壊します。\n\n - 静的データベース：データベースのこのタイプを使用すると、シングルトンインスタンスとしてアクセスすることができ、生成されたクラスです。あなたがクラスに初めてアクセスするには、すべてのデータが初期化されます。データのすべてが生成されたファイル内で静的に保存されますので、ご都合の良い時の周りに移動することができます。\n\n -  CSV：これはあなたのデータが含まれて生成されたCSVファイルです。それはあなたの選択の方法でCSVファイルを解析するのはあなた次第です。\n\n -  XML：CSVのように、あなたのすべてのデータが生成されたXMLファイルに保存されます。それは、それを解析するのはあなた次第です。\n\n -  JSON：あなたのデータが含まれているJSONファイルを生成するためのいくつかのオプションがあります。あなたの便宜のためにGoogle2uまた、あなたのJSONデータに固有であるクラスを生成し、それをロードするためにJSON .NETで使用することができます。\n\n -  NGUI：これは、基本的にCSVファイルと同じであるが、局在化NGUIによって認識される。\n\n - プレーメーカー：あなたができるオプションのエクスポートなどは、オブジェクトデータベースと一緒にプレーメーカーアクションを生成した。これらのアクションは、カスタムプレーメーカーによってオブジェクトデータベース内のデータにアクセスするために生成されている。", "당신이 내보내기 옵션을 설정 내보내기 유형을 선택하고 데이터에 오류를 해결 한 후에는 구글에서 데이터를 내보낼 수 있으며,이 중 생성 된 게임 오브젝트, 정적 클래스, 또는 데이터 파일로 저장합니다.\n\n- 객체 데이터베이스 : 이런 유형의 데이터베이스 생성 된 클래스를 첨부 장면에서 게임 오브젝트를 생성하고, 그 안에 모든 데이터를 저장합니다. 게임 오브젝트가 장면에서 삭제되고, 또는 스크립트가 제거되는 경우 그 데이터를 파기한다.\n\n- 정적 데이터베이스 : 데이터베이스의이 유형은 당신이 싱글 인스턴스로 액세스 할 수있는 생성 된 클래스입니다. 만약 클래스 액세스 처음 모든 데이터가 초기화된다. 모든 데이터는 상기 생성 된 파일에 정적으로 저장되어 있으므로 사용자의 편의에 주위를 이동할 수있다.\n\n- CSV :이 데이터를 포함하는 생성 된 CSV 파일입니다. 그것은 당신의 선택의 방법으로 CSV 파일을 구문 분석하는 당신에게 달려있다.\n\n- XML​​ : CSV와 마찬가지로, 모든 데이터가 생성 된 XML 파일에 저장됩니다. 그것은 구문 분석을 귀하에게 달려 있습니다.\n\n- JSON은 : 당신의 데이터가 포함 된 JSON 파일을 생성하기위한 몇 가지 옵션이 있습니다. 사용자의 편의를 위해 Google2u 또한 JSON 데이터를 특정하고, 그것을로드 JSON .NET에서 사용할 수있는 클래스를 생성합니다.\n\n- NGUI : 이것은 기본적 CSV 파일과 동일하지만, 지역화 NGUI 의해 인식된다.\n\n- 플레이 메이커 : 당신 내보내기 옵션은 객체 데이터베이스와 함께 플레이 메이커 액션을 생성 된 수 있습니다. 이러한 작업은 사용자에 의해 플레이 메이커 객체 데이터베이스 내의 데이터를 액세스하기 위해 생성된다.", "Một khi bạn đã thiết lập các tùy chọn Export, chọn Type xuất khẩu, và sửa chữa bất kỳ sai sót trong dữ liệu của bạn, bạn có thể xuất dữ liệu từ Google, và nó sẽ được lưu dưới hoặc là một trò chơi đối tượng được tạo ra, Static Class, hoặc tập tin dữ liệu.\n\n- Object Database: Đây là loại hình cơ sở dữ liệu sẽ tạo ra một trò chơi đối tượng trong khung cảnh của bạn, đính kèm một lớp được tạo ra, và lưu tất cả các dữ liệu trong đó. Nếu game Object sẽ bị xóa khỏi hiện trường, hoặc các kịch bản được lấy ra nó sẽ phá hủy dữ liệu.\n\n- Cơ sở dữ liệu tĩnh: Đây là loại hình cơ sở dữ liệu là một lớp được tạo mà bạn có thể truy cập như là một ví dụ Singleton. Lần đầu tiên bạn truy cập vào các lớp học, tất cả các dữ liệu sẽ được khởi tạo. Tất cả các dữ liệu được lưu trữ tĩnh bên trong file được tạo ra, vì vậy nó có thể được di chuyển xung quanh một cách thuận tiện.\n\n- CSV: Đây là một tập tin CSV tạo ra có chứa dữ liệu của bạn. Đó là vào bạn để phân tích các tập tin CSV với một phương pháp lựa chọn của bạn.\n\n- XML: Giống như CSV, tất cả các dữ liệu của bạn được lưu trong một tập tin XML được tạo ra. Đó là vào bạn để phân tích nó.\n\n- JSON: Có một vài lựa chọn để tạo ra một tập tin JSON chứa dữ liệu của bạn. Để tiện cho bạn Google2u cũng tạo ra một lớp học mà là cụ thể cho dữ liệu JSON của bạn, và có thể được sử dụng bởi JSON .NET để tải nó.\n\n- Ngừi: Đây là cơ bản giống như một tập tin CSV, nhưng được công nhận bởi ngùi cho nội địa hóa.\n\n- Playmaker: Bạn có thể là một lựa chọn xuất khẩu tạo ra hành động Playmaker cùng với các cơ sở dữ liệu đối tượng. Những hành động tùy chỉnh được tạo ra để truy cập dữ liệu trong cơ sở dữ liệu đối tượng của Playmaker.", "После того как вы установите режим экспорта, выбранный тип экспорта, и исправить любые ошибки в данных, которые вы можете экспортировать данные из Google, и это позволит сэкономить или как генерируется цель игры, статический класс или файл данных.\n\n- База данных объектов: Этот тип базы данных будет генерировать цель игры в вашей сцене, приложите сгенерированный класс, и сохранить все данные в нем. Если игра объект удаляется со сцены, или скрипт удаляется он будет уничтожать данные.\n\n- Статический База данных: Этот тип базы данных создается класс, вы можете получить доступ как экземпляр Singleton. Первый раз, когда вы обращаетесь к классу, все данные будут сброшены. Все данные хранятся статически в рамках сформированного файла, так что он может быть перемещен на вашем удобстве.\n\n- CSV: Это генерируется CSV-файл, содержащий данные. Это до вас, чтобы разобрать файл CSV с методом по вашему выбору.\n\n- XML: Как CSV, все ваши данные сохраняются в сгенерированной XML файла. Это до вас, чтобы разобрать его.\n\n- JSON: Есть несколько вариантов для генерации JSON-файл, содержащий данные. Для вашего удобства Google2u также генерирует класс, который является специфичным для данных JSON, и может быть использован JSON .NET, чтобы загрузить его.\n\n- NGUI: Это в основном так же, как файл CSV, но признается NGUI для локализации.\n\n- Плеймейкер: Вы можете также экспорт вариант генерируется действия плеймейкер вместе с базой данных объектов. Эти действия обычай создается для доступа к данным в базе данных объект, Playmaker.", "Als je eenmaal hebt ingesteld de Export Options, gekozen voor een Exporttype, en gecorrigeerd eventuele fouten in uw gegevens kunt u de gegevens van Google te exporteren, en het zal redden als ofwel een gegenereerde Game Object, statische klasse, of Data File.\n\n- Object Database: Dit type database zal een Game Object genereren in uw scene, bevestigt een gegenereerde klasse, en sla alle gegevens in het. Als de Game Object wordt verwijderd uit de scène, of het script wordt verwijderd zal het de gegevens te vernietigen.\n\n- Statische Database: Dit type database is een gegenereerde klasse die u toegang als een Singleton instantie. De eerste keer dat u de klasse, zullen alle gegevens worden geïnitialiseerd. Alle data wordt statisch opgeslagen in het gegenereerde bestand, zodat het kan worden verplaatst op uw gemak.\n\n- CSV: Dit is een gegenereerde CSV-bestand dat uw gegevens bevat. Het is aan jou om het CSV-bestand te ontleden met een methode van uw keuze.\n\n- XML: Net als CSV, al uw gegevens worden opgeslagen in een gegenereerde XML-bestand. Het is aan u om het te ontleden.\n\n- JSON: Er zijn een paar opties voor het genereren van een JSON-bestand dat uw gegevens bevat. Voor uw gemak Google2u genereert ook een klasse die specifiek is voor uw JSON data, en kan gebruikt worden door JSON NET te laden.\n\n- Ngui: Dit is in principe hetzelfde als een CSV-bestand, maar wordt erkend door Ngui voor lokalisatie.\n\n- Playmaker: U kunt als optie uitvoer gegenereerd Playmaker acties samen met de Object Database. Deze acties zijn op maat gemaakt in de Object Database toegang tot de gegevens door spelmaker."));
